  `award_money_all` decimal(11,6) DEFAULT NULL COMMENT '所获奖金',
  `award_money_district` decimal(11,6) DEFAULT NULL COMMENT '区级拨款',
  `award_money_school` decimal(11,6) DEFAULT NULL COMMENT '校级拨款',
  `award_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '获奖时间',
  `is_prize` int(11) NOT NULL DEFAULT '0' COMMENT '是否获奖(0否 1是)',
