INSERT INTO `innovate_declare_info` VALUES (23,6,32,NULL,447,'小熊科技',3,5,12,0,0,0,60.000000,NULL,NULL,NULL,'2019-03-26 13:31:32','广西小熊信息科技有限公司',1),(24,4,27,NULL,465,'智能物料搬运机器人',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 12:44:26','在如今智能科技的高速发展下，机器人已经逐渐的走向了人们的生活当中，减少了许多的劳动力，解放了双手。智能物料搬运机器人是通过寻迹传感器识别地面上的印记，按照这个印记前往指定地方扫描二维码获取任务，再通过颜色传感器来准确的抓起相应的物品，并放到指定区域，它是集扫描，识别，搬运与一体的智能机器人。',0),(25,7,31,NULL,464,'基于STM32单片机设计的智能宠物家居系统',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-26 10:57:13','智能宠物家居系统以STM32单片机为核心控制元件，主要包括主控模块、自动投食模块、温控模块、GSM短信报警模块、串口屏显示模块等6个部分。系统上电后，进入自动温控模式，通过温度传感器实时采集宠物生活环境温度，若温度太高，打开降温设备；若温度太低，打开升温设备，让宠物家居环境维持在适宜温度，为宠物的健康成长提供一个舒适的家；当主人不在家时，开启自动投食模式，定时定量为宠物提供食物。通过压力传感器可检测食物剩余量，若超过设置的报警值，将通过GSM短信报警模块将信息传输到主人手机，让主人及时处理，从而实现自动投食功能。',0),(26,4,5,NULL,470,'沃替西汀药-药共晶及新盐型的研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-26 11:06:04','沃替西汀，是2013年经美国食品与药品管理局（FDA）批准上市的Brintellix的活性药物成分（API），用于治疗成人重度抑郁症。Brintellix本质上是一种沃替西汀的氢溴酸盐。因为沃替西汀水溶性低、稳定性差，影响了其在体内吸收的效果，所以沃替西汀最终是以氢溴酸-新盐型的形式上市，本研究的目的是利用晶体工程理论设计沃替西汀药-药共晶及新盐型，探讨不同的晶体结构对沃替西汀理化性质的影响，以期望制备出药学性能更优良（水溶性高且稳定性好）的沃替西汀新的固态形式。药-药共晶和盐型是药物晶体工程热点研究领域，一方面可以通过药-药共晶和盐型改善药物的理化性质，从而改善药物的生物利用度；另一方面，药-药共晶和盐型所用到的共晶物质（CCF），本身已经是上市的药物，安全性高，不需要进行药物上市后期所需要进行的毒性及安全性实验，缩短了研发周期，节约了成本，具有重要的意义。\n',0),(27,1,49,NULL,312,'非遗锤揲工艺在现代茶具设计中的应用',1,0,NULL,0,0,0,NULL,NULL,NULL,NULL,NULL,'新潮时代的到来，意味着市场的热潮，产品更迭迅速，在面对消费选择时，往往会根据产品品质及适用度进行对比来选择，有特色的产品会从中脱颖而出，而消费者潜意识中对特色的产品存有理智性的分析，从而选择适合自己且价格合理的商品。所以产品必须以更具艺术感的设计，更好的品质胜出。\n本项目创新之处在于把非物质文化遗产——锤揲工艺技术引进高校，通过与学校多专业教学资源相结合，更好的让学生发挥对工艺的传承和对产品造型的创新设计，以及产品在茶文化领域的市场开拓。项目组成员已在传统手工艺制作，有一定经验基础独立完成手工茶具制作，努力实现传承发扬创新。\n',0),(28,9,43,NULL,479,'基于“乡村振兴战略”的广西都梅村特色小镇建设研究',1,2,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-26 12:47:50','本项目基于国家大力推进“乡村振兴战略”为背景，以乡村发展特色小镇推动乡村走向致富道路为研究目标。通过建设乡村特色小镇，开发特色休闲农业，推动乡村走向致富之路。课题以广西梧州市龙圩区新地镇都梅村为研究对象，该村主要依托当地的特色农业，凭借优越的地理位置，通过流转将闲置土地调整为村集体土地，通过引进外资企业，借助其先进的技术和管理经验来促进乡村特色小镇的发展，建立和完善了相关制度，最终达到乡村振兴的目的。',0),(29,7,31,NULL,126,'一“箱”情愿跟你走',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-26 13:13:06','本项目是以STM32F103ZET6单片机为核心控制元件，设计一款可爬楼式智能跟随行李箱。系统以单片机为主控核心，主要由自动跟随模块、爬楼模块、电源模块、防盗模块、语音提醒模块组成，具有自动跟随、爬楼、充电、自动报警、搭载儿童、语音提醒等人性化功能。本设计性能出众，适用性强，性价比高，使出行更加便捷，解决了目前行李箱笨重不便携带、易丢失、上楼梯不方便等问题，能够让人们放开双手轻松自由地出行，可以在各种场合使用并推广。',0),(30,4,5,NULL,483,'利用氢键超分子合成子改善非布索坦药物理化性质的研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-26 13:20:27','难溶性羧酸类药物非布索坦是近40年来FDA批准的首个抗痛风新药，具有良好的市场前景。但是由于其水溶性低（12.9 mg/L），导致药物溶出速率下降，进而影响到体内吸收。本项目利用氢键超分子自组装的原理制备非布索坦的新的固态化学形式，以期望改善其水溶性，增加溶出速率，进而达到提高非布索坦生物利用度的效果。',0),(31,4,11,NULL,446,'漆酶催化降解六堡茶茶叶渣中木质素性能的研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-26 13:58:07','随着人类社会的快速发展，世界能源的消耗量也日益加剧，三大能源（煤、石油、天然气）毕竟来源有限，早已不能满足人类社会的需要。木质素是自然界中含量仅次于纤维素的一类可再生有机物，它来源广泛。本项目利用漆酶在“渗透调节物质”作为组分的溶剂中降解六堡茶茶叶渣中木质素，实现木质素和纤维素分离，并考察了溶剂pH值、反应温度、反应时间、漆酶添加量等因素，对漆酶催化降解六堡茶茶叶渣中木质素性能的影响，得到最佳降解条件，并对降解产物进行检测、分析。本项目为天然产物中木质素的降解、分离和利用提供了新方法。',0),(32,2,42,NULL,488,'基于机器学习恶意流量分析系统',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-26 14:12:59','根据国外公司 Distil Networks 发布的报告，2017年机器流量占全网流量的42.20%，其中恶意机器流量占21.80%。该项目通过流量监测出恶意软件的程序，通过公开的含有恶意软件的黑名单，通过对用户的网络访问请求进行分析，判断其使用访问了恶意软件的服务器地址，下载链接，可疑域名，可疑文件名来判断是否遭受了恶意软件的感染。',0),(33,2,42,NULL,490,'基于大数据下的社交隐私泄露危害预警系统',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-26 14:11:17','由于社交网络上的个人信息很难得到有效保护，我们这种事无巨细的分享方式让个人隐私的泄露在所难免，至于由于消费者数据泄露导致的隐私泄漏。\n本次研究，目的就在于研究出一套社交隐私泄露危害系统，以便揪出判断个人在社交网络中个人隐私泄露的严重程度，并且分析出存在泄露危害的信息，让用户个人对存在泄露个人信息信息危害的信息进行处理，充分保护人们在进行网络社交时个人隐私泄露等一系列安全问题。\n',0),(34,10,53,NULL,502,'大学生网络政治参与存在的问题及解决路径',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-26 15:55:58','随着我国互联网的不断发展、普及，我国网民数量不断增加。人们的网络生活也变得越来越丰富，各种新闻头条，时事政治不断进入大众视野。人们在阅读后还可以在评论区发表自己的观点或看法，参与讨论。但是，在一些与政治有关的网络评论区里，我们有时可以看到反对政府的政策或是其它与我国既定大政方针相悖的言论，有些甚至是过激的。参与这些评论的不乏普通大众，更有具备一定专业知识的大学生。细看这些言论，我们可以明显感到其中大多数的评论不合理不正确。这主要是评论人自身的政治理论素养和辩证思维能力不足所导致的对国家政策的片面理解。也是由于我们思想政治宣传工作没有做细致做到位。那么，对于此类问题，宣传部门要做的是有针对性、实效性地开展工作，纠正大学生网络政治参与认识上的误区与不足，从而解决思想矛盾，提高大学生对国家政治的认同感和幸福感。就此而言，本项目的工作具有非常重要的现实意义。',0),(35,1,49,NULL,441,'苍梧六堡茶制作技艺商业插画设计',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-26 17:01:22','苍梧六堡茶制作技艺是国家级非遗项目，是梧州精神和文化的体现，保护和传承极具地方特色的非遗项目具有积极的意义。\n本项目主要通过设计完成国家级非遗项目——苍梧六堡茶制作技艺的系列商业插画，将梧州非遗以商业插画的手法展示出来，进行保护与传承，推广传播。\n在项目实施过程中，可以对大学生资源和社会资源进行合理有效的配置与整合，把其已有的专业知识运用到创新训练的实践中，在锻炼综合能力的同时，提高大学生的社会实践能力，从而增强社会竞争力。',0),(36,9,62,NULL,509,'精准扶贫建档立卡大学生毕业就业情况调查',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 01:46:13','我国一大战略目标就是实现2020年要打赢扶贫攻坚战。国家为此做了许多政策的鼓励，发动各种社会团体共同发力打赢扶贫攻坚战。我们团队主要研究精准扶贫建档立卡大学生毕业就业情况。主要选择梧州学院的该类学生作为研究对象。研究的内容主要是国家的精准扶贫政策、学校的就业帮扶措施、当地政府对精准政策的落实对建档立卡的毕业生就业情况的影响。学校是该类学生精准扶贫帮扶就业的的具体实施者。我们希望通过这次调查研究能够从扶贫政策和学校的帮扶具体方法中总结反思，为以后的学校帮扶工作的开展提供具有建设意义的措施。',0),(37,7,4,NULL,511,'光学显微镜自动聚焦中质量评价窗口构建',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-27 02:15:19','聚焦窗口的构建是自动聚焦的重要组成部分，对聚焦结果的准确性和实时性具有重要影响。传统的取窗算法包含属于固定构建的中心取窗、多点取窗，以及基于动态取窗的高斯取窗和一阶矩取窗等。本项目对常用的搜索策略的原理和过程进行了研究，在理论上提出了一种新的改进式自动聚焦技术，并给出了具体的操作步骤。最后，对基于数字化图像聚焦深度法的整个过程进行总结，正焦位置搜索将整个聚焦过程串连起来，保证评价函数和搜索算法相辅相成、有条不紊地完成对清晰图像的查找。',0),(38,3,43,NULL,516,'大数据服务-人才培养及第三方招聘平台',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 03:01:06','随着科学技术进步，人类活动产生的信息形成的数据可以被越来越多的处理，从而产生巨大的价值，从商业到科学，从政府到艺术，大数据已经覆盖了包括衣食住行等与日常生活密切相关的产业，但在人力资源行业，特别是校园招聘方面仍然有巨大的开发前景。\n本项目服务人群目标是各高校在校生、应届毕业生及社会企业人力资源部门，致力于通过互联网+大数据+服务模式打造一个客观诚信的第三方招聘服务平台，通过大数据分析与定向培养，为企业提供优秀的发展伙伴，增强大学生实践技能促进就业，以此整合人力资源，为社会发展做出贡献。',0),(39,3,31,NULL,405,'“吴嘻嘻的小卖铺”——少女感女装工作室在互联网下的创新与运用',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 03:11:59','随着“互联网+”的快速发展，淘宝得以迅速崛起，传统的营销方式已经不能满足消费者的要求。我们必须改变传统的竞争方式，谋求新的发展。因此，“吴嘻嘻的小卖铺”少女感女装工作室应运而生，以打造客户体验最优的物流履约平台为使命,,提供一体化的物流解决方案,实现库存共享及订单集成处理,可提供仓配一体。不仅可以更高效率地满足顾客对美的需求，还可以整合周边宣传资源，致力打造一个以阿里巴巴为平台，以梧州学院为基点的服装品牌，成为梧州学院第一个可以手机下单，送货上门的女装品牌。',0),(40,1,49,NULL,468,'国家级非遗——藤县狮舞系列招贴设计',1,2,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-27 03:18:17','文化遗产是千百年来祖先留给我们的宝贵财富，是民族精神和气质代代相传的纽带，保护和传承极具地方特色的非遗项目具有积极的意义。\n本项目主要是通过国家级非遗——藤县狮舞系列平面设计（海报/招贴）的形式，将梧州非遗以（海报/招贴）的表现手法展示出来，进行传承与保护，推广至广大青少年及广大市民，从而提升梧州市经济文化水平。\n本项目在项目实施过程中，可以对大学生资源和社会资源进行合理有效的配置与整合，把已有的专业知识运用到实践训练中，提高其的社会实践能力，提升综合能力，从而增强社会竞争力。',0),(41,3,31,NULL,519,'“吴嘻嘻的小卖铺”——少女感女装工作室在互联网下的创新与运用',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 03:24:30','随着“互联网+”的快速发展，淘宝得以迅速崛起，传统的营销方式已经不能满足消费者的要求。我们必须改变传统的竞争方式，谋求新的发展。因此，“吴嘻嘻的小卖铺”少女感女装工作室应运而生，以打造客户体验最优的物流履约平台为使命,,提供一体化的物流解决方案,实现库存共享及订单集成处理,可提供仓配一体。不仅可以更高效率地满足顾客对美的需求，还可以整合周边宣传资源，致力打造一个以阿里巴巴为平台，以梧州学院为基点的服装品牌，成为梧州学院第一个可以手机下单，送货上门的女装品牌。',0),(42,8,57,NULL,96,'广西梧州特色中草药凉茶的现状调查与发展对策研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 03:27:14','凉茶是梧州人的情结，是一个区域饮食文化的构成部分，也是中华民族饮食文化的组成部分，梧州中草药凉茶具有明显的地域性、传承性、稳定性和民族性特征。本项目将详尽调查梧州中草药凉茶的现状（包括产业、销售等现状），并对凉茶文化及其潜在的市场经济价值进行深入探讨，分析梧州凉茶缺乏大力发展的现实条件。通过田野调查梧州凉茶的现状，探讨在现代化快节奏生活下、饮食文化推广方面梧州凉茶应该做出的积极转变，总结可复制和可推广的经验应用到梧州凉茶中，为大力发展梧州凉茶，塑造梧州特色的饮食文化形象和推进区域经济发展作出贡献。\n',0),(43,3,60,NULL,513,'“启智教育”培训中心',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 03:38:38','我们团队所创立的“启智教育”培训中心是一款平民化的教育培训机构。它针对学校大班教育中存在的不足和校外的小型辅导机构师资力量的参差不齐，以及大型辅导机构收费过高的问题而进行改进的教育机构。我们充分地利用梧州学院这个大平台来招募梧州学院的优秀大学生作为我们培训机构的老师，再对外聘请优秀的退休老教师作为我们的荣誉校长来负责培训我们的大学生，以提高我们的师资力量和教育水平，从而达到降低成本的目的。',0),(44,5,47,NULL,474,'南宁那楼亲属称谓文化研究',1,2,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-27 04:45:52','       项目研究对象为南宁市邕宁区那楼镇亲属称谓情况。通过实地调查及访谈分析壮语亲属称谓，从语言形成看族群文化心理。通过对南宁市邕宁区那楼壮语亲属称谓的研究来挖掘那楼镇的文化内涵，让更多的人从邕宁区那楼镇的亲属称谓中认识那楼镇的文化内涵，从而增强人们对该地区的风土人情的关注力度及提高人们保护地方特色方言多样性及其文化的意识，从而达到保护地方语言的作用。',0),(45,10,57,NULL,526,'广西天等县旅游文化价值挖掘与开发',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 05:46:48','      本项目以经济尚欠发展的广西天等县旅游文化价值挖掘与开发研究为主题，目的是将天等县打造成独具壮乡文化特色的旅游生态胜地。通过都康田园风光、狮山银湖、万福寺等特色景点，以及天等八角、苦丁茶园、壮乡五色糯米饭等特产，将天等县打造成游览、住宿、饮食、娱乐、购物一体化的具有浓厚壮乡文化氛围的特色旅游景点。旅游业对经济的发展带动作用明显，吃、住、行，样样都蕴含着商机。发展天等县的壮乡文化特色旅游业，以响应国家的乡村振兴战略、扶贫开发政策、生态保护政策，从而促进天等县的文化传播与经济发展，有利于带动天等县青年回乡创业，让天等县人民过上美好幸福的生活。',0),(46,10,56,NULL,532,'广西巴马新型生态养老模式研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 06:44:57','      据全国老龄办发布数据显示，截至2017年底，我国60岁及以上老年人口有2.41亿人，占总人口17.3%。预计到2020年，全国60岁以上老年人口将增加到2.55亿人左右，老年抚养比将提高到28%左右。老龄化已经成为中国社会的一大困惑。随着老龄化社会的到来，日益庞大的老年群体成为一个新兴的消费群体，构成了巨大的老年需求、消费市场，同时也带来了无限的商机。\n       本项目研究基于人口老龄化背景下，结合广西省河池市巴马长寿之乡的自然条件、人文文化等得天独厚养生资源，将老年人医疗、照护、社交、娱乐等多元化需求与本地地理人文、文化风俗和居民融合，推出 “养生、度假、休闲+养老院”的旅游养老服务,探索出一种新型生态养老模式。该模式主要以建立长期居住的生态养老社区为主，以大力开发一批适宜个人短期居住的度假型养老旅游酒店为辅，为人们提供纯天然的养老服务。',0),(47,8,60,NULL,143,'“互联网+”视频直播线上帮扶教学课堂',3,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 09:12:27','近年来，儿童权益越来越受到社会的广泛关注，为了提高儿童整体素质，让儿童获得技能提升，为此本团队提出互联网+帮扶课堂项目想法，并以“5+1+N”新模式为载体。\n“5”是指周一至周五的四点半放学之后，困境儿童聚集在儿童之家，配备两地相同的教学设备（电脑、摄像头、音响），大学生志愿者在固定网络教学点，运用视频直播或录制视频的新形式实现互联网+教学，选出班级课代表维持课堂秩序，时长为30分钟。\n“1”是指每月一次的教学任务检查，大学生志愿者服务团队下到乡镇进行面对面考核，与儿童进行互动交流，检查作业进度，根据学习任务的完成情况升级学习资源包。\n“N”是指在教学活动的过程中，开展多种形式的活动。\n\n',0),(48,7,4,NULL,541,'光学显微镜自动聚焦中质量评价窗口构建',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 09:33:45','聚焦窗口的构建是自动聚焦的重要组成部分，对聚焦结果的准确性和实时性具有重要影响。传统的取窗算法包含属于固定构建的中心取窗、多点取窗，以及基于动态取窗的高斯取窗和一阶矩取窗等。本项目对常用的搜索策略的原理和过程进行了研究，在理论上提出了一种新的改进式自动聚焦技术，并给出了具体的操作步骤。最后，对基于数字化图像聚焦深度法的整个过程进行总结，正焦位置搜索将整个聚焦过程串连起来，保证评价函数和搜索算法相辅相成、有条不紊地完成对清晰图像的查找。',0),(49,4,5,NULL,445,'木薯渣纳晶纤维素功能化研究',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-27 11:49:51','以广西特产木薯渣制备的纳晶纤维素为原料，设计与构建以纳米微晶纤维素为载体的药物缓控释系统，在生物医药领域将具有良好的应用前景。但是一般的未经修饰的纳米微晶纤维素并不能直接应用，需要经过进一步的功能化改性，引入多种功能基团或偶联上一些具有特殊性能的分子，从而改善其理化性能，甚至赋予其多种新功能。\n',0),(50,4,11,NULL,545,'六堡茶茶叶渣中木质素的催化改性研究 ',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 12:26:32','    木质素作为化学结构极其复杂的高分子天然聚合物，活性很差，空间位阻高，难以有效进行反应。因此对木质素进行改性，提高其反应活性是目前研究的热点。常见的木质素改性方法主要有羟甲基化、脱甲基化、酚化等。但是这些改性方法均存在一些缺点，或者毒性较大，或者污染环境，亦或者成本较高，并不符合当今绿色化学的要求。本项目在离子液体中采用CrCl3催化改性六堡茶茶叶渣中木质素，并通过FT-IR、1H-NMR、GC-MS等手段对处理后的木质素进行分析，得到木质素改性的新方法，为植物纤维原料的高值化利用，提供参考和依据。',0),(51,4,5,NULL,452,'茶枯粉的制备及销售',3,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 12:35:33','茶皂素是从山茶科植物的种子中提取的一种糖式化合物，它属皂素类，是一种天然非离子型表面活性剂。经检测，茶皂素具有良好的乳化、分散、发泡、湿润等功能，并且具有消炎、镇痛，抗渗透等药理作用。本项目计划以梧州优势的茶产业为依托，采购茶枯，对其成分进行分析、鉴定其有效成分，将其加工成茶枯粉及用于大批量销售。',0),(52,9,43,NULL,364,'广西农民运动之王韦拔群数据库建设项目',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 12:36:25','1.倡革命精神，响时代号召。将革命精神弘扬于世，把有关拔群精神，拔群生活环境以及他的革命历程等等以电子版的方式收集形成一个专属数据库，采集相关资料可以通过当地人的口述来记录。广西省河池市东兰县不仅是国家级长寿之乡，少数民族聚居的地方而且也是红色基地。其中韦拔群烈士是典型代表人物，这次项目主要是通过互联网建立起有关韦拔群的数据库，方便将历史存档，在新时代的发展中以防历史信息丢失，让相关后代子女继续发扬光大。\n2.研究内容：收集研究拔群的具体内容，采集百姓对拔群的了解的语录，实地探寻拔群故居领略革命风采，将拔群精神与时代精神相结合，总结红色革命旅游的新意义，最后形成有特色的韦拔群数据库。\n3.研究目的：让更多人知道少数民族英雄韦拔群，将革命精神存留下去。',0),(53,4,33,NULL,462,'六堡茶茶叶渣制备纳晶纤维素及其表征',1,0,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 12:42:26','广西的六堡茶主产于梧州地区，六堡茶茶叶渣是六堡茶茶叶泡水饮用或提取后的一种残余物，六堡茶茶叶渣超声法制备纳晶纤维素是根据市场需求对六堡茶茶叶渣进行进一步加工再利用。本研究采用超声法，以六堡茶茶叶渣为原料制备纳晶纤维素，并将其作为纸张添加剂，可以提高纸张的物理性能，并且解决了六堡茶茶叶渣的资源浪费，回收利用、变废为宝。',1),(54,4,11,NULL,507,'低共熔溶剂分离六堡茶茶叶渣中木质素性能的研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 12:44:20','       由于本世纪化石资源的日益短缺及生活环境的日渐恶化，木质纤维素这一理想的可再生能源备受青睐。其中，木质素作为唯一一种可再生的含芳香结构的天然高分子资源，利用潜力非常大。若将木质素选择性优先分离，并加以利用，将使得生物质资源的附加值大大提高。但是由于其复杂的化学结构和较差的溶解性，一般方法效率较低。本项目以六堡茶茶叶渣为原料，利用低共熔溶剂预处理工艺，研究了木质素在不同低共熔溶剂中的溶解能力。从而得到一种分离六堡茶茶叶渣中木质素的新途径。',0),(55,4,33,NULL,462,'六堡茶茶叶渣制备纳晶纤维素及其表征',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 12:53:44','广西的六堡茶主产于梧州地区，六堡茶茶叶渣是六堡茶茶叶泡水饮用或提取后的一种残余物，六堡茶茶叶渣超声法制备纳晶纤维素是根据市场需求对六堡茶茶叶渣进行进一步加工再利用。本研究采用超声法，以六堡茶茶叶渣为原料制备纳晶纤维素，并将其作为纸张添加剂，可以提高纸张的物理性能，并且解决了六堡茶茶叶渣的资源浪费，回收利用、变废为宝。',0),(56,4,5,NULL,452,'茶枯粉的制备',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 12:53:50','茶皂素是从山茶科植物的种子中提取的一种糖式化合物，它属皂素类，是一种天然非离子型表面活性剂。经检测，茶皂素具有良好的乳化、分散、发泡、湿润等功能，并且具有消炎、镇痛，抗渗透等药理作用。本项目计划以梧州优势的茶产业为依托，采购茶枯，对其成分进行分析、鉴定其有效成分，将其加工成茶枯粉。',0),(57,4,11,NULL,461,'    六堡茶茶叶渣中木质素抗氧化性能的研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 13:38:08','     木质素是自然界中含量仅次于纤维素的一类可再生有机物，它来源广泛，化学结构复杂，具有一定的抗氧化性。木质素中的酚羟基是决定抗氧化能力最主要的官能团，其含量越高，抗氧化能力越强；甲氧基能促进抗氧化能力的提高，其含量越高，效果越明显。本项目采用DPPH法，研究降解后的六堡茶茶叶渣中木质素的官能团和抗氧化性能。为木质素可作为天然抗氧化剂提供理论支持，增加木质素综合利用的附加价值。',0),(58,4,33,NULL,448,'茶籽壳微纤化纤维素的制备',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 14:05:54','天然纤维素是地球上最丰富的生物质资源，是自然界中分布最广的生物高分子，它存在于各种各样的生物如植物、动物以及一些细菌等中。微纤化纤维素（MFC）是从天然纤维中提取出的一种纳米级的纤维素，它不仅具有具有纳米颗粒的特征，还具有一些独特的强度和光学性能，因而在复合材料，制药，化妆品，电池，造纸等领域具有广阔的应用前景。我们实验室前期已经成功地以海带纤维素为原料制备出了海带纳米纤维素，此外我们打算再从茶籽壳再制备出一种不同来源的MFC。',0),(59,1,49,NULL,350,'梧州八景海报设计',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 12:45:01','梧州八景指历史上梧州的鸳江春泛、云岭晴岚、龙洲砥峙等八处具有代表性的景观。宣传富于梧州地方特色的旅游景点对地方经济文化发展具有积极意义。\n本项目主要围绕梧州八个代表性景区，通过走访考察，实地摄影取材，采用多种形式手法，设计出系列体现梧州文化特色的宣传海报作品，提高梧州景区的知名度，宣传梧州当地特色文化。\n本项目将对大学生资源和社会资源进行合理有效的配置与整合，把专业知识运用到创新训练的实践中，提高大学生的综合能力，从而增强社会竞争力。\n',0),(60,1,49,NULL,350,'“梧州八景”海报设计 ',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 12:58:44','梧州八景指历史上梧州的鸳江春泛、云岭晴岚、龙洲砥峙等八处具有代表性的景观。宣传富于梧州地方特色的旅游景点对地方经济文化发展具有积极意义。\n本项目主要围绕梧州八个代表性景区，通过走访考察，实地摄影取材，采用多种形式手法，设计出系列体现梧州文化特色的宣传海报作品，提高梧州景区的知名度，宣传梧州当地特色文化。\n本项目将对大学生资源和社会资源进行合理有效的配置与整合，把专业知识运用到创新训练的实践中，提高大学生的综合能力，从而增强社会竞争力。 \n',0),(61,4,11,NULL,445,'  木薯渣纳晶纤维素功能化研究 ',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-27 15:19:31','以广西特产木薯渣制备的纳晶纤维素为原料，设计与构建以纳米微晶纤维素为载体的药物缓控释系统，在生物医药领域将具有良好的应用前景。但是一般的未经修饰的纳米微晶纤维素并不能直接应用，需要经过进一步的功能化改性，引入多种功能基团或偶联上一些具有特殊性能的分子，从而改善其理化性能，甚至赋予其多种新功能。',0),(62,4,33,NULL,540,'六堡茶糖果制作工艺研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-27 16:41:49','六堡茶是广西所特有的名茶，属后发酵茶类，性温，具有清热润肺、消暑祛湿,明目清心、帮助消化等保健作用。本项目选取六堡茶成品茶为原料，超声辅助法浸提茶叶得到茶汁，经过滤、浓缩、干燥和粉碎等工序而制成粉末状或颗粒状固体，添加糖浆、香料、或其他一些添加剂，制成既含有传统茶叶的营养成分和风味物质，且具有茶对人体的一切功效的糖果,以其清洁卫生、便于携带、口感丰富、老少适宜 等优点而受大众瞩目, 是一种很有前景的固体糖果。',0),(63,4,5,NULL,562,'不同寄主桑寄生红外光谱鉴别及主要成分的比较研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 03:04:19','桑寄生是我国传统常用中药材之一，具有祛风湿、补肝肾、强筋骨、祛风湿、安胎元等功效。在自然条件下桑寄生寄主植物具有复杂多样的生物学特征，不同寄主植物来源的桑寄生药材内在成分存在差异，从外观上无法区别。本研究利用红外光谱专属性强、灵敏度高、简便迅速等特点，探讨不同寄主来源桑寄生的红外光谱特性，并比较不同寄主来源桑寄生主要成分的差异，以期为桑寄生药材质量控制及开发利用提供参考依据。',0),(64,7,4,NULL,566,'智能婴幼儿床垫',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 03:15:56','智能婴幼儿床垫是一种可自动调控温度，检测湿度、心率、呼吸、姿态，并具有报警功能的智能床垫。\n本床垫可自动调节温度，使床垫始终保持适合婴幼儿睡眠的温度；可实时检测湿度，当湿度达到一定值时会自动除湿，防止因尿床、出汗等原因造成对婴幼儿睡眠不利影响；利用传动系统和音乐系统，对半夜婴幼儿醒来哭闹声进行处理，并自动安抚婴幼儿，改善和提高婴幼儿与父母的睡眠质量。\n本床垫还具有异常检测与报警系统。当检测到婴幼儿身体不适、睡觉姿势不利于成长、被子闷住婴幼儿或掉落等异常状况时，系统会向家长移动端发出警报，时刻确保婴幼儿睡眠环境安全，达到家长能从各方面了解婴幼儿健康状况，并在节省精力的情况下对婴幼儿实时监控的目的。',0),(65,7,52,NULL,567,'云印咖',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 03:43:33','本项目创建的“云印咖”新型校园打印店是一所位于学校内的，面向学生，资源节约的网络型打印店，服务范围包含了打印、扫描、CAD、刻盘、文具、广告、查询、咨询、共享等校园打印所需服务。其功能包括：一是协同小橙云印、达派云印等手机打印端，实现学生的自助打印，联合校园配送平台进行打印资料的配送，实现足不出户也可以获得资料。二是利用新型打印店创建学生论文论坛，解决校内普遍存在的学生毕业论文资料和文稿的难点问题；同时建立共享校园资料库，实现文档的有效收集和在学生之间的高效流通，将打印和学习相结合，以获得更多的打印资源和客户。三是在各个宿舍楼下建立小型打印设备，满足同学们个人的少量打印需求、以及急需打印。\n本项目具有高度共享特色，旨在建立创新型打印店，改变传统打印店的单一功能，更有效的为学生实际需求提供便利服务。\n',0),(66,4,11,NULL,475,'六堡茶茶籽壳纳晶纤维素的制备及表征',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-28 03:44:47','在国内，每年都有大量的茶籽壳丢弃，造成浪费，本研究首次以六堡茶茶籽壳为原料利用超声波法制备纳晶纤维素，从而变废为宝、不浪费资源、合理利用资源，并能减少其他棉、木材原料的消耗。六堡茶茶籽壳的纤维素含量高，对其进一步处理为纳晶纤维素，并对纳晶纤维素进行检测分析是本项目所研究的内容。本研究对六堡茶产业废弃物的利用提供了新思路，同时扩展了制备纳晶纤维原料的范围。',0),(67,4,11,NULL,475,'六堡茶茶籽壳纳晶纤维素的制备及表征',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-28 04:16:14','在国内，每年都有大量的茶籽壳丢弃，造成浪费，本研究首次以六堡茶茶籽壳为原料利用超声波法制备纳晶纤维素，从而变废为宝、不浪费资源、合理利用资源，并能减少其他棉、木材原料的消耗。六堡茶茶籽壳的纤维素含量高，对其进一步处理为纳晶纤维素，并对纳晶纤维素进行检测分析是本项目所研究的内容。本研究对六堡茶产业废弃物的利用提供了新思路，同时扩展了制备纳晶纤维原料的范围。',0),(68,8,60,NULL,144,'互联网平台下乡村学习资源包的开发与升级',3,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 05:02:13','“互联网+学习资源包”是充分利用信息化的精准服务和智能环境，以覆盖每个帮扶点或活动场所的网络现状为参考，一方面向受助儿童提供信息化教学实践活动，提供定期定量定质的教学资源，另一方面链接赞助平台，如社会爱心人士、企业，通过线上分享，即时反馈等方式，加强双向了解与认识，增强可信度与真实性，着眼于解决受助地区的师资条件、课程开设单一等问题，推动规范统一的教育云服务，保证学习资源的充分利用与升级改造。',0),(69,4,27,NULL,304,'楼梯升降机',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 05:33:25',' 主要为行动不便者提供上下楼梯服务，在楼梯上安装导轨，导轨上安装座椅，座椅上设有背靠，放脚板，扶手，背靠上设有安全带，通过传送带在导轨上面上下楼梯，楼梯上下设有按钮，用来呼叫升降机。座椅可折叠，减少占用楼梯空间，用起来方便。\n\n',0),(70,6,21,NULL,552,'交通执法预警平台',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 05:42:49','本项目结合梧州市公安局视频监控和道路交通监控系统数据，通过对道路交通视频、图像的特征信息分析，提取和分析小汽车、摩托车、助力车、电动车、三轮车、小型货车、大型货车的特征信息，达到道路交通执法部门开展的“交通违法”、“套牌车预警”、“助力车收缴”、“泥头车集中整治”等执法目的，通过对实时或非实时车辆特征的提取与分析，达到目标或嫌疑车辆的查找与分析，并通过执法设备的地理位置标注，利用百度地图等地图API接口实现在地图上目标或嫌疑车辆的轨迹标注和描述。对于“车辆套牌”、“集中整治”通过实时分析和提取车辆特征，对满足特征的车辆实时推送到执法警务端，执法人员可根据警务端推送信息实时控制嫌疑车辆，达到快速、准确的执法目的。',0),(71,4,27,NULL,574,'半自动瓜皮压制机   ',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 06:12:04','本项目是创新训练项目，灵山瓜皮在当地是家户喻晓的特色美食，但在全国的其他地方却并没有普及开来，目前当地人们制作黄瓜皮依然用传统的手工来制作，在国内外没有瓜皮制作的机器。成本低康、工艺简单的瓜皮制作机在国内还是具有发展潜力的。本项目主要包括清洗传送装置、打孔装置、加热装置、滚压装置等设计和制作，其核心装置为打孔装置，使传统工艺与先进生产技术相结合，既保存黄瓜鲜脆的口感，又严格监控了产品的安全卫生。',0),(72,4,27,NULL,576,'自动翻书机',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 06:28:28','   本项目主要帮助想阅读纸质书籍，双手却不便的人，通过踩踏按钮控制机器翻页完成阅读。目前国外已有自动翻书机，售价高达数万元，国内没有国产的自动翻书机在售。所以，价格较低、工作可靠、操作方便的自动翻书机是具有发展潜力的。本项目主要包括起页机构 、翻页机构 、压书装置 和角度、高度调节机构等组成，通过搓纸轮在书页下边角的旋转，模拟人手搓页的原理，将书页分离抬起，后由压页杆下压，搓纸轮再度反向旋转，实现自动翻书。',0),(73,4,27,NULL,306,'自动洗澡机研发与实现',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 06:31:27','智慧城市、智慧社会是目前社会发展的主旋律，而针对人口老龄化的健康养老问题，也已经成为当前我国必须面对和解决的社会问题。我国农村有许多的空巢老人，城市里的年轻人白天出去上班，留下老人独自在家，而因为身体不便，对于独居老人而言洗澡是个麻烦事，而且容易滑倒摔伤，对此，我想研发一款自动洗澡机，以洗衣机滚筒旋转为原理，利用水的旋转流动性与身体磨擦达到清洗效果，加入控制水流速度、水温、脚底按摩和自动喷沐浴液等功能，实现自动洗澡、按摩一体化机器。\n窗体底端',0),(74,4,27,NULL,546,'家庭用园林护理机器人',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 06:41:13','家庭用园林护理机器人有三个功能：一是按布置路线，行驶到有花草、盆栽存在的区域，机械手先检测完土壤的湿度是否适合植物的生长，再通过机械手升起通过雾化处理，将植物从上至下打湿，最后在底部浇水至合适湿度，动作完成后继续行驶至下一个目标植物。二是护理机器人检测植物周围是否存在草，然后采用机械手除去。三是还有定期自动杀虫功能。',0),(75,4,27,NULL,577,'冲床自动上下料机器人',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 06:56:18','冲床自动上下料机器人是一套全新机电结合的思路，它主要有立柱、ARM控制系统、触摸屏人机界面、各种传感器、前后2节机械臂，各自可以在XY平面上绕转动轴自由转动,各自有角度传感器定位每一个手臂的转动角度、用于向值班工人语音播报一些重要信息，例如原料单板有缺陷、安全保护。这项目的实施，将会更加实用与安全，便于生产与推广。现在重点是对智能控制系统的研发，使得这套应用能够实时更新升级，以满足更高的市场需求。 ',0),(76,8,48,NULL,498,'大学生专业课学习的德育认知调查--以梧州学院为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 08:27:31','大学生是祖国的未来，大学生的德育工作始终是高校人才培养的核心任务之一。党和国家非常关心大学生的成长成才，习近平总书记有关课程思政的思想为大学德育工作指明了方向。课题主要采取问卷调查法，对大学生在专业课程方面的德育认知问题进行实证调研，发掘大学生群体对专业课程的德育认知度。课题的开展具有三个方面的意义：一是为高校德育工作提供第一手的学生思想动态资料；二是从大学生的角度观察专业课程的思政价值及其育人体现，提供教学过程反馈的真实数据；三是为高校进一步提升和改进大学生思想政治教育提出合理化的建议。',0),(77,2,48,NULL,359,'留学生来华适应性的调查研究--以梧州学院为例',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 09:01:58','近年来，梧州以其独特的文化历史与地理位置的优势吸引着来自世界各地的外国留学生，随着中国与东盟、中亚、欧盟等国家教育交流的进一步开展，来梧州学院留学生人数正处于不断增长的趋势，成为沟通中国与外国合作共进的重要桥梁。然而，由于留学生来梧之后必然会经历从一种熟悉的环境到另一种陌生的社会环境中生活和适应的过程，宗教信仰、风俗习惯、文化价值观等各方面的差异会让他们在这个过程中面临着不同程度的困难和问题。因此本文以梧州学院留学生为对象进行调查研究，从生活适应、语言适应、心理适应、文化适应这四个方面探讨他们在梧州学习生活中存在的问题和影响因素，希望可以进一步了解留学生文化适应的现状和特点，也希望对跨文化适应研究有所补充和帮助。',0),(78,6,2,NULL,221,'基于对抗神经网络GAN的培训机构测评平台',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 09:13:16','在大数据时代背景下，职业发展与就业教育存在许多问题，这些问题主要表现在就业需求呈现多样化，个性化发展趋势和就业指导受到新时代网络平台的挑战等，我们的产品以培训机构为背景，利用GAN对抗神经网络算法的特性，通过不断的迭代优化来训练判别模型，直到最终收敛在各式各样，鱼龙混杂的培训市场中，并根据获取样本的差异来评测培训机构，并设计开发一套优质的IT培训机构评测系统。\n我们这款产品的优势是在于面向全国各个地区城市的培训机构和大多数就业需求人员，该产品覆盖范围广，例如教育，IT，体育，传媒等多个领域，我们通过相关数据分析，可以准确，有效地筛选具有特色的培训机构，为不同就业需求人员提供服务。我们不仅与各培训机构进行合作，极大地减少培训机构与不同就业需求人员的不必要开支费用，同时在未来我们利用微信平台可以将数据分析的结果与政府相关机构进行共享，以此来扩大该平台的适用范围。\n',0),(79,4,27,NULL,586,'基于珀尔贴效应的六堡茶发酵温度测控装置研制_',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 09:24:45','本项目通过矩阵排列的光纤传感器采集渥堆发酵中的多处温度，经过低噪声放大及滤波后，将温度信息转换后数字信号，传送到STM32单片机，单片机根据温度数据及分布，通过D/A转换后控制半导体冷却或加热，从而使各处的发酵温度均精确的稳定在设定的温度。',0),(80,7,31,NULL,591,'远程控制智能CW系统',2,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-28 10:37:50','远程控制智能CW系统（即智能窗帘窗户系统 C：Curtain， W：Window）是基于STC89C52单片机开发设计的。该系统设计是基于现代化生活的高质量需求而开发设计，使家用窗帘窗户实现自动化智能化。该系统通过光电传感器、湿度传感器，对室外光强度、空气湿度进行实时检测，并且把检测结果转换成电信号传给主控CPU进行计算处理，最后通过驱动窗户或窗帘电机硬件装式来进行打开或关闭，而且本系统还可以远程强制关闭或打窗户或窗帘。同时本系统还附带安装人体红外探测器，对在窗户边逗留的幼儿或动物及时发出警报提醒，多方面提升家居环境，安全和适宜度。',0),(81,4,24,NULL,355,'智能无人果栈',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 11:05:29','本项目名为“智能无人果栈”，就是以自助的方式进行水果销售，无售卖人员，只有智能设备售卖。店内配备半自动打包机、智能付款机等设备，用于顾客自行选购、打包和支付。智能无人果栈不仅销售各类新鲜水果，还销售与水果相关的副产品，如果汁、果酱，水果干等产品。另外顾客可网上定购水果，同时结合现有的配送服务进行销售，使顾客体验更加良好、购物更加方便，创立出”智能无人”的销售模式。',0),(82,6,32,NULL,347,'智能导盲杖',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 11:20:46','本款导盲杖是基于Arduino开发板的开发，分智能检测和GPS定位两个独立模块。智能检测模块主要由超声波测距模块、光电测距模块、水位检测模块和遥感模块组成，智能检测模块操作对象为盲人群体，当导盲杖检测到四周有障碍物时发出警报提示使用者注意避让；GPS定位模块可对使用者位置实时定位。模块采用TCP/IP协议与OneNET平台连接，通过AT指令利用GPRS网络将定位数据传送到OneNET平台并以地图形式将位置展现。家人可在OneNET平台地图看到使用者位置和行走轨迹。',0),(83,4,33,NULL,496,'横经席醇提活性成分工艺的研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 11:28:46','我国绿色药物资源丰富，许多中药都被重点研究，但是我国关于横经席的研究还有所欠缺。在以前使用横经席这个药物时都是直接利用草本，这样的使用方法会很大程度降低横经席的利用率。本项目以横经席为研究对象，醇提活性物质。我们利用现代色谱分离技术等对横经席进行分离纯化研究其活性成分，得出药用价值并且对比其疗效并分析其利用价值。能够将横经席的药用价值充分利用并且研究其活性能够填补国家该方面的研究空白。',0),(84,4,11,NULL,445,'木薯渣纳晶纤维素功能化研究 ',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 12:25:05','以广西特产木薯渣制备的纳晶纤维素为原料，设计与构建以纳米微晶纤维素为载体的药物缓控释系统，在生物医药领域将具有良好的应用前景。但是一般的未经修饰的纳米微晶纤维素并不能直接应用，需要经过进一步的功能化改性，引入多种功能基团或偶联上一些具有特殊性能的分子，从而改善其理化性能，甚至赋予其多种新功能。',0),(85,4,33,NULL,593,'横经席水溶性活性成分提取工艺的研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 12:27:34','随着人们对中草药需求的增加,以及中药资源经过不断的开采及自然环境的不断恶化,许多重要中草药数量急剧减少，开发新药材的脚步刻不容缓。因此，本项目以横经席为原料药，采用溶液提取法对其活性成分进行提取。通过不同的工艺条件、中药提取工艺学和天然药物化学等知识，研究预处理、提取溶剂、提取时间、提取温度、料液比和提取次数对横经席水溶性活性成分提取率的影响，以此来确定活性成分提取的最佳工艺条件。横经席作为一种鲜为人知却又具有丰富的药用价值的药材，我们理应扩宽其使用途径，让更多人了解到这个价值高的药材。这不仅可以缓解我国现有的中草药资源紧张的情况，同时也是对中草药的可持续发展',0),(86,4,21,NULL,592,'基于机器视觉的砂糖橘外观品质无损分级检测',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 12:32:16','砂糖橘作为我国的“甜蜜产业”，产量大，种植面广，农户大批量种植收入高。传统水果分级采用人工或纯机械式分选，前者效率低，后者损果率大，机器视觉技术在水果分级中应用的研究，对于降低分级水果过程中的损果率大有裨益，作为一种无损分级，机器视觉在分级分拣中研究意义深厚。\n本项目旨在研究砂糖橘的无损分级技术，制作一个附加机构加在砂糖橘打蜡机上，用于降低传统分级技术带来的损果率，根据机器视觉技术对砂糖橘的果围果径进行检测，此设计可以做到不接触果品直接得出果围果径反馈到PC机界面，进而信息传到下一步分拣的工序，达到无损分级检测的目的。',0),(87,4,33,NULL,604,'阿司匹林双层栓剂的制备和质量考察',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 12:40:00','阿司匹林是一种历史悠久，应用最早，最广和最普通解热镇痛药抗风湿药，目前阿司匹林剂型众多，如阿司匹林片，阿司匹林肠溶片，阿司匹林栓剂，阿司匹林胶囊剂等剂型。阿司匹林具有对肝脏有首过效应，对胃有刺激作用，而传统的阿司匹林栓剂所释放的药物经过向上扩散经门肝系统吸收会造成肝损伤。双层栓剂可以控制药物的释放速度，且能避免部分药物的肝脏首过作用。',0),(88,4,33,NULL,603,'高效液相电喷雾法分析三七中三七皂苷的含量',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 12:42:58','三七主要产地为云南文山，皂苷是三七的主要生理活性，主要药理作用是扩张血管、降低心肌耗氧量。目前以三七或者三七皂苷为主要成分的中成药有很多，如三七通舒胶囊、复方丹参滴丸、复方血栓通胶囊、血塞通软胶囊等几十种，这些产品临床治疗领域较为集中的分布在心血管病、骨骼肌肉用药、妇科用药三个领域。所以对三七皂苷含量的研究对三七的开发利用有重要意义。利用高效液相电喷雾法分析三七皂苷的含量并测定三七皂苷的泡沫指数和溶血指数作为质量指标，将对本次三七皂苷的含量分析更有意义。',0),(89,3,60,NULL,531,'丝桐古琴艺术中心',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 13:04:00','习近平多次强调中华传统文化的历史影响和重要意义，赋予其新的时代内涵。在传统文化复兴的大背景下，近十年来产生了“古琴热”现象。许多人开始兴办琴馆和古琴培训班、层出不穷的古琴雅集活动、古琴考级等等，反映出人们正通过一系列措施来传承和发展传统文化。丝桐古琴文化创业训练项目成立于2019年3月，集结了二十多位来自不同专业的古琴爱好者，秉承传承弘扬古琴文化的宗旨,致力于开授古琴公益课、建立古琴兴趣培训班、古琴及相关用品的实体和网上销售，主要面向广西省桂林、南宁、梧州市等地的在校学生、传统文化爱好者、退休老人等。',0),(90,4,24,NULL,606,'幼儿的DIY教育',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 13:40:31','目前，幼儿园的手工教育活动是幼儿美术教育活动中所不可缺少的内容，现阶段，幼儿园的手工教育内容较单一，如折纸和绘画，手工泥人，造成此现象是多样性的手工课程会引起大量的经费投入，所以普遍的幼儿教育机构的手工课程投入经费低，而手工课必然单一化。本项目除了在实体店营业外并致力于与幼儿园机构联合，为幼儿提供DIY甜品教育，在DIY甜品教育中加入中国传统文化元素，例如，甜品窗花的制作、DIY五色糯米饭，DIY甜品大熊猫等，从而提高幼儿美术教育的教育质量和丰富手工教学的多样性，更能提高幼儿的创新能力和动手能力，以及更好地了解中国的传统文化，还有让亲子关系更亲密。',0),(91,7,31,NULL,560,'基于STM32的多功能爱心水杯',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 13:55:44','日常生活中常用的保温杯确实有保温功能，但是却缺少了人性化。本次项目主要进行基于STM32的多功能爱心水杯的设计，该多功能爱心水杯由传感模块、STM32芯片控制模块、显示模块、接触感应模块、电源供给模块组成。可实现精准温度显示、爱心LED提示、人体信息监测提醒等功能。主要创新点体现在智能提醒，触摸水杯会有爱心LED提示水的温度范围，人体信息监测提醒主要通过传感器来感知人的活动信息，例如是否长期久坐，然后通过LED显屏提醒人适当地运动和喝水等。该项目后期将进行基于互联网+和传统市场的调查和分析，尝试商业推广。',0),(92,9,43,NULL,479,'基于“乡村振兴战略”的广西都梅村特色小镇建设研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 14:10:24','本项目基于国家大力推进“乡村振兴战略”为背景，以乡村发展特色小镇推动乡村走向致富道路为研究目标。通过建设乡村特色小镇，开发特色休闲农业，推动乡村走向致富之路。课题以广西梧州市龙圩区新地镇都梅村为研究对象，该村主要依托当地的特色农业，凭借优越的地理位置，通过流转将闲置土地调整为村集体土地，通过引进外资企业，借助其先进的技术和管理经验来促进乡村特色小镇的发展，建立和完善了相关制度，最终达到乡村振兴的目的。',0),(93,4,33,NULL,334,'街旅DIY自拍写真馆',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 14:13:25','自拍写真馆,又名自助摄影馆,是中国摄影行业的一个全新细分市场，个性随意的风格、无限的创业及低廉的价格，是它的核心竞争力。我们拥有更专业的摄影师，有更自由的摄影空间，有更多角度的艺术体验。它颠覆传统的拍摄模式,我们人人都可以当专业的摄影师。馆内提供专业的摄影设备,各式不同的服装,道具,场景。客人可根据自己的喜好选择不同的造型,在不同的场景内完成自拍 所有拍摄过程通过拍摄系统显示在大屏幕上,可以看着自己的效果拍摄。最后客人选择喜欢的照片进行精修,然后打印出照片。收费方式根据自拍时间、人数和照片打印张数多少收费。',0),(94,1,34,NULL,517,'非遗手工锤揲工艺在现代茶器设计中的应用 ',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 14:16:03','新潮时代的到来，意味着市场的热潮，产品更迭迅速，在面对消费选择时，往往会根据产品品质及适用度进行对比来选择，有特色的产品会从中脱颖而出，而消费者潜意识中对特色的产品存有理智性的分析，从而选择适合自己且价格合理的商品。所以产品必须以更具艺术感的设计，更好的品质胜出。\n本项目创新之处在于把非物质文化遗产——锤揲工艺技术引进高校，通过与学校多专业教学资源相结合，更好的让学生发挥对工艺的传承和对产品造型的创新设计，以及产品在茶文化领域的市场开拓。项目组成员已在传统手工艺制作，有一定经验基础独立完成手工茶具制作，努力实现传承发扬创新。',0),(95,4,11,NULL,475,'六堡茶茶籽壳纳晶纤维素的制备及表征',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-28 14:30:28','在国内，每年都有大量的茶籽壳丢弃，造成浪费，本研究首次以六堡茶茶籽壳为原料利用超声波法制备纳晶纤维素，从而变废为宝、不浪费资源、合理利用资源，并能减少其他棉、木材原料的消耗。六堡茶茶籽壳的纤维素含量高，对其进一步处理为纳晶纤维素，并对纳晶纤维素进行检测分析是本项目所研究的内容。本研究对六堡茶产业废弃物的利用提供了新思路，同时扩展了制备纳晶纤维原料的范围。',0),(96,4,33,NULL,370,'果真好',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 14:33:33','我们的项目是建立一个平台小程序，果农在平台上售卖水果及水果副产品。果农大部分都是中年人，一般都是选择直接向水果批发商低价卖出，这样他们得到的利润较低，果农们由于存在信息闭塞，不能及时准确获得市场的水果资讯，不是依靠市场导向来进行生产，导致他们丰收不增收，但我们的平台可以有效的帮助他们解决这个问题。\n项目首先要经营一个营销公众号，获得大流量大关注后，再搭建一个销售平台APP，让果农和水果加工品合作商可以在平台上销售水果和水果副产品，并建立一个水果资料数据收集库，利用互联网智能分析辅助果农在平台上销售，这样能然让果农收到水果实时的消息，也能更大限度的发挥水果的价值。最后我们在帮助果农的同时，也可以获得一定的收益，共同合作，以达双赢。',0),(97,4,11,NULL,475,'六堡茶茶籽壳纳晶纤维素的制备及表征',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-28 14:43:23','在国内，每年都有大量的茶籽壳丢弃，造成浪费，本研究首次以六堡茶茶籽壳为原料利用超声波法制备纳晶纤维素，从而变废为宝、不浪费资源、合理利用资源，并能减少其他棉、木材原料的消耗。六堡茶茶籽壳的纤维素含量高，对其进一步处理为纳晶纤维素，并对纳晶纤维素进行检测分析是本项目所研究的内容。本研究对六堡茶产业废弃物的利用提供了新思路，同时扩展了制备纳晶纤维原料的范围。',0),(98,6,32,NULL,615,'基于物联网的果园智能管理系统设计与实现',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 01:37:44','本智能果园管理系统以stm32单片机开发、pc机作为上位机,利用WiFi技术实现设备间的无线通信。通过温湿度传感器、光照传感器、土壤湿度传感器以及摄像头模块对果园环境进行实时监测并将所获取的数据上传，方便技术人员对果树的生长情况进行判断合理地对果园进行管理。通过远程控制并与摄像头相结合操作可移动喷洒机器在铁轨上运行进行施肥、施药处理，无需人员费时费力进行操作从而减少人工费的开支以降低成本。将供水设备连接到每棵果树上通过土壤湿度传感器进而控制电磁水阀的开关进行自动灌溉。本智能果园管理系统主要节省了人力，往往一个果园只需要一个人员进行管理或一个人员管理多个果园大大降低了管理成本。',0),(99,4,18,NULL,617,'喀斯特特有药用植物地枫皮对极端干旱的生理生态适应机制研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 01:48:31','喀斯特石山山顶适生植物经过长期的自然选择和生存竞争，形成了一套对周围极端环境的适应机制。因此开展喀斯特石山山顶典型适生植物的生理生态适应机制研究，即可从微观了解喀斯特植被恢复演替机制，也可为宏观植被演替现象提供实验依据和理论依据。本项目以广西喀斯特石山山顶的典型适生植物，广西喀斯特特有药用植物地枫皮为材料，人工模拟自然持续土壤干旱，研究地枫皮生理生态特性在持续干旱不同阶段、极端干旱以及旱后复水时的变化。揭示地枫皮应对极端干旱环境的生存和适应性策略。',0),(100,4,10,NULL,610,'氮素营养和采叶强度互作对采叶后甜茶补偿性生长的影响',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 01:52:39','甜茶为广西特有的茶、糖、药多用资源植物，主要有效成分为叶片提取的甜茶苷，近年来，我区已将甜茶作为产业扶贫的重点资源植物在桂北及桂东贫困山区进行了大面积的人工种植。在众多的环境因素中，与生产最密切又易人为调控的是矿质营养，其中氮是最重要的基础营养元素。本项目以甜茶为材料，研究氮素营养和采叶强度互作对采叶后甜茶补偿性生长的影响，为甜茶栽培管理提供理论依据和实践指导。',0),(101,4,8,NULL,619,'生物调节剂对两面针的矮化效果及生理特性变化研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 01:58:33','两面针为芸香科花椒属植物，是广西道地中药材，瑶药中五虎之首。具有镇痛、抗炎、抗菌、抗癌等作用，是医药、日用品、化妆品的原料药，随着生产规模的扩大，两面针的年需求量也逐年增加。但市场需求与两面针野生资源间的不平衡，让人工种植面积日益扩大。\n在栽培过程中，鉴于两面针茎枝叶有锐刺、分枝多，以根入药而使茎枝叶无法利用，以及生长势快的特点，使得管理困难、影响效益。而矮化可有效解决该问题，因此本项目开展的生长调节剂对两面针的矮化效果及生理特性变化研究不仅意义重大，还可为两面针的种植提供新的模式，进而提高产值，加快两面针产业化的发展。',0),(102,9,44,NULL,473,'大学生党员党性现状调查—以梧州学院为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 02:32:07','大学生党员具备较高的党性修养是实现伟大复兴中国梦和加强党的建设的现实要求。本项目通过对梧州学院的大学生党员党性现状的调查，把握大学生党员的群体特点。有针对性的对学校相关老师、学生党员、群众进行访问调研，通过将大学生党员与在职党员、群众进行比较，了解在新时代大学生党员在党性培养与增强过程中存在的问题和不足，并形成调研报告提供给学校乃至广西其他高校借鉴。',0),(103,4,36,NULL,622,'六堡茶风味雪花酥的研制与工艺优化',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-29 02:17:58','雪花酥做法：先将黄油融化，倒入棉花糖，搅拌融化，倒入奶粉，倒入坚果和果干，快速混匀；倒入烤盘，加入饼干，整形，撒上奶粉，放凉后用刀切块。本项目利用超微技术，将六堡茶打成超微粉末，取代平常做法中加入的奶粉进行雪花酥的制作。六堡茶本就具有一定的消暑除湿，降压除腻，促消化，美容等保健功效，与甜品结合起来刚好可以降解部分因食用过多雪花酥而造成上火增脂现象。增加六堡茶副产品，改善六堡茶单一消费途径。',0),(104,7,21,NULL,534,'Doultrack轨迹球键盘设计',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 02:26:30','目前，中国的键盘、鼠标等有关优化电脑体验方面的相关产品还仅仅是基于游戏层次，各种用于游戏的设备令人眼花缭乱，但是对于经常使用键盘的人来说，操作和使用都过于繁琐，因此本设计针对人体手部的舒适进行了相应的研究，采用分体式的设计方案。这种设计不仅有效解决了长时间使用电脑的人群在运用键盘、鼠标时来自肩部带来的压力的缓解问题，同时合理的按键布局可以减小使用者手指的移动幅度以便于减轻手指的负担。此外，本设计还在键盘的右半部分设计了一个轨迹球来代替鼠标的使用。键盘加入了蓝牙模块实现无线连接，续航时间变长以及无线连接给使用者带来舒适的体验。此外，本设计还为键盘底部增加了额外的手部托板，以提高使用者手腕的舒适度。',0),(105,5,52,NULL,609,'Nice旅行社',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 02:28:27','Nice旅行社是以“青春飞扬、以人为本、旅客满意、永续经营、万源诚为本”的经营理念。旨在满足广大消费群体的需求，秉承一贯的“诚信、用心、安全、负责”的初衷，并且在提供轻松、欢快、安乐、周到服务的同时，倡导时尚旅游新概念，推出个性化产品，追求更高品质的服务为广大青年学生打造舒适、理想的旅程。我们团队现已与南宁中旅达成合作意向，提供更全面的技术支持，更专业的业务培训，更有力度的宣传推广和丰富的经验。以“低价位高服务，重安全得尊重”为宗旨，年轻，精干，诚实团结的业务队伍；踏实，谦虚，勤奋，负责的敬业精神是我们发展壮大的基础条件和资本。创业初期主要顾客群体以在校大学生为主，中后期可兼顾社会旅游群体。旅游地点不限，国内与境外游，尽团队最大的能力满足大学生的需求。也正因为这个团队是由大学生组建成的团队才能更明白大学生的消费心理，也才能想出一些可行的点子来契合消费群体的需求。旅游是当之无愧的“美好生活”',0),(106,6,32,NULL,440,'基于NB-IOT的空气质量监控和污染源定位系统  ',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 02:29:16','习近平总书记在党的十九大报告中指出，“必须树立和践行绿水青山就是金山银山的理念”，并明确要求“加大生态系统保护力度”。至此，为了响应习近平总书记对环境保护和治理的号召，我们拟研发了基于NB-IOT的空气质量监控和污染源定位系统，该系统由下位机、Web端、设备监控端、移动客户端和数据服务器构成。在工厂和城市地区附近安装多个传感器，采集的环境参数有风速、风向、PM2.5、PM10、温度、湿度、光照强度、GPS信息。下位机采集数据发送到电信物联网开发者平台， Web端实现了数据的显示、设备监控和污染源定位，帮助环保管理人员寻找到排放污染物超标或者偷排的工厂。移动客户端对未来的环境指数进行预测和显示，如有异常将以短信方式提醒。',0),(107,4,8,NULL,614,'玉叶金花苷酸甲脂的质量检测及提取工艺研究',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-29 02:57:48','玉叶金花具有凉血解毒、清热解暑等功效，临床上可以用于普通感冒、发热、咳嗽、中暑、跌打、咽喉肿痛等症状，在广西人们时常采摘玉叶金花熬制防暑、解毒凉茶的习惯。根据现代药理研究报道，并经试验证实其具有明显的抗炎、镇痛、抑菌活性，为该药材重要药效物质基础，故本文选择玉叶金花苷酸甲酯作为玉叶金花药材含量测定的指标，采用柱色谱分离，并通过理化性质、波谱分析鉴定结构，并且包含其采用HLPC法提取工艺的研究。',0),(108,1,52,NULL,504,'梧州学院“零点校园”',3,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 03:07:28','“零点校园”是为广大高校师生提供信息发布、在线支付和购物等服务的一个校园生活服务综合平台。由本校学生团队管理和运营，将广大师生需求和校园圈内及本地商户进行高效整合，是对O2O商业模式的全新诠释。目前创业的主要系统模块有校园外卖、校园商城、校园任务跑腿、校园信息发布、校园云打印、校园分时租赁等应用平台。为大学校园生活增添了更多的便利服务。',0),(109,6,32,NULL,618,'用电检测系统的设计与实现',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 03:11:29','本团队的设计是在用电器与供电线路之间搭建一个监测系统，给系统部署一个用电标准值，实时的进行用电参数监测，系统检测到用电线路过载，线路温度过高或者电压不足时会发出报警信息提醒用户，并将数据信息上传后台方便管理员和用户查询，超出标准值值系统将自动断开电源，避免意外发生。电检测系统可用于大型公司、大型用电集团、小区使用，方便有关部门的统一管理和用电居民的节约、安全用电，避免危险用电，防患于未然。',0),(110,4,33,NULL,463,'茶果壳热水提取物的抗氧化性研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 03:28:57','本研究拟以梧州本地六堡茶茶果果壳为原料对其热水浸出物进行分析鉴定，并对其抗氧化能力进行检测。以其为茶籽壳的保健饮用提供理论依据，为六堡茶的多样化产品开发提供数据参考。',0),(111,4,5,NULL,626,'罗汉果抗根结线虫种质初步筛选',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 03:37:22','罗汉属葫芦科多年生藤本植物，为广西道地药材和著名特产。它是一种高度易感线虫的植物，现已危害到了罗汉果果实的品质和产量，并影响了罗汉果产业的可持续发展。为有效解决或缓解罗汉果根结线虫病害问题，本项目通过罗汉果抗根结线虫种质初步筛选、外源水杨酸、茉莉酸诱导罗汉果抗根结线虫性以及抗虫性生理指标分析，可初步筛选出罗汉果抗根结线虫的优良种质和砧木，了解罗汉果和葫芦科的抗虫性生理，为今后罗汉果抗根结线虫优良种质应用提供材料和理论基础。',0),(112,6,32,NULL,250,'基于spark+hive+hbase的租房市场的数据分析平台',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 03:38:53','基于spark+hive+hbase的租房市场的数据分析平台是采用大数据技术spark+hive+hbase为租房市场的数据分析处理提供了有力的技术支撑。以Linux 集群硬件为基础，通过对互联网租房市场信息的采集、预处理、分析来形成高可靠的统计性数据分析报表，并采用 HDFS 实现特有的高响应、高容错、高并发支持以及集群内数据均衡来架构租房市场数据。最终为找房用户提供可靠且价格合适的房源信息，让租房市场跟上信息化时代的发展。',0),(113,4,33,NULL,581,'茶果壳中多糖提取及含量测定',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 03:44:06','开展此次研究，希望通过实验探索出更加快速并且有效的提取多糖工艺及影响含量的因素。为梧州六堡茶乃至全国茶果壳的利用价值提供有效证据，甚至开拓其他利用领域；实现六堡茶价值最大化利用与宣传，早日走上世界舞台。',0),(114,4,8,NULL,630,'茶果壳中茶多酚提取工艺的优化研究 ',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 04:31:17','茶果壳中含有大量的天然活性物质，包括茶多酚、茶多糖等多种成分。多酚类及其氧化产物是一类含有多个酚羟基的化合物，具有清除自由基达到抗氧化的作用。对人体具有体调理肠胃作用，还具有调节血脂代谢、预防心脑血管等疾病，以及防癌抗癌的作用。水提取法是提取茶多酚类化合物的常用方法。且茶多酚类的组分复杂，我们可以利用分离原则按分子大小、极性大小、酸碱强弱或与不同的金属盐络合的不同特点进行分离。通过实验确定一个提取茶果壳中茶多酚的优化工艺。通过实验为茶果壳的开发利用提供数据，同时也可以减少茶果壳的浪费。此外，希望通过此研究引起人们对六堡茶果壳的价值重视，不仅可以变废为宝，还能让农民增加收益。',0),(115,4,27,NULL,557,'菠萝全自动削皮机',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 04:37:05','夏季，是菠萝的成熟期。菠萝中含有大量的果糖，维生素等，且具有解暑止渴的功能。根据研究调查，全国菠萝的种植面积达到了105多万亩，产量高达160万吨。但是，菠萝虽然好吃，担它的果皮和果眼非常难削如果手工去皮，不仅费时费力，还不安全、不卫生，且对本身果肉的浪费也比较大。而随着人们生活水平的不断提高，使得菠萝的需求量也越来越大，传统的手工去皮已经不能满足，因此，本项目希望能设计一种安全、快速、便捷、卫生的菠萝去皮机，代替传统的手工削皮。',0),(116,6,32,NULL,447,'小熊速修',3,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-29 05:03:46','小熊速修，让您的维修更轻松！',0),(117,3,52,NULL,635,'营改增政策改革对广西企业发展的成果研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 06:42:29','营改增是营业税改增值税的简称，其最大的特点就是减少重复征税。营改增是党中央、国务院，根据经济社会发展新形势，从深化改革的总体部署出发做出的重要决策。目的是为了促进服务业和高端服务业的发展、促进产业和消费升级以及深化供给侧结构性改革等多方面的发展。自广西“营改增”试点启动后，使得现代服务业、房地产业、金融业等企业都受益匪浅。而本项目重点研究自2016年广西与全国同步启动全面推广营改增之后，广西经济发展的成果、以及分析和总结在营改增政策的经济大背景下广西企业发展的有利条件。深入了解“营改增”政策对于广西经济发展的有效作用，提高广西人民“大众创业，万众创新”的创业热情，从而刺激广西实体经济的发展。',0),(118,4,10,NULL,612,'不同年份六堡茶的茶褐素抗氧化能力比较研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 07:29:56','六堡茶中茶褐素( TB) 含量高于其他茶类，而茶褐素具有强的抗氧化活性，故对六堡茶茶褐素的提取和抗氧化性能进行初步理化性质分析研究，为茶叶的陈化提供理论支持。本文对五种年份不同的六堡茶中的茶褐素进行提取，溶剂浸提法进行实验，对比其茶褐素含量后发现年份越大的六堡茶中茶褐素含量越高，并通过羟基自由基、亚硝基和超氧自由基与Vc之间的清除率对比，对其抗氧化活性进行检测研究，以便于为六堡茶茶褐素的提取及生物活性的测定与开发利用提供理论参考。',0),(119,4,8,NULL,614,'玉叶金花提取物有效成分检测及提取工艺研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 07:59:08','玉叶金花是广西特色药材，其开发利用备受关注，至今未见相关的工艺设计理论研究。本研究首次以玉叶金花的有效成分玉叶金花苷酸甲酯的检测分析，对来玉叶金花的提取工艺进行优化，为玉叶金花产品开发和设计提供理论依据。\n',0),(120,6,32,NULL,46,'项目建设过程监管云服务平台',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 08:00:50','我国基础设施建设蓬勃发展，各区县市基础设施建设项目种类繁多，资金投入巨大，项目建设过程中如何实现对这些项目的实时监管成为各级政府部门一大难题，本项目是一款基于移动云平台的项目建设管理软件，利用移动互联技术改变以往通过现场视察、逐级汇报或会议协调等项目监管方式，利用移动互联技术最大程度地解决项目建设过程监管、沟通和协调等问题。本项目适用各级政府部门对所建设项目进行有效监管，已在多个县市区应用，通过与中国移动充分合作，利用中国移动云平台，极大减少用户单位信息化建设费用。未来，通过扩展用户单位类型和用户单位数量，在充分调研的基础上，完善和丰富产品功能，以扩大该产品的适用范围，使得用户能自主选择软件功能。',0),(121,4,8,NULL,626,'罗汉果抗根结线虫种质初步筛选及抗虫生理指标分析',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 08:24:11','罗汉属葫芦科多年生藤本植物，为广西道地药材和著名特产。它是一种高度易感线虫的植物，现已危害到了罗汉果果实的品质和产量，并影响了罗汉果产业的可持续发展。为有效解决或缓解罗汉果根结线虫病害问题，本项目通过罗汉果抗根结线虫种质初步筛选、外源水杨酸、茉莉酸诱导罗汉果抗根结线虫性以及抗虫性生理指标分析，可初步筛选出罗汉果抗根结线虫的优良种质和砧木，了解罗汉果和葫芦科的抗虫性生理，为今后罗汉果抗根结线虫优良种质应用提供材料和理论基础。\n',0),(122,4,10,NULL,630,'茶果壳中茶多酚提取工艺的优化研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 08:51:49','茶果壳中含有大量的天然活性物质，包括茶多酚、茶多糖等多种成分。多酚类及其氧化产物是一类含有多个酚羟基的化合物，具有清除自由基达到抗氧化的作用。对人体具有体调理肠胃作用，还具有调节血脂代谢、预防心脑血管等疾病，以及防癌抗癌的作用。水提取法是提取茶多酚类化合物的常用方法。且茶多酚类的组分复杂，我们可以利用分离原则按分子大小、极性大小、酸碱强弱或与不同的金属盐络合的不同特点进行分离。通过实验确定一个提取茶果壳中茶多酚的优化工艺。通过实验为茶果壳的开发利用提供数据，同时也可以减少茶果壳的浪费。此外，希望通过此研究引起人们对六堡茶果壳的价值重视，不仅可以变废为宝，还能让农民增加收益。',0),(123,7,31,NULL,572,'基于人脸识别的系统研究与实现',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 09:25:46','       近年来，伴随着视屏监控覆盖面及应用面的迅速普及，急需一种在复杂环境中，不依赖距离远近、不依赖监控对象配合状态下的快速身份识别技术，用以迅速确认监控对象身份，从而实现快速智能预警。人脸检测与人脸特征提取容易受到背景、光照、姿态、遮挡、表情等因素的影响，从而导致识别率的稳定性不高且算法效率较低，因此研究出识别性高且效率较高的人脸检测与特征提取算法具有重要意义。人脸图像与普通物体图像不同，具有其特殊的性质。人脸部的五官特征明显，且位置相对固定。在图像处理时选取人脸的五官特征（左眼、右眼、鼻子、左嘴角、右嘴角、眉毛等）确定图像中的人脸并将其面部特征提取出来并结合人的肤色、步态特征来确定该人的身份，面部遮挡这一问题也得到相应的解决。此项研究可应用于公安部门以及学校、车站、银行等人流量大的公共场所，对公共安全、安防事业上具有重要意义。',0),(124,2,48,NULL,359,'测试',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 09:29:44','测试1.项目参与人必须为学校在校生；\n2.创新训练和创业训练项目负责人为非毕业班学生（应以大二大三学生为主）；\n3.鼓励学生跨专业、跨年级组建团队申报项目；\n4.每名学生作为项目负责人一次只能申报1项，且应在负责项目结题后才能申报下一个项目；\n5.每名学生同时参与项目数不能超过2项（含未结题项目）。\n1.项目参与人必须为学校在校生；\n2.创新训练和创业训练项目负责人为非毕业班学生（应以大二大三学生为主）；\n3.鼓励学生跨专业、跨年级组建团队申报项目；\n4.每名学生作为项目负责人一次只能申报1项，且应在负责项目结题后才能申报下一个项目；\n5.每名学生同时参与项目数不能超过2项（含未结题项目）。\n',0),(125,7,31,NULL,571,'基于图像处理的车型识别系统研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 09:33:38','据统计，随着我国车辆保有量逐年稳步的增长，利用车辆进行违法犯罪事件也随之增多，给城市交通安全以及管理部门的工作带来了严峻的挑战。人们在加快城市道路建设步伐的同时，已逐渐意识到实行科学的监管才能解决所面临的交通安全问题。1980年以来，随着科学技术的发展，许多国家如日本、美国等，有效集成了人工智能、自动控制、信息和通讯、电子技术和系统工程,建立广泛的综合交通管理系统，即智能交通系统(Intelligent Transportation System, ITS)凹。它是先进传感技术、电子通信技术、信息处理技术、自动化控制技术和计算机技术等多学科的有效集成和应用，能够对大范围的道路交通进行准确、有效且实时地监控，从中提取有用信息，实现对道路交通的管理。\n    基于图像处理的车型识别技术是模式识别在智能交通领域进行的典型应用。该技术所需设备简单、操作方便、可全天候全时段使用，智能化实行节省了大量',0),(126,2,48,NULL,359,'侧地',1,0,NULL,0,0,0,NULL,NULL,NULL,NULL,NULL,'第1步：网上申报（3月26日—4月1日）\n第2步：参赛报名审核（3月26日—4月1日）\n第3步：二级学院汇总报送材料（3月26日—4月2日）\n第4步：项目评审（4月3日—4月10日）\n第5步：公示（4月11日—4月17日）\n第6步：报送材料（4月18日',0),(127,3,52,NULL,491,'老香椿菜馆“宝贝计划”',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 10:00:18','老香椿菜馆“宝贝计划”是以大新县硕龙镇老香椿菜馆为依托，以亲子为核心定位的亲子游园体验项目。本项目致力于塑造老香椿菜馆特色亲子餐饮服务的形象，集生态科普、农耕文化、素质拓展为一体的亲子乐园，让孩子在快乐的环境中思考、行动，培养孩子喜欢动手、动脑的习惯。通过这些活动吸引更多的游客到老香椿菜馆，达到增加营业收入的目的。',0),(128,7,31,NULL,649,'无人值守停车场',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 10:04:43','本项目通过摄像头图像采集车牌号数据给STM32单片机，单片机通过识别车牌的区域、字符分割、字符匹配等算法识别出车牌号并显示在TFT屏幕上并显示车位数以防止车位停满，识别完成之后通过电机来打开闸道，传感器感应到车已进入停车场时关闭闸道，同时给主机发送识别好的车牌号。车辆离开时再次识别车牌并给主机发送指令，主机计算停留时间和费用。车辆出入的过程简单人性化，不需要向别的车场一样刷卡或者需要人来值守。',0),(129,4,11,NULL,475,'六堡茶茶籽壳纳晶纤维素的制备及销售',3,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 10:09:08','在国内，每年都有大量的茶籽壳丢弃，造成浪费，本研究首次以六堡茶茶籽壳为原料利用超声波法制备纳晶纤维素，从而变废为宝、不浪费资源、合理利用资源，并能减少其他棉、木材原料的消耗。六堡茶茶籽壳的纤维素含量高，对其进一步处理为纳晶纤维素。本研究对六堡茶产业废弃物的利用提供了新思路，同时扩展了制备纳晶纤维原料的范围。我们通过以六堡茶茶籽壳为原料制备出纳晶纤维素，并将制备得的纳晶纤维素进行网上销售，以满足国内高校、研究所、企业等科研等用途的需要，将来时机成熟时甚至可以大规模制备，进行工业化生产。',0),(130,6,32,NULL,166,'现代零售终端智能展台系统研发',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 03:32:10','现代零售终端智能展台系统是一个线上与线下实体结合的智能化零售系统。智能化是所有行业领域的一个发展方向和趋势。顺应新时代零售发展趋势，升级改造传统应用，利用新技术打造人、货、场智能商铺购物新场景。并且能够过数字化展示商品的同时、捕捉消费者行为大数据。能够利用显示屏展示多媒体技术，改变传统的静态展示方式，能够宣传品牌，塑造品牌形象，增加用户体验。通过智能终端，能够收集大量的数据，数据流化使得营销行动目标明确、可追踪、可衡量、可优化，从而造就了以数据为核心的营销闭环，即消费——数据——营销——效果——消费。',0),(131,4,22,NULL,594,'基于STM32的远程操控智能花圃修理机 ',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 10:50:46','本项目是基于STM32的远程操控智能花圃修理机，智能自动操作完成对花圃的修剪。项目主要分为硬件和软件两个部分。硬件主要由STM32F103ZET6控制芯片、红外传感器、直流电机、蓄电池供电。机械设备为长方体，总体分成两层。上层部分为修剪部分，顶面两侧面分别安装895大扭矩高转速直流电机，红外传感器装在机械顶面；下层为机械底盘，电机驱动器装下层机械底盘，安装电机带动设备车轮转动。\n软件部分主要由控制模块、传感器模块、执行模块构成。STM32单片机开启控制设备运行，设备可以通过APP接收到传感器反馈的数据，远程操控，自动靠近花圃检测并识别花圃，设置模式自动修剪。',0),(132,4,27,NULL,633,'微型镗孔机',3,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 11:21:06','1.	机械加工、矿山开采、汽车制造、船舶制造、工程机械修理等诸多行业面临空间小，固定安装点焊型镗孔机极其不方便，单钻孔机又无法满足工件要求孔的大小和精度，目前只能用手工镗孔等方法来加工工件，而工件孔精度要求又较高的加工环境。\n2.	同时为贯彻落实国家“大众创业，万众创新” ，高校处于科技第一生产力、人才第一资源、创新第一动力的结合点，是国家科技创新体系的重要组成部分的大形势背景下。\n3.	本项目的研究宗旨是研制出一种体积小，重量轻，操控简便，造价成本低的便携式船用镗孔机。从加工方面：在保证加工精度的前提下，满足加工要求。\n4.	便携式镗钻孔机实际实施后可以胜任该环境下的镗钻孔工作，并在未来可代替手工镗孔成为该环境下作业的主流用具。在舟山、宁波等地推广后有着260多万元的经济效益。\n\n',0),(133,5,49,NULL,667,'漫鱼摄影工作室',3,0,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 11:31:40','摄影行业在今下，正是在高速发展的朝阳产业,因为社会对于信息图片的需求不断增长，所以摄影的发展空间是在日益扩大的，整体行业都处于蒸蒸日上的状态。并且在今下，服务消费，时尚消费，品质消费已经渐成主流，摄影行业潜力巨大，所以就得以迅速发展，现在的摄影行业在市场上已经形成了一定的规模，我们成立该摄影工作室项目，正是符合现在社会的消费需求。我们工作室提供风光摄影，婚纱摄影，个性写真，儿童摄影，公关摄影，广告摄影，摄影相关服务等。面向的群体面十分广，丰富了我们个人的阅历，也对我们本身的社会经验和技能提高有一定的帮助',1),(134,8,48,NULL,665,'研究忻城莫土司衙署中的土司制度文化',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 11:24:48','        “土司制度”是封建王朝统治阶段用来解决西南少数民族地区的民族政策。土司制度在广西推行的目的是“以夷制夷”，因此它建立了一套严密的统治机构，治理辖境的政治、经济、文化以及诉讼、刑罚等。这个制度在一定的历史上对少数民族地区的统治和发展起到重要的作用。\n       本项目以我国现今保存最完整的土司建筑群，被誉为“壮乡故宫”的莫土司衙署中完整、丰富且具有代表性的土司文化为切入点来研究忻城的土司制度，它也是广西地方民族史研究中一个值得关注的方向。本项目通过进行实地考察与收集，然后对相关文献资料进行研究与拓展，深入研究忻城莫土司衙署中的土司制度，成果为论文和剧本，用更多的表现形式让更多人了解土司制度在少数民族中所带来的影响，让少数民族地区的土司制度文化发展成为“优秀中国文化遗产”。',0),(135,6,2,NULL,668,'精准扶贫政策MG动画--户户通平台',1,0,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 04:04:00','现今，精准扶贫政策宣传工作，党和政府都高度重视，如何将脱贫致富的理念、政策的深入基层的贫困户中，其中政策的宣传工作有着极其重要的作用，本项目主要研究以宣传扶贫政策为主题，通过制作 MG 动画系列短片为主，解读手册、连环画等为辅，详细介绍扶贫的大政方针，提高群众政策知晓率，每家每户贫困群众都能进一步了解精准扶贫的新思路、新政策。\n由于局限性，还有很多农村的贫困户文化水平不高，他们理解不了政策的长篇大论，面对这样的现状，我们的团队致力打造一个平台，将所有的扶贫政策、国家新闻都通过动画、连环画等形式，形象的展现给贫困户。以物联网为传播纽带、MG动画作为传播载体，我们将系列的政策动画不断通过网络平台发布，提高群众对扶贫政策的知晓率，营造人人知晓政策、人人参与扶贫攻坚的浓厚氛围。',1),(136,4,22,NULL,613,'温度显示智能保温杯',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 11:55:39','带温度显示保温杯是一个在杯盖有温度显示的保温杯，该杯子除了具有保温杯最基本的保温、过滤功能，还兼具显示杯子里水温的功能，通过温度传感器，在温度显示屏直观、精确显示温度。同时对杯子进行宣传推广，通过进行市场调查、客户意见征求来制定切实可行的销售计划，再收集用户的使用反馈对产品进行完善尽可能的满足客户需求，让更多的用户认识、接受并认可我们的产品，从而实现产品从设想到设计生产再到投入市场的目标。',0),(137,3,43,NULL,674,'“寻找骑楼”文创产品(文具类型)开发',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 12:03:59','项目以梧州骑楼城为基础，提取骑楼城元素，打造成富有文化趣味的骑楼城文创产品，设计并推出富有文化趣味的、体现时尚和实用的笔记本、书签、钢笔、明信片、u盘和笔盒等文具类型骑楼城文创产品。通过这些具有创意性的个性十足又具有文化特征文创产品（文具类型），同时也能够让年轻的群体能够重视对旅游地独一无二文化资源的保护。同时树立骑楼城旅游品牌，打造骑楼城旅游特色。',0),(138,7,31,NULL,533,'智能写绘机器人',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-29 12:58:16','随着人类现代科技化的发展，人们会出现：没时间写字、画图和提笔忘字的社会现象。可采用STM32为主控平台、上位机为控制平台、CoreXY作为机械结构的服务型智能写绘机器人改善。该机器人可通过上位机将语音输入、文字、图画转换为G代码，用串口通信发送到下位机，使TB6560驱动器和步进电机等模块驱动，完成写作和绘画功能。帮助人们准确完成写绘工作。项目的目标和预期成果为：设计操作简易、高效节能、安全性高的智能写绘机器人。',0),(139,4,27,NULL,673,'自动泡茶机',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 13:18:18','中国具有本身的喝茶文化，且历史悠久。目前，饮茶和品茶已成为人们日常不可缺少的娱乐活动，自动化社会是目前社会发展的主旋律，而泡茶的机械设备还较少。\n目前市面上的自动泡茶机性能少，自动化程度不高，价格较于昂贵不适用于普通家庭。本课题研发一种自动泡茶机，只需把茶叶放进容器里面，打开电源，剩下的只需等上一段时间就可以喝上美味可口的茶。自动泡茶机力求适用于大众，简单操作，方便使用，价格比较低廉。',0),(140,4,24,NULL,520,'激光熔覆原位合成硼化物颗粒增强铜基导电耐磨涂层的研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 14:26:53','纯铜具有导电率高、导热性优良、易加工等优点，铜及铜基复合材料广泛应用于电刷、电触头、集成电路引线框架、电车受电弓滑板等导电领域。铜合金和铜基复合材料提高了铜的强度，往往伴随着导电性的下降。本课题拟在传统的轧制铜板材上，预置Cu-Ti-B体系的合金粉末，保护气氛下激光熔覆原位合成铜基硼化物颗粒强化涂层。研究硼化物铜基复合材料导电性耐磨性与熔覆工艺、涂层微观结构三者间的关系，解决硼化物铜基复合材料耐磨性提高导电性降低的矛盾。',0),(141,6,31,NULL,256,'基于微信平台自助导诊系统',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 15:13:43','这是一款根据我国医院现阶段所存在的一些问题如诊疗率达不到期望值网络诊疗有效率低等所研发的一款集室内导航，路线绘制，自助导诊多功能跨平台的多媒体互动导航系统。通过与医院共享版权，为医院提供个性化售后定制服务，收取费用。未来会将合作医疗和我们的系统合二为一，为患者推荐报销比例最高，医资力量最雄厚的医院。并在导航开启时进行实时语音播报，智能分析等候时间减少不必要的时间浪费。\n',0),(142,5,49,NULL,686,'民族歌曲流行化演唱的实践研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 16:49:41','民族歌曲流行化演唱形式的出现和趋势，是国内文化艺术事业新形势下青睐的新兴事物和新的尝试，为民族歌曲的传承和发展找到了方法和途径，为民族歌曲注入了新的元素（流行音乐），丰富了民族歌曲的内容及创作形式，从而推动民族音乐的创新发展；本项目通过实践研究，对民族歌曲的调式调性、曲式结构、节奏节拍、伴奏形式以及歌唱语言等方面，进行流行化演唱的改编，对其进行更深层次的实践与研究，为流行音乐的创作注入了新鲜的血液，丰富了流行音乐的内容，也为流行音乐的创作指明了新的方向，而且通过与民族歌曲的结合，扩大流行音乐的受众范围，使流行音乐更具内涵和民族性。有了思想性和可挖掘性，在继承民间音乐精粹，发扬中国传统音乐的基础上流行化演唱改编是促进中国声乐艺术创作、演唱共同进步的一条康庄大道，促进文化艺术事业的大发展大繁荣。',0),(143,4,27,NULL,569,'蹲便器清洗机',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 15:34:32','       面对普通蹲便器人工清洗不方便，过程繁杂，并且耗费大量时间的问题。本产品根据蹲便器的形状，利用多个毛刷的旋转对蹲厕器进行自动清洗，使每一个角落都可以清洗到位。解决了各大家庭洗厕的不便，使洗厕过程更简单快捷。蹲便器自动清洗机对于一般家庭可放心使用，随着产品知名度的提高推广至公厕，不仅大幅度提高了清洁工人的清洁效率，还释放大量的清洁工人劳动力。拥有广阔的市场前景，巨大的市场需求量。',0),(144,5,60,NULL,689,'音乐课堂中传统音乐融入流行音乐的实践研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 15:49:29','现代的音乐课堂，必须与研究的实践链接，注重实践，着眼于知识、情感、态度和价值观的形成，同时在课堂中应特别强调音乐的体验表达。传统音乐融入流行音乐的教学课堂是创作者或者表演者极具个性的呈现，是对传统音乐的体验表达，也是对流行音乐形式的丰富手段，需在充分理解并深入体会与感悟后才能实现，没有长期的熏陶浸染，没有大量的研究供我们参照、借鉴，要还原技艺原型感觉并体会全新的视听效果是不太可能的。于是，课堂中的教学工作和学生的学习效果就必须基于了解大量的音乐信息，结合步骤性的方式方法，并最终形成有效的传统音乐融入流行音乐的教学模式。',0),(145,2,47,NULL,690,'广西各高校英语专业学生英语口语运用能力现状调查以及应对策略研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 01:24:16','该项目针对广西各高校英语专业学生英语口语水平和口语运用能力问题，以英语学习者的身份，通过调查、访谈、数据统计等方式总结出广西各高校学生英语口语运用的基本现状。根据调查结果，了解英语专业学生英语口语学习和水平，分析影响提高英语口语运用能力原因，探讨提高广西各高校英语专业学生口语水平和运用能力的对策，进而提高英语专业学生口语水平和运用能力。',0),(146,9,43,NULL,287,'\"独家记忆”专卖特色食品店',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-29 15:59:01','“独家记忆”是一个集社会效益和经济效益于一体的创新创业项目，它不仅可以带来经济效益，同时为我校学生提供勤工俭学岗位，更重要的是我们的“特色食品换书”，再捐赠的活动，可以带来极大的社会积极效益，而且结合来自各地的师生的思乡需求，为广大师生提供来自各地各具特色的美食小吃，排解广大师生的思乡之苦。同时以本店为平台，向广大师生传播丰富多彩的美食文化，增进饮食文化的认同感，促进倡导健康的饮食观念。\n\n',0),(147,2,57,NULL,691,'广西地方高校英语专业学生中国优秀传统文化现状调查研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 04:16:19','该项目针对广西地方高校英语系专业的学生在学习英语的过程中对于中国优秀传统文化的了解程度以及态度情况。我们队伍以英语学习者的身份，通过走访、问卷调查、访谈、数据统计等方式总结出广西各高校英语系学生对于中国优秀传统文化的了解现状。根据调查的结果对广西各高校英语学生对于中国优秀传统文化了解多少的情况进行分析以及寻找原因，进而引起广西各高校英语系学生要学习、了解、传播中国优秀传统文化意识。',0),(148,6,2,NULL,668,'微学网——微课在线教育服务平台',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 11:58:11','随着流媒体技术的发展，学习变得越来越大众化、便捷化，微课突破了传统的教学模式，它短小精悍，学者可利用微课查缺补漏，强化巩固知识。UI设是近年来的产物，作为新兴技术，原创的ui设计更为重要，而原创性更是衡量设计师的重要标准，在没有手绘基础、缺少自我创作能力的基础下，如何去绘制好一个图标或者插画等设计作品，我们团队推出了UI原创设计在线微课教育服务平台，通过视频为主要载体，在短时间内完整、清晰、生动的讲解教学内容，不管是学生党、职场达人，有UI设计基础或者入门小白，针对不同年龄、不同基础的人，我们将推出相对应的课程，让更多的人学好UI，成为优秀的UI设计师。我们的微课教育平台除了可在PC端运行，我们还推出移动端APP，让人们随时随地都能使用手机进行学习，同时包含了多交互学习，例如二维码，人们直接扫描即可进入学，减少了APP所占用的内容，给人们带来更多的方便。',0),(149,6,32,NULL,324,'党务工作建设及管理信息平台',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 04:17:38','中国共产党基层党组织是承上启下的纽带，而我党赖以生存的群众路线正是通过基层党组织来实现的，传递党的方针、政策以及路线等系列重要思想。发展党员是基层党组织的基本任务，是不断为党输送新鲜血液，永葆党的先进性的重要途径。\n本项目突破传统党建发展管理的工作方式，利用现代化信息技术实现基础党组织的管理及发展，实现管理和规范党员的发展过程，严格按照党组织发展党员的程序对发展过程实现动态管理和监控，完善党建工作机制以及相应规章制度，将党建考核指标量化而公开面向大众，为开展党建工作注入新的活力。同时提高党务工作者的效率、优化党建工作信息的存储、规范党建工作。作为新的活动载体吸引党员群众充分发挥基层党组织凝聚力、创造力和战斗力。',0),(150,4,27,NULL,311,'串珠机',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 04:37:17','       串珠机是本项目团队自己研究发明的振动式自动串珠的机械设备，体积小、结构简单、操作简便、制造成本低，能实现定额串珠并有焊接的功能，该设备能实现Φ5mm、Φ8mm、Φ11mm、Φ14mm，通孔Φ2～5mm圆形规格的木珠串好并焊接成串本文设计的振动式自动串珠机主要由入料装置、输送装置、振动串珠装置、夹紧装置、送线装置和焊接装置六个部分组成。为的是使串珠工作实现功能一体化、生产集成化，在生产劳动市场上具有显著的意义和巨大的商业价值前景。',0),(151,4,27,NULL,226,'苹果辅助采摘的设计与实现',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 11:14:46','本项目的设计主要应用于采摘高空处人手够不到的苹果，这样就不需要人爬上树，或用传统麻烦的杆来摘了，减少了人对果树的伤害有利于其生长又降低了劳动的强度，节约了劳动时间的同时又加快采摘的速度，该设备结构简单便于制作，轻巧方便于携带，制作成本也不高，还有自动装箱的功能，装满一箱后重新放个箱子就可以继续采摘了，非常方便、简单。相较于人工采摘有很大的市场前景，有很大的推广应用价值，可以有效的推动苹果产业更好更快的发展',0),(152,7,31,NULL,571,'基于图像处理的车脸识别系统研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 06:02:08','       随着我国车辆保有量逐年稳步的增长，越来越多的车主利用套牌车辆逃避交各种税费，养路费，套牌车辆发生交通事故，肇事逃逸后难以追捕，给城市交通安全以及管理部门的工作带来了严峻的挑战。\n      当前车辆识别主要依赖于车牌识别技术。近年来出现越来越多的将嫌疑车辆变为套牌车甚至无牌车的刑事案件。如能对该类车辆进行车辆识别与车辆排查筛选，将对协助破获相关刑事案件起到十分积极的作用，也将更有效地震慑违法犯罪。因此，基于非车牌特征的车脸识别技术将是本项目工作的一个特色与创新之处。该技术够从相关的交通视频或卡口图像中提取特征，并对车辆特征进行分析和处理，挖掘相关知识。智能化实行节省了大量的人力、物力的同时也为城市交通安全以及管理部门管理打击犯罪分子提供了巨大有力条件。\n',0),(153,9,43,NULL,703,'“马路市场”存在的问题与改进策略研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 06:40:10','本项目主要为探究目前农贸市场的随意摆摊的现象分析，并作出相应的可应用解决方案。\n以抽取不同的城市多个农贸市场为样本，对农贸市场乱象进行调研，广泛听取群众意见，根据收集得到的资料提出多个改进的解决方案（主要方向为应用私人资本提供公共产品和政府购买服务）。\n试通过实践理论相结合，对拟提出的解决农贸市场乱象的方案进行可行性探究，通过模拟农贸市场管理的实验，进行相应的计算，最后得出可解决目前现状的最优方案。\n',0),(154,4,27,NULL,88,'青枣采摘机',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 06:25:59','青枣采摘机是项目团队自己研究发明的。该设备主要分为三大部分：采摘装置部分、输送装置部分以及收集装置部分。该设备操作步骤方便简洁，便于使用者快速熟悉并运用在实际的摘果行动中。操作人员只需要将采摘装置夹持对即将采摘成熟青枣的枝杆；接通电源后，直流电机驱动采摘装置中的滚轮沿枝杆滚动行走，将青枣捋下，约束环起到了导向且防止跑偏的作用。输送部分由接枣漏斗和软套管组成，采摘后的青枣会沿着软套管滑入收集装置中，该装置具有减震作用，以免青枣表皮受到损伤。这样的机器就可以解决青枣采摘人工投入大、效率低的问题，从而大大的减少了人力的工作强度',0),(155,5,49,NULL,667,'漫鱼摄影工作室',3,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 06:30:57','摄影行业在今下，正是在高速发展的朝阳产业,因为社会对于信息图片的需求不断增长，所以摄影的发展空间是在日益扩大的，整体行业都处于蒸蒸日上的状态。并且在今下，服务消费，时尚消费，品质消费已经渐成主流，摄影行业潜力巨大，所以就得以迅速发展，现在的摄影行业在市场上已经形成了一定的规模，我们成立该摄影工作室项目，正是符合现在社会的消费需求。我们工作室提供风光摄影，婚纱摄影，个性写真，儿童摄影，公关摄影，广告摄影，摄影相关服务等。面向的群体面十分广，丰富了我们个人的阅历，也对我们本身的社会经验和技能提高有一定的帮助。',0),(156,4,27,NULL,715,'肠衣检测机',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 06:39:05','随着科技的发展，社会的需求，检测肠衣的工作也由人工转变为自动化。本项目推出的是肠衣检测机，该作品针对刚刚生产的肠衣进行好坏的检测。其中包括检测肠衣的好坏程度和是否出现变质损坏，该项目不仅采用机械自动化式的控制方式，还有数字影像技术。通过测试进行效率的对比，一台机器的工作量等于两个人的工作量，而且一个人可以同时操作五台机器。通过这种方式，大大提高了工作效率，提升了利润的收入。',0),(157,5,60,NULL,711,'幼儿音乐启蒙的对策研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 06:42:49','2018年11月7日，《中共中央国务院关于学前教育深化改革规范发展的若干意见》发布，针对学前教育的深化改革和规范发展方面提出了具体意见。这反映了国家对学前教育的重视，而幼儿音乐启蒙教育是学前教育中不可替代的重要组成部分。《意见》中指出了目前幼儿音乐启蒙教育教学的方式和方法过于单一，导致幼儿在日常音乐启蒙教育过程中缺乏自主体验的问题。本项目主要特点如下：\n（1）引入多种教学方式，结合奥尔夫、达尔克罗兹、柯达伊三大音乐教育体系，使课堂教学游戏化，激发幼儿内心对艺术的追求，提高幼儿的音乐素养，帮助幼儿形成良好的个性和健全的人格；\n（2）幼儿教育与家庭教育相结合，为幼儿创建良好的音乐教育环境；\n（3）把幼儿作为音乐教学的主体，优化音乐教学模式，正确处理幼儿音乐教育同专业音乐教育之间的关系。',0),(158,3,59,NULL,329,'互联网+自习室',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 02:59:17','“互联网+自习室”项目通过线上打卡监督与占位、线下学习服务新型自习模式打造一体化服务，线上打卡监督即通过手机扫描二维码或者签到码进行线上签到，并及时编排出座位号，更新空座位信息，实现座位的高效利用；线下学习服务即提供独立的学习空间，及时且有用的学习考证资料，以及提供饮用水、食物、简单文具等，保证长时间、高效率的学习。\n近年来，随着大学普遍扩招大学生人数激增，考研与考证成为热门，能学习的地方人满为患，出现了‘一座难求’的现象。特别是我校，学习场地有限，基础设施不够完善，极大部分大学生对于学习场所和环境并不满意。因此，开一间提供一体式服务、氛围良好的自习室具有明朗的前景，采取线上线下相结合的模式迎合了市场需求，满足顾客意愿，提供学习场地、提高学习效率，具有充分的市场导向性。',0),(159,9,43,NULL,495,'基于共同治理视角下我国社区治理问题及其路径选择研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 08:08:49','对于社区治理的长远来看，如今的社区治理模式的创新机制还不够，还处于被动治理的模式，居民参与治理的程度还远远达不到主动治理的程度，社区治理方式得不到有效的实行。\n（1）将社区治理与当前我国治理相协调发展中来，适应我国经济与文化发展的进程中来；\n（2）使得社区治理模式的各个管理者协调合作有一个有效的指导；\n（3）规范我国社区治理的方方面面，加快社区治理朝共同治理中发展。',0),(160,9,43,NULL,495,'基于多元治理视角下我国社区治理问题及其路径选择研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 08:14:27','对于社区治理的长远来看，如今的社区治理模式的创新机制还不够，还处于被动治理的模式，居民参与治理的程度还远远达不到主动治理的程度，社区治理方式得不到有效的实行。\n（1）将社区治理与当前我国治理相协调发展中来，适应我国经济与文化发展的进程中来；\n（2）使得社区治理模式的各个管理者协调合作有一个有效的指导；\n（3）规范我国社区治理的方方面面，加快社区治理朝共同治理中发展。',0),(161,7,31,NULL,533,'智能写绘机器人',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 08:36:11','随着人类现代科技化的发展，人们会出现：没时间写字、画图和提笔忘字的社会现象。可采用STM32为主控平台、上位机为控制平台、CoreXY作为机械结构的服务型智能写绘机器人改善。该机器人可通过上位机将语音输入、文字、图画转换为G代码，用串口通信发送到下位机，使TB6560驱动器和步进电机等模块驱动，完成写作和绘画功能。帮助人们快速准确地完成写绘工作。项目目标和预期成果为：设计操作简易、实用性强、高效节能、安全性高的智能写绘机器人。',0),(162,5,49,NULL,363,'久石文化传媒工作室',3,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 08:57:49','久石文化传媒工作室成立于2018年8月，是梧州新兴的一家基于网络传媒和实践创新传媒公司，致力于在梧州传媒行业中打造一个独树一帜的网络新媒体和实践创新新媒体。\n久石文化传媒工作室主要从事大型舞美设计与设备租赁、大型商业演出，文艺活动，组织、策划与宣传、艺人经纪等众多活动，既为专业机构提供宣传推广，又为优秀个人提供个人展示、就业与商业合作的机会，同时也让商家发现更好的人才，实现真正的双赢。',0),(163,6,32,NULL,525,'基于STM32单片机的卧室环境监控系统',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 08:58:01','现如今，人们越来越注重睡眠质量，以及智能网络系统逐渐广泛应用到各个方面，我们打算应用智能网络监控系统来对卧室环境进行监控，通过监测周围环境的变化来改变家电对生活的实用性和适用性，每个单位都拥有一个独立的协调器、多个无线通讯ZigBee节点模块。在协调器和每个子节点上都接有一个ZigBee无线通信收发模块, 数据通过这些模块在协调器和子节点之间进行传送。',0),(164,2,47,NULL,726,'高校-社区联动下外语服务创新模式研究-以建立梧州学院外语服务站为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 15:45:39','自改革开放以来，外语教育占据着越来越重要的位置,然而高校学习外语专业学生真正将专业知识运用于社会实践的机会却少之又少。社区要满足居民的文化和娱乐需求，因而高校外语服务社区化关涉高校外语专业学生参加社会实践，将所学服务社区，实现高校一社区联动:一方面,高校利用密集丰富的智力资源服务社区,促进社区乃至社会的健康发展;另一方面，高校学子通过社区服务将理论与实践结合，提高学生综合素质发展，进一步提升高校办学水平。',0),(165,3,52,NULL,717,'新时‘代’-帮手服务',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 09:07:28','“新时‘代’-帮手服务”校园创业项目围绕“代劳”来开展业务，主要是帮助一些没时间或不愿意自己出面去完成工作、任务、及人际交流的人完成他们的需要，作为他们的一个“帮手”来认真努力完成他们所要求完成的事情。项目的营业手段主要通过网络（微信，QQ等社交软件）和小据点（宿舍）来接单，根据不同类型的业务收取相应的金额，以此来维持项目进行和盈利。而主营业务是从事代写聚会策划、代写广告文案等七项业务，通过我们的服务为受助人解决时间不足、工作应接不暇的问题，让他们能更专注，更有效率的做其他工作。同时通过这些业务我们自身可以从中学习知识、吸取各种得到经验和教训，为以后的就业或创业的实践活动提供理论支持。',0),(166,4,27,NULL,149,'校园快递存取柜',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 09:14:26','校园快递存取柜是一款适合投放于校园快递中由纸箱或硬壳包装的快递包裹在派件环节上使用的机械自动化设备。该设备的设计改善了国内市场上已有用于快递存取的智能柜存在存储容量无法向上扩展、受人力身高限制、占地面积大的缺陷问题；针对设计的创新点在于派件效率高，存取时间灵活，特别适合校园快递的应用。所以该项目的研究具有重要意义。',0),(167,7,31,NULL,697,'基于ZigBee的无线对讲系统',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 09:31:39','基于ZigBee的无线对讲系统是以C8051F912单片机为核心控制元件，系统的硬件设计主要包括充电电路设计、稳压电路设计、充电保护设计、语音解码电路、ZigBee模块、功放电路设计等部分，系统启动后，呼叫方的语音信号由麦克风输入，通过AMBE-1000可实现编码，将数据传送给单片机，单片机将处理后的信号发送给ZigBee模块，将信号传给AMBE-1000解码，同时运行串口程序，将信号传给功放，实现无线对讲。',0),(168,7,31,NULL,549,'快件智能追踪器',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-30 09:34:19','本项目是基于51单片机的快件智能追踪器。该快件智能追踪器主要包括GPS模块、时钟模块、无线接收模块等模块。采用GPS模块实现智能追踪实时定位功能，同时通过无线通信模块进行数据远程传输。在快件运输途中（高峰期），时间在同一个位置滞留超过2个小时时（18个小时），追踪器会将此时刻物件所在地的时间、时区和详细位置反馈给用户。通过无线模块来实现单片机与手机的通信，用户随时可以通过手机接收短信的方式来实现对快件的追踪。\n\n',0),(169,8,52,NULL,704,'佳思学院',3,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 10:23:36','随着社会的发展，劳动力过剩,就业难在我国是一个非常突出的问题。随着大学扩招，大学生毕业生的迅速增加，而社会需求基本上保持在扩招前的水平，而且许多单位希望应聘者都能有几年的工作经验，毕业生的就业压力越来越大。而在这样的形式下，我们很多大学生只仅限于大学里活跃，缺少社会实践和锻炼，在个人气质和个人抗压能力上有所欠缺，实践能力也不够强。佳思学院是一所通过3C 产品销售行业，以提升大学生的个人气质，锻炼大学生的各项能力为主的平台。由一群有梦想、有目标的年轻人,  为了同一个梦想一起努力奋斗而组成的团队。佳思学院致力于打造大学生的第二个大学、第二个家，为更多有梦想的大学生提供锻炼的平台，让在校的大学生实现经济独立，减轻家里的负担，成为一名有理想、有能力、对他人有帮助的人，更致力于全面提升大学生的气质，让大学生在大学得到真正的锻炼，从而成为有能力、有气质的大学生。\n',0),(170,8,48,NULL,550,'“互联网+”背景下水上船歌的采集和传承',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 10:30:39','      随着国家对文化软实力的重视及“互联网+”的发展，运用现代科技保护和传承传统文化势在必行。水上船歌作为我国传统文化中的瑰宝之一，包含丰富的文化底蕴，水上船歌作为广西梧州的一个地方戏剧，具有浓郁的地方特色，是一项宝贵的文化财富，但是如今仍有许多人对传统文化的认识缺失，导致许多优秀的传统文化无法传承下来。因此，本项目利用互联网打破空间限制的优势，普及有关水上船歌的知识，加深人们对水上船歌的了解，实现水上船歌的大众化和现代化，保护和传承非物质文化遗产——水上船歌。',0),(171,9,43,NULL,500,'多元治理视域下的社区居家养老服务——广西梧州市的实证研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 10:36:35','随着人口老龄化程度的不断加深，养老服务需求不断增大，养老问题日渐突出。社区养老是家庭养老与社会养老相结合的一种新型的养老模式，它是以家庭为核心 以社区为依托，以老年人生活照料、医疗康复、精神慰籍为主要内容，已上门服务和社区日托为主要形式的养老方式。但受传统家庭式养老观念和传统伦理文化的影响，意识形态跟不上层建筑的发展，传统的养老观念适应不了现代新型的社区养老模式。社区养老是多方面共同参与、共同合作的一种养老方式，涉及多个主体的利益，社区养老不仅给民营企业提供发展的机会，创造了更多的就业岗位，在一定程度刺激了经济的发展，而且解决老年人口精神生活匮乏的状况，真正实现老有所养、老有所医、老有所学、老有所乐。',0),(172,4,33,NULL,685,'复方寄生茶酒制作工艺研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 11:27:00','桑寄生茶具有补肝肾，强筋骨，祛风湿，安胎元作用，具有较好的研究开发价值。本项目研究优质复方寄生茶酒工艺方法。采用原料选择→茶汁萃取→过滤→冷却→茶酒配制→茶酒发酵→包装→成品工艺流程，通过超声辅助水提法萃取茶汁，优化萃取工艺条件，探索复合中药配方，配制茶酒再经发酵与醇化，获得高质寄生酒，充分保留不耐高温的生物活性成分及各种营养成分，从而提高药理效应，增强其药理保健作用。',0),(173,4,52,NULL,684,'梧院易宝',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 11:35:14','梧院易宝是一个专门服务于梧州学院师生的二手交易平台，它由学生自主经营。其主要功能与网上的二手交易网站一样，但性质却是不同的，它主要是为同学、老师们提供服务，属于服务型平台。\n平台专门服务于高校师生，操作简单，有自己专属高校的系统管理方式，宣传推广方式、用户反馈机制，打假机制、二手商品的评估功能机制，也有业务拓展规划机制等等。平台包含的商品都是师生在学习上、生活中用得到的，让闲置的资源得到合理的利用，价格也非常地公道，可以说是对买卖双方互利共赢的。',0),(174,7,31,NULL,549,'快件智能追踪器',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 12:31:28','本项目是基于51单片机的快件智能追踪器。该快件智能追踪器主要包括GPS模块、时钟模块、无线接收模块等模块。采用GPS模块实现智能追踪实时定位功能，同时通过无线通信模块进行数据远程传输。在快件运输途中（高峰期），时间在同一个位置滞留超过2个小时时（18个小时），追踪器会将此时刻物件所在地的时间、时区和详细位置反馈给用户。通过无线模块来实现单片机与手机的通信，用户随时可以通过手机接收短信的方式来实现对快件的追踪。\n',0),(175,6,32,NULL,702,'文化传流工作室',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 13:23:05','通过搭建微信平台、设计简单上手的微信小游戏、成立一个小型商城，展示系列衍生品，如一套餐具、系列红包、春联、窗花、贺卡、灯笼、钥匙扣、印花T恤、字牌、抱枕，用户可以线上订购。加入AR技术，打开拍照功能扫描插画可以形成趣味动画，并依托于互联网新媒体将灯笼文化以更加生动有趣的方式推广向大众。用更新颖、更易让人接受的方式让更多人了解传统的灯笼文化，从而推广我们中华民族传统文化。',0),(176,7,32,NULL,722,'室内人体异常行为识别及实时监控',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 13:56:31','    人体行为识别是计算机视觉与模式识别领域的一个新兴研究方向。本项目拟对人类在室内活动中的行为识别并分类，以便进一步对人类的异常行为进行监控和干预。项目拟利用MATLAB软件进行视频图像处理，对图像视频序列的人体进行目标识别，提取目标特征，然后进行人体行为建模和分类，例如站立、摔倒、弯腰等。最后通过发送邮件的形式对人体异常行为进行实时监控。项目内容分为四大模块：目标检测、人体跟踪、行为识别、实时监控。可运用在人机交互、智能监控、虚拟现实等领域，具有较高的研究价值和广阔的应用前景。',0),(177,7,31,NULL,730,'基于STM32的快递分拣系统',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 14:03:26','本设计研究的是一种运用于智能快递分拣工作的系统，主要包含以下部分：系统主控板、图像传感器模块、LCD显示模块、寻迹模块、电机驱动模块、智能小车。采用STM32芯片作为系统主控板的核心控制器，系统上电后，将含有快递投放位置信息的二维码对准OV2640图像传感器，OV2640图像传感器将拍摄到的二维码图像数据传至核心处理器，处理器对接收到的二维码图像数据调用译码库进行译码处理，译码成功后通过LCD将快递投放位置信息显示出来，与此同时智能小车自行启动，运用安置在智能小车前端的寻迹模块进行寻迹和横纵向计数，将快递包裹运至指定位置投放后返回，完成一次快递分拣。',0),(178,8,47,NULL,729,'玉林石南话亲属称谓研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 14:24:00','本课题立足于玉林地方文化，主要对玉林石南话亲属称谓进行研究。方言亲属称谓是一个地域社会文化的反映，而亲属称谓的变化体现了社会的变革与习俗的演变。在演变过程的过程中，有一些亲属称谓词会更加少人用，以至消失。本课题的研究旨在以文字的形式将石南话亲属称谓的语音和词语记录下来，分析其蕴含的文化内涵，以达到传承和保护地方特色文化，促进地方文化的长足发展的目的。\n',0),(179,9,43,NULL,554,'梧州市“双创”培训状况调研——以万秀区为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 14:26:25','本项目通过实证调研方式，以梧州万秀区高校大学生为主，社区群体为辅，从社会、地域环境、社区、企业、创业者个人等多个角度对万秀区“双创”培训状况进行点面结合的调研。了解存在的问题，提出解决的路径。不仅为的大学生、社区群体“双创”提供策略支持。还以点带面，为打造梧州市良好的创业培训环境，推动梧州中小企业的健康发展，促进梧州市的招商融智，推动东融战略的实现提供策略分析。',0),(180,3,43,NULL,551,'“阿米巴”与龟苓膏的遇见',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 14:32:56','阿米巴经营是推动中国企业迈向效益增长型企业的重要管理引擎，越来越多的企业正在着手建立阿米巴经营体系。梧州的城市经济发展的动力，势必要在新生的产业或者已有的老牌产业中进行较量，传统产业龟苓膏,打破原有的固步自封，建立新的系统，抛弃原有的乏善可陈，寻找所有的可能性。本次研究将以阿米巴为基点，引入王阳明先生的哲学思想，从邂逅到找寻属于自己的发展之路，重新给龟苓膏定位。',0),(181,8,47,NULL,741,'“全面推普”背景下博白地佬话现状研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 14:47:07','随着社会的不断发展，当代社会共同语在语言系统中的地位越来越重要。随着全面推广普通话，我国各个方言区的方言都产生了不同程度的变化，这种现象也引起了不少学者的关注。本项目是在“全面推广普通话”的背景下，拟通过田野调查、比较分析等方法，对博白地佬话语音现状及使用频率、影响地佬话语音变化的因素等方面进行研究。',0),(182,4,27,NULL,344,'菠萝自动采摘机',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 14:57:47','本菠萝自动采摘机共有三大功能，包含移动功能、采摘功能和收集功能。移动功能的设计为：采用履带来带动整个机器在地形较为复杂的菠萝地上稳定又快速的移动；采摘功能包含定位模块、抓取模块和切割模块，其功能设计为：先通过定位模块进行定位，再通过抓取模块对菠萝进行抓取，最后由切割模块对菠萝柄进行切割；收集功能包括传送模块和收集模块，其设计为：将摘取到的菠萝通过传送模块传送到机器后方收集模块的收集箱中。由此完成对菠萝的自动采摘工作。',0),(183,6,32,NULL,482,'基于AT89C51单片机的防丢器设计与实现',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 15:23:05','       本项目蓝牙防丢失器采用由STC89C52单片机，复位电路，晶振电路，蓝牙模块电路，手机报警接收器和电源模块组成。\n        首先打开手机蓝牙和主板蓝牙进行配对。配对成功后，单片机通过串口和蓝牙模块HM-05发送数据，手机蓝牙实时接收数据。当手机和蓝牙主板的距离超过一定距离时，手机发出警报声或振动提示。蓝牙防丢器具有可靠性，稳定性能好，抗干扰能力强用，使用方便，性价比高等特性。',0),(184,1,49,NULL,477,'“云启”影像工作室',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 15:32:39','随着网络购物的兴起，网络店铺因其便捷与多元化开放式的选择受到了人民群众的追捧，电子商务蓬勃发展，电子商务视觉服务应运而生，商家感受到其重要性。因为网络店铺的局限性商品只能通过图像和影像的形式展示，如何通过图片吸引到更多的客户群体，是商家的主要目的，这让网拍这个行业有了很大的需求市场。“运启”影像工作室主要经营方向为网拍，即为网络店铺拍摄其销售的产品。',0),(185,8,47,NULL,734,'钦州村话与土白话的语音比较',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 15:40:43','语言是一种文化资源，这越来越成为许多人的共识。习近平总书记多次强调“文化自信”，大学生肩负振兴中华神圣使命，在继承传统文化基础上进行文化创新，是每个大学生义不容辞的责任。本项目立足钦州地方特色语言文化。通过横向比较法。对钦州村话与土白话的语音进行比较，归纳出两种方言间音韵系统异同。进一步分析两种方言声母、韵母、声调特点，探索其中深层文化内涵。更好响应习近平总书记号召，传承和保护中国优秀传统文化。',0),(186,4,10,NULL,581,'茶果壳中多糖的提取及含量测定',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 15:57:23','开展此次研究，希望通过实验探索出更加快速并且有效的提取多糖工艺及影响含量的因素。为梧州六堡茶乃至全国茶果壳的利用价值提供有效证据甚至开拓其他利用领域；实现六堡茶价值最大化利用与宣传，早日走向世界舞台。',0),(187,4,10,NULL,463,'茶果壳热水提取物的抗氧化性研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 16:06:09','本文拟以梧州本地茶果壳为原料，对其热水浸出物进行分析鉴定，并对其抗氧化能力进行检测。以其为茶籽壳的保健饮用提供理论依据，为六堡茶的多样化产品开发提供数据参考。',0),(188,9,43,NULL,277,'“海知味”方格星虫网店',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 16:18:31','1.项目目的：扶贫一直是国家的重头戏，俗话说靠山吃山，靠海吃海，但在北海这些沿海村落却怎么也富不起来，原因：海地上虽生长不少的名贵沙虫，但是这些沙虫销售范围比较窄，且本地大多数人家自家都有，所以销量不是特别好。\n我们希望借助这次活动，利用互联网大数据时代，能够将村里的产业发展及推广全国各地，提高沿海村落的经济水平，走向脱贫富家的道路。\n2.研究内容：方格星虫，俗称“沙虫”，味道鲜美脆嫩，营养丰富，为海参、鱼翅所不及！历来是广西北海的一张名片。沙虫干是沿海地带的渔民，把沙虫从海滩中挖出来以后，经过烘烤得到的干品。新鲜的沙虫体积减小，而且方便运输和携带。\n我们的项目“海知味”方格星虫网店就是要解决沙虫销售范围窄的问题。\n\n',0),(189,7,31,NULL,742,'基于蓝牙的ASR骨传导耳语手环',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 16:52:05','STM32F103为设计的主MCU，咪头接受声音并传递至语音识别模块或者MCU，MPU6050检测手环时刻的姿态信息并发送至MCU， MCU根据手环姿态角变化来判断使用者的运动状态，完成步数测量。CRS8645负责与手机、电脑的连接，使手环能与之匹配，同时使用者的声音信号也通过蓝牙传输至手机或电脑。OLED是手环的图像显示部分，能够滚动显示时间、步数、热量、闹钟等，当来电或闹钟响时，震动模块发出震动警示。使用者只需将手指放到耳朵附近的颌骨处就能听到来电者的声音。',0),(190,8,49,NULL,758,'创文化——彩调文化研究传播咨询室',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 17:23:51','本项目本着“传承地方文化，创新传播方式”的宗旨，以桂林彩调文化研究为基础，从彩调音乐、舞蹈、妆容、服饰、民俗文化等方面研究出发，并结合当下互联网运用趋势，运用“线上+线下”的新型传播模式打造新型桂林彩调研究及传播平台。此项目意在把彩调文化研究与互联网传播相结合，创新桂林彩调文化传播新形式，让更多人了解桂林彩调的生存状态、内容形式、舞蹈艺术、音乐特色、地方文化色彩等，并吸引更多的人们加入到传承桂林彩调的行列中，助力与桂林彩调文化传承中。',0),(191,4,10,NULL,612,'不同年份六堡茶的茶褐素抗氧化能力比较研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-30 17:37:06','茶褐素具有良好的抗氧化活性，而六堡茶中茶褐素的含量高于其他茶类，因此六堡茶具有较好的保健作用。六堡茶为后发酵茶，前期研究表明，随着陈化年份的延长，其茶褐素含量越高。但各年份的茶褐素的抗氧化能力之间有何区别和变化规律，还不知晓，因此本项目拟对不同年份的六堡茶进行茶褐素的提取，并分别对所得茶褐素的对羟基自由基、亚硝基与超氧自由基的清除率的能力强弱进行比较，找到陈化年份对茶褐素抗氧化能力的规律，为选择合理的陈化时间提供理论依据。',0),(192,7,21,NULL,591,'远程控制智能CW系统  ',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 01:40:30','远程控制智能CW系统（即智能窗帘窗户系统 C：Curtain， W：Window）是基于单片机开发设计的。该系统是现代化生活的高质量需求而开发设计，使家用窗帘窗户实现自动化智能化。该系统通过光电传感器、湿度传感器，对室外光强度、空气湿度进行实时检测，并且把检测结果转换成电信号传给主控CPU进行计算处理，最后通过驱动窗户或窗帘电机硬件装式来进行打开或关闭，而且本系统还可以远程强制关闭或打窗户或窗帘。同时本系统还附带安装人体红外探测器，对在窗户边逗留的幼儿或动物及时发出警报提醒，多方面提升家居环境，安全和适宜度。',0),(193,3,57,NULL,738,'旅游发展下壮族布洛陀文化的保护、传承及发展研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 01:44:25','布洛陀作为国家级民间文学类非物质文化遗产，其主要包括布洛陀创造天地、造人、造万物、造土皇帝、造文字历书和造伦理道德的六个方面的内容，蕴含丰富的文化内涵。具有一定的旅游开发价值。旅游的发展给布洛陀文化的传承与发展带来机遇，也造成了一定的冲击。因此，本项目以“旅游发展下壮族布洛陀文化的保护、传承及发展研究”为研究目标，重点是关照壮族布洛陀文化在旅游发展下的传承与发展。从非物质文化遗产的属性出发，通过对壮族布洛陀文化及其旅游发展的现状进行剖析，理清旅游发展和壮族布洛陀文化遗产保护传承的联系。以实践考察为主要手段，深入广西百色市田阳县壮族布洛陀的圣地敢壮山。对当地的壮族布洛陀文化进行调查并结合当地旅游活动进行研究。本项目是为了把发展旅游业与发展壮族布洛陀文化紧密结合起来，进一步提升壮族布洛陀文化影响，丰富文化旅游内涵。',0),(194,5,49,NULL,515,'实力唱将张靓颖唱歌方法的探讨与实践',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 02:58:19','张靓颖作为华语乐坛的代表性人物， 研究她的唱歌方法与技巧，可以为高校的流行唱法教学提供非常好的教学模板。张靓颖的歌曲多是高难度的，比如她的海豚音许多的著名歌手也都做不到，她的气息，她的声音位置以及她的舞台表现都十分的出色。 而在我们日常学习流行音乐中，最多的方法是去模仿，并没有一个系统而明确的学习方法。我们的项目就是对张靓颖的唱歌技巧来对流行音乐进行进行探讨与实践，用以发展流行音乐的正确演唱方式，使更多音乐专业或者音乐业余爱好者更好的学习流行音乐。',0),(195,3,57,NULL,708,'旅游展演下壮族非物质文化遗产的保护、传承及发展研究——以广西平果嘹歌为例',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 02:00:32','广西平果嘹歌是壮族著名的长篇古歌，是壮族人民千百年来创造的优秀民族文化成果之一，是人与自然相互契合而产生的民族文化，传唱于壮族社会的生产生活中，表达了壮族人民对美好生活的理解和追求，在艺术、民俗学等领域具有重要的研究价值。作为国家级的非物质文化遗产，平果嘹歌作为重要的旅游吸引物，在广西的民族、文化及遗产旅游中发挥了重要作用。当前，旅游给非遗发展带来机遇的同时也带来了挑战。基于此，本项目从广西作为旅游大省的现实出发，基于旅游展演的视角，对平果嘹歌的发展现状、在旅游中的展演情况进行研究，探讨其旅游展演价值及旅游对其保护和传承的影响，最终探究旅游发展和非遗保护及传承之间的关系，以点带面，为广西壮族民歌及舞蹈类非遗保护、传承及发展提供一定的理论指导和实践借鉴。',0),(196,8,47,NULL,763,'东盟留学生汉语网络流行语使用情况的调查--以梧州学院为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 02:06:35','汉语网络流行语通过网络媒介对部分国内东盟留学生产生潜移默化的影响，使之无意识的使用着。基于这一现状，本项目从语言学和传播学的理论视角出发，选取梧州学院的42名在校东盟留学生作为研究对象，调查他们使用汉语网络流行语的词汇类型、语法类别、用频高低、应用广度和运用方式等的具体情况，总结内在的特点规律，进一步分析汉语网络流行语在非课堂教学中传播的原因、来源及其影响效果，希望对本校东盟留学生的汉语教学工作的发展提供帮助，为增加东盟留学生日常交际词汇量和激发出他们学习汉语的兴趣而贡献出绵薄之力，并进一步推动汉语在梧州学院东盟留学生中的传播。',0),(197,9,43,NULL,81,'留住城市的根与魂——“骑楼城”文化遗产保护中的公共管理行动逻辑',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 02:18:32','梧州骑楼城作为梧州特色历史建筑，岭南美食文化百川汇流之地，其历史性价值是无法估量的。保护骑楼城有利于保护梧州物质文化遗产及其隐藏的非物质文化遗产。有利于构建顺应城市发展的绿色、和谐骑楼，发挥骑楼蕴含的价值，带动经济、文化发展。用如今数字化的方式进行保护，能够更好的使其骑楼建筑保存下来，也同时能够助推旅游发展，提高经济水平,j践行公共管理理念，把骑楼城的建设突出到位，使其得到更好的保护。',0),(198,3,57,NULL,727,'旅游影响下侗族传统节日文化的保护、传承及发展研究——以广西三江侗族多耶节为例',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 02:32:21','广西三江侗族自治县，素有“百节之乡”的美誉，作为广西侗族人口最多的自治县，其在悠久的历史发展过程中,形成和创造了丰富的侗族文化，特别是其节日文化，多耶节就是在其传统节日基础上经过传承及发展起来的节日。随着民族旅游和节日旅游的发展，少数民族传统节日在民族旅游发展中发挥着日益重要的作用，对其进行研究，有一定的意义。因此，本项目从旅游对传统节日的影响出发，以广西三江侗族多耶节为研究对象，探究少数民族传统节日在旅游影响下的发展现状、旅游开发价值以及传统节日文化的保护及传承等，希望通过此研究为侗族传统节日文化的保护、传承及发展研究之路提供微薄之力。',0),(199,7,31,NULL,769,'基于Matlab的宝石建模的研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 02:47:17','本项目基于数学建模技术进行宝石建模的研究。人工宝石通常被加工成特殊的几何结构，在不同的加工技术下，会得到不同形状、大小的宝石，因此想要精准的去设计一颗宝石是很有难度的。Matlab数学建模技术作为当下信息技术的一个重要领域。本项目拟基于Matlab软件，提取宝石的特征，然后利用几何特征对宝石的曲线和结构的非线性问题进行求解，求取宝石图像的关键点参数。将Matlab的曲线导入SolidWorks 中，通过 SolidWorks 三维建模完成对宝石的结构整体设计，以提高宝石建模的效率和模型的准确性。基于 Matlab软件简化了设计过程，提高了设计精度和减少了计算误差，为宝石设计提供了理论依据。本项目的研究成果可以为人工宝石的设计和生产提供参考，有利于梧州人工宝石产业的提升和发展。',0),(200,3,60,NULL,648,'“第二大学”网站建设',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 02:48:37','为响应国家“双创”的号召，培养创新创业人才，我们团队决定创建“第二大学”网站，这是一个首先面向本校大学生服务的学习成长平台。我们秉承“面向校园，服务学生”的宗旨，将为本校大学生提供社会实践、企业实习、长短期兼职以及全方位社会化实践成长平台的这样一个堪称没有界限的“第二大学”。“第二大学”采取线上网站与线下实体相结合的模式，通过对口化专业实习、兼职岗位等形式来提高学生的实践能力，帮助学生积累工作经验，开拓社会视野，促进毕业后更好地就业、创业。',0),(201,7,31,NULL,772,'基于图像处理技术的火灾识别算法的研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 02:56:01','在各种灾害中，火灾是最经常，最普遍地威胁公众生命安全财产和社会发展的主要灾害之一。本项目拟借助Matlab软件开发一套视频火灾监控报警系统。利用视频监控系统进行实时视频图像监控，然后再利用Matlab软件提取烟火的特征，如烟雾、明火、面积变化等特性来设计火灾识别算法。视频火灾报警系统的产生能够提高对火灾探测的快速性、准确性和对环境的适应能力，有效降低火灾误报的概率，提高了灵敏度和整个系统的智能化程度。',0),(202,4,27,NULL,323,'小区自行车智能停车库',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 04:01:03','本项目研制的产品为一款针对城市小区而设计的多功能自行车智能立体车库，其结构上主要由如下三大部分组成：升降装置、横移装置、存取装置。为实现自行车的自动出库，将载车板与铝支架通过两个导轨连接做相对滑动。升降装置的传动装置为链传动，通过将每个车厢与链条固定，由一个电动机带动车厢两端的链轮，然后链轮带动链条，从而实现每个车厢的循环升降。横移装置由水平丝杆螺母传动装置和垂直丝杆螺母传动装置组成，由这两个装置共同完成自行车自动出入库的动作。',0),(203,6,32,NULL,494,' 基于单片机的烟雾报警系统',1,0,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 03:08:42','随着人们的生活变得更加智能化，电器使用越加频繁，消防工作就越加重要。\n为了减少和防止火灾带来的巨大损失，需要开发一种结构简单，经济适用的烟雾报警并配合完善的报警系统。\n   本报警器由最小系统、温度、烟雾传感器部分构成，加上其他设备可实现检测环境温度、烟雾等气体浓度并声光报警。本设计中选择单片机作为控制元件，由于需要探测范围广、高灵敏度和稳定性较好的元器件，故选择了MQ-2烟雾传感器。报警器主要由烟雾信号采集，烟雾报警器模拟-数字转换电路，微处理器控制电路，显示电路，声光报警电路和安全电路组成，设计合理，操作简单，性价比高。\n   烟雾报警器能够及时反映周围环境情况，发现温度烟雾异常能及时发出警报，从而降低火灾的危险性和减少各类损失。',1),(204,3,43,NULL,778,'朝阳100—O2O模式互联网家政平台',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 03:11:09','随着信息化时代的到来，人们的生活节奏越来越快。一些白领阶层、高薪阶层、双职工事业型阶层等很多人整日奔波于工作，根本无暇顾及自己的家庭生活。工作与生活的双重压力，家政服务的渴求量越来越大。\n两会期间，习总书记在会见山东代表团时称：家政行业是个朝阳行业。目前我国家政服务公司90%为中介形式，家政人员素质较低，专业水平不高，中介公司不能有效保证用户及员工双方的权益。导致市场混乱。互联网的快速发展，专业家政行业在线上的整合也是属于空白现象，加上国家政策的扶持，因此推出，“互联网+家政” 线上平台的资源整合。\n',0),(205,6,32,NULL,494,' 基于单片机的烟雾报警系统',1,0,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 03:13:35','随着人们的生活变得更加智能化，电器使用越加频繁，消防工作就越加重要。\n为了减少和防止火灾带来的巨大损失，需要开发一种结构简单，经济适用的烟雾报警并配合完善的报警系统。\n   本报警器由最小系统、温度、烟雾传感器部分构成，加上其他设备可实现检测环境温度、烟雾等气体浓度并声光报警。本设计中选择单片机作为控制元件，由于需要探测范围广、高灵敏度和稳定性较好的元器件，故选择了MQ-2烟雾传感器。报警器主要由烟雾信号采集，烟雾报警器模拟-数字转换电路，微处理器控制电路，显示电路，声光报警电路和安全电路组成，设计合理，操作简单，性价比高。\n   烟雾报警器能够及时反映周围环境情况，发现温度烟雾异常能及时发出警报，从而降低火灾的危险性和减少各类损失。\n',1),(206,6,32,NULL,494,' 基于单片机的烟雾报警系统',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 03:18:47','随着人们的生活变得更加智能化，电器使用越加频繁，消防工作就越加重要。\n为了减少和防止火灾带来的巨大损失，需要开发一种结构简单，经济适用的烟雾报警并配合完善的报警系统。\n   本报警器由最小系统、温度、烟雾传感器部分构成，加上其他设备可实现检测环境温度、烟雾等气体浓度并声光报警。本设计中选择单片机作为控制元件，由于需要探测范围广、高灵敏度和稳定性较好的元器件，故选择了MQ-2烟雾传感器。报警器主要由烟雾信号采集，烟雾报警器模拟-数字转换电路，微处理器控制电路，显示电路，声光报警电路和安全电路组成，设计合理，操作简单，性价比高。\n   烟雾报警器能够及时反映周围环境情况，发现温度烟雾异常能及时发出警报，从而降低火灾的危险性和减少各类损失。\n',0),(207,3,48,NULL,587,'梧州学院纸间时代·现代流动主题书店',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 03:28:13','指尖阅读的时代，渐渐多了一丝浮躁，快节奏的都市生活，红灯酒绿的人际交涉，容不下片刻的纸卷品读。心灵上的空虚让荒芜充斥了花园，曾经最喜爱的那本书也蒙了一层灰尘。人类最大的悲哀莫过于把一切从简。纸间时代主题书店以“运动”为主题，不拘泥与固定的场所，通过线上线下的互动交流，定期举行书籍展览会，书籍交易会，书籍交流会。并且投入一定数量的书籍到校园，完成书籍在学校的流转。以“书香遍校园”为宗旨打造现代流动主题书店。\n',0),(208,8,48,NULL,524,'乡村振兴背景下桂林彩调的传承研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 04:01:52','彩调是广西的地方剧种，源于桂林地区农村歌舞。已被纳入国家级非物质文化遗产。在振兴乡村大背景下，弘扬传统文化为其灵魂，繁荣乡村经济为振兴乡村首要目标。课题采用田野调查与文献考察相结合的方法着重梳理桂林彩调的生存现状，充分挖掘其特色文化内涵，并就彩调的传承发展中存在的问题进行调查。课题创新点：在振兴乡村的大背景下结合现代播手段研究桂林彩调的传承与发展并探索彩调文化在促进乡村经济发展中的价值。',0),(209,7,31,NULL,736,'智能防身报警器',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 04:17:40','本项目是基于STM32单片机为主控芯片设计的智能防身报警器，具有报警、防身、录音、照明等功能。报警部分可通过手动或语音打开报警开关，在被挟制状态下用语音识别触发报警器进行求救。报警器自动发送实时定位并电话通知紧急联系人，达到高效快速报警求救。防身器部分配置一键喷射辣椒水功能，在遇到危险时对付坏人。内置照明装置，可在暗处自动照明，如不需要可手动关闭。用USB充电续航，超长待机，耐用环保。本项目旨在保护人们的人身安全。',0),(210,8,48,NULL,486,'罗定岑溪存世碑铭文献搜集与整理',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-31 04:36:04','广东罗定与广西岑溪位于两广交界处，两地存世相当数量的碑刻，在西江流域纸质文献相对匮乏的情况下，碑刻是研究地域社会及民俗源头的重要材料,因此碑刻一直以来受到了广大学者们的关注，而散落在罗岑两地的碑刻鲜有人收集整理。所以本项目是对罗岑地区的碑刻开展深入调查，并用传统技法将碑铭制成拓片。此次田野调查范围遍布罗岑地区道观、寺庙、宗祠等二十余处古迹，基于调查结果，对当地碑刻保存及文献整理情况做出报告。',0),(211,9,43,NULL,788,'智慧养老--以梧州市大塘社区为例',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 04:36:09','本文以智慧养老作为思考的基点，以梧州市大塘社区作为研究分析的案例，探究智慧养老对城乡养老服务和模式带来的创新和发展。智慧养老利用各种信息技术或创新意念，集成城乡养老的组成系统和服务，实现智能、科学化的养老。在充分了解文献史料和既有研究成果，基于中国养老服务的现状，对当前传统机构养老、社区养老以及居家养老等模式的局限和不足，从而具体提出智慧养老的创新措施和发展实施到城乡方法的相关建议。希望通过研究智慧养老成果的展示能，从而不断整合和优化资源，达成良性循环，为智慧养老的推广和建立起到实质性的作用。',0),(212,3,52,NULL,542,'基于大学生文化自信的桂系岭南文化旅游传承与创新',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 04:43:10','该项目响应国家、学校号召树立大学生文化自信，在岭南文化传承方式、传承内容受到极大挑战以及“文化自信”理念提出的信息化背景下，针对广大群众采用新颖独特的低价旅游方式对在校大学生进行桂系岭南文化宣传。与此同时结合大学生课余时间多、相对集中，消费能力低的情况，设计符合需求的文化旅游产品。在项目开展过程中引入新的旅游拓展项目，在传统旅游方式得到创新。在增大吸引力的同时培养学生多项能力，并开展桂系岭南文化节日风俗活动，起到增强学生映像的作用。在服务模式上采用“一站式”服务，减少学生使用产品的前后期投入时间和精力。让学生可以充分的投入到对桂系岭南文化的体验当中。在整个活动中，无不渗透岭南文化气息，使学生饱受文化熏陶。同时，通过岭南文化进校园，采用“文化+旅游+校园”为主要形式的新业态整合岭南文化各个元素，塑造岭南文化新格局，增强大学生民族文化自信。使大学生真正的认识到岭南文化的意义，使其得到保护和延续',0),(213,3,56,NULL,608,'“大学梦，少年行”研学公益之旅',3,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 04:46:05','“‘大学梦，少年行’研学公益之旅”是一个立足于校园、结合国内外公益实践经验创设的公益创业项目。团队通过参与经营、管理“E茶空间”，提高自身的社会实践能力，同时旨在树立大学生感恩意识和爱心观念。我们通过经营“E茶空间”所获得的资金来作为爱心公益活动基金，来达到自身推广和回馈社会的目的和效果。 “大学梦，少年行”项目是一种公益与创业相结合的创新尝试，我们通过与梧州市区内小学合作，联合企业开展各种研学活动，让小学生走进大学校园，让他们感受大学校园的学习环境和人文氛围，亲身体验大学的生活，倾听大学生的理想，促使他们从小好好学习，树立远大的理想，引导他们养成良好的思想品德、树立正确的人生价值观。',0),(214,1,49,NULL,789,'西江流域民俗故事插画研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 04:57:19','随着时代的发展，科技的进步，由于人们对传统民间故事缺于保存与记载的理念，目前，现大多数年青人都缺少对西江流域传统文化的认知和了解，或许在老一辈口头上得知传统文化的由来，但因各种缘由对传统文化的精髓未形成真正的认知，对连接西江上下游居住的民众的情感连接线-龙母文化缺乏正确积极的认知。\n所以，本项目特以插画的方式， 描绘和解释传统民俗文化，着重点是龙母文化，让更多的人们了解和认知这一特色传统文化，宣传“无私、博爱、行善、积德”的龙母文化精神，共建社会主义和谐社会。\n',0),(215,9,32,NULL,748,'“鲜货”平台',3,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 05:27:49','该项目主要是通过，给果农和菜农，或者销售商提供一个与顾客沟通的平台。主要作用有以下几点：\n1.增加果农和菜农，或者销售商的销售路径提高销售量，或解决因找不到客户而卖不出或卖不好的情况。\n2.解决水果和蔬菜因滞销而引起的损失。\n3.同时可以像外卖一样，将郊区的农产品直接的送到客户的手中。保证蔬菜和水果的新鲜，满足人们足不出户就可以吃到新鲜蔬菜和水果的需求。\n4.便捷交易，尽可能的与支付宝，微信合作。',0),(216,2,60,NULL,683,'“3+1”创新教学模式在小学生全科课外辅导培训班中的应用',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 05:30:03','    此项目将开设小学生全科课外辅导培训班，所定对象为6-12学龄儿童，运用 “3+1”（语数英+艺术学科）创新型模式的教学方法，利用实物、图片、绘画、多媒体动画、舞蹈动作以及声乐帮助学生直观地理解和掌握知识，使娱乐与学习一体化，从而使学生在学习我们的课程中得到“德智美”综合发展。并专为英语零基础或刚接触英语初期的小学二、三年级学生设立英语学习专项班，此阶段学生的英语学习以兴趣培养为主，为其提供有趣的英语学习环境，使他们建立初步的学习英语的自信心，形成初步的英语语感，打好语音语调基础，为今后的英语学习打下基础。我们还将制作独特的学习代码和儿童记忆训练方法运用到教学中提高学生的记忆力与学习效率，并根据不同阶段的学生采取因材施教的方法，提供针对性的教学，发挥学生的长处，弥补学生的不足，教学过程采用“教”与“玩”的方式相结合，让学生在多种活动中体验学习的乐趣，以创新的教学模式突破传统的教学模式',0),(217,7,31,NULL,791,'网球比赛中运动员犯规动作智能识别',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 05:37:36','本项目基于MATLAB下的网球比赛中运动员出现犯规动作图像识别。随着全民健身运动的普及，网球这项运动逐渐出现在人们的日常生活中，而在网球比赛中，有些运动员在比赛中的犯规行为裁判员用肉眼无法看出来，需要运用图像识别的方式将运动员出现的犯规行为进行智能检测。本项目基于模式识别，首先通过视频拍摄对比赛状况的采样，即视频帧的提取，通过对运动员发球时某一时间点的图像分割，即检测出各个物体，并把它们的图像和其他景物分离；然后特征抽取，即对当时运动员的动作进行判别，通过特征值算法最终将犯规动作进行识别，从而达到即使没有裁判，也能使比赛公平公开进行的作用。',0),(218,8,48,NULL,756,'来华留学生语言学习跟踪调查——以梧州学院为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 06:02:55','文化是综合国力的主要方面,是国际竞争中备受关注的“软实力”。改革开放四十多年来,尤其是近十年来,全球汉语学习热潮持续增温。伴着这股热潮，越来越多的外国人来到中国学习汉语，调查留学生的学习汉语的情况并通过创新来实现中国文化的传播。该项目拟对梧州学院留学生学习汉语的实际情况进行跟踪调查，通过在课堂上观察留学生的反应和对留学生进行问卷调查的方式，以及老师的教学情况来获得听说读写、语音、语法、词汇效果的数据，分析留学生在学习汉语过程中存在的问题，对症下药，从而提高留学生学习汉语的兴趣，帮助他们更好的掌握汉语。',0),(219,8,47,NULL,773,'小榄白话语音与北流新圩白话语音对比研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 06:27:53','小榄白话和北流新圩白话分别属于广府片和勾漏片，以广州白话为代表的广府片粤语研究和以北流白话为代表的勾漏片粤语已有了较为深入的研究，但对小榄白话和新圩白话尚未进行深入研究。\n本课题将以小榄白话好北流新圩白话作为例子，概述两地的人文地理情况和语音状况，从研究小榄白话和北流新圩白话在声母、韵母、调值来对比分析两种语音系统，探讨两者语音之间形成差异的原因，更新两处的语料资源，保护两地白话资源。',0),(220,8,47,NULL,782,'梧州熟语研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 06:28:32','现今，在学术界关于熟语的研究已非常成熟。通过对文献的检索查阅发现，对梧州熟语的研究还是比较缺乏的。因此，本项目将梧州熟语作为研究对象，深入挖掘梧州熟语的音韵特点及修辞使用规律，并创新性地把研究内容拓展到对熟语意象的分析，从而探寻出州熟语的文化内涵。本项目将进一步更新梧州文化语言的研究现状，把人们口口相传的熟语以文本的形式表现出来，对梧州熟语起到一定的保护与传承作用。\n',0),(221,3,52,NULL,785,'校园解忧日杂店',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 06:53:05','“校园解忧日杂店”是顺应马云“新零售”的号召，注入了来自饿了么外卖带来的灵感。通过实时零售、团购代购、新产品推送、旧物代卖、上门拍电子照、信息代发、送货上门等服务让零售更加灵活，依托于电子商铺而提供线上线下服务。我们秉承着“质量至上、服务为第一”的宗旨，以便利全校师生为目的，经营学校师生的日常生活用品。并且我们在价格方面更有优势，同时免费提供送货上门等优质服务，让全校师生只需在手机上动动手指就能购买到物美价廉的优质商品，并且足不出户就能实时拿到商品。\n',0),(222,3,52,NULL,471,'大学生闲置品交换易购网络平台',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 06:40:22','“大学生闲置品交换易购网络平台”是一个关于大学生闲置品再次交易换购的平台。随着社会经济的发展和互联网时代的到来，大学生的消费能力日益增强。然而，一些东西被买回去后由于相对用处不大而闲置在寝室，还有一些有使用价值的物品被同学们随意丢弃，不仅造成了资源浪费，还加剧了环境污染。\n因此，大学校园里亟需建立一个便捷的交易平台帮助解决大学生的闲置物品，从而充分的利用有效资源，减少环境污染，增强同学们的环保意识。 \n',0),(223,6,21,NULL,319,'毕业设计自动归档及过程监管信息平台',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 07:02:54','毕业设计过程是大学生必须经历的过程，在毕业设计过程中传统的管理方式已不适应目前教学材料归档以及毕业设计过程监管的要求，因此有必要设计一套满足毕业设计管理规范和过程监管要求的毕业设计管理系统。本项目所设计的毕业设计管理平台，主要完成毕业设计的开题到答辩的过程进行信息化的管理， 极大地解决了学生信息归档，师生交流，学生盲目选题等问题。它最具特色的是双向选题、过程监控功能，有效地防止学生对毕业设计的蒙混过关，加强了对学生毕业设计的监控和管理，提高了学生毕业论文的质量及毕业设计这一过程的管理效率，促进教育公平和高校对人才的培养。同时极大程度上方便指导老师与学生的交流沟通，降低毕业设计数据信息的维护难度， 为提高学生的毕业论文质量提供了强有力的技术支持。',0),(224,7,31,NULL,707,'基于MATLAB的宝石成像高光去除方法',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 07:12:59','在宝石领域,对于如何检测和消除图像中的高光(specular)一直是个热点问题。人工宝石具有其强反射特性，在利用图像对宝石进行结构研究和检测应用时，出现成像后的宝石存在高光难以辨析的问题,使得我们在实验过程中无法观看到完整的宝石，同时这问题也直接影响着宝石的设计和宝石检测与挑选工作。本项目针对这个问题采用了基于MATLAB软件平台，用约束补色技术来去除宝石图像中的高光。宝石图像高光去除后，将使得成像后得到图片宝石结构更加完整，利于观察，为后续的结构研究和检测提供保障。',0),(225,1,49,NULL,681,'汉、瑶两族直领衣对比及民族服饰时尚化研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 07:30:56','直领衣是人类源流最为古老，流传最为久远的服装形制。东亚地区几乎所有的农耕民族均有设计直领衣的传统。作为东亚地区的典型农耕民族，瑶族与汉族的民族服饰均存在直领衣的形制。项目选取直领衣为研究对象，将汉服直领衣与两广地区瑶族服饰直领衣进行比较，总结其异同。突出中华文明多元一体的伟大内涵。在比较研究中，为民族服饰时尚化设计提供灵感与思路。',0),(226,3,57,NULL,696,'绣球缘',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 07:37:01','绣球乃广西壮家人之定情物和吉祥物，是广西极具特色的旅游工艺品之一，为了绣球文化更好地保护、发扬与传承，本项目将对绣球文化与绣球手工艺品、绣球制作方法进行调研与学习与宣传，在此基础上进行保护与传承。本项目主要通过对著名绣球产地靖西市——“绣球之乡”进行调研、走访的方式了解绣球文化和绣球手工艺品，通过阅读相关文献，结合实地调研走访对绣球文化进行研究，并通过网络、举办校园绣球文化展，开设制作绣球手工艺培训班，深入社区教小朋友制作绣球手工等形式进行绣球文化宣传，同时尝试通过微商销售绣球手工艺品结合线下销售绣球手工艺品，为绣球手工艺品探索更多的营销渠道。',0),(227,8,52,NULL,458,'梧州特色养生文化产业化研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 07:54:11','梧州既非常适宜于养生，又有丰富的极具特色的养生文化。\n1.梧州拥有“绿城水都”之称，气候宜人，环境优美，城市节奏偏向休闲慢节奏，是一个得天独厚的养生之处。\n2.同时，梧州在国家珠江—西江经济带发展规划和全国区域发展中具有重要的地位，拥有良好的区位优势。\n3.本项目在梧州精神指导下，利用东融战略和粤港澳大湾区建设机遇，将梧州区位优势与丰富文化资源优势相结合，通过“S＋T＋N”模式，即梧州特色美食养生核心产品＋体验式养生度假＋其它相关养生服务＝梧州特色健康养生文化产业模式。取美食养生产品和体验式休闲度假二者的核心部分，将梧州特色的健康养生文化产业化，以形成一张梧州特色的城市名片，带动梧州相关产业多元发展，助力城市竞争力全面发展。\n4.发展健康养生产业，非常符合梧州实际，体现梧州特色，并能充分利用梧州资源。',0),(228,4,27,NULL,253,'快递自动包装分类机',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 07:58:52','本项目是一个快递自动包装分类机器，它能够实现快递的快速自动包装和分类的功能，他的组成主要包括六个装置，分别是送纸箱装置、纸箱封底装置、物件传送装置、纸箱封顶装置、贴单装置、分类装置；他能够实现一条线的快递打包功能，应用范围比较广，大大提高了快递行业的包装工作，节省了很多的人力；而且我们的产品的制造成本比较低，市场潜力还是非常大的，后期我们还会对产品进行多方面的功能改善。',0),(229,3,43,NULL,563,'青峰行 校园旅行社',3,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-31 08:04:14','随着社会经济的发展，大学生的消费能力也有了提高，消费结构发生变化，越来越多的大学生会选择假期出游，但目前市场上缺乏专门针对大学生的旅游产品。为适应这一需求，计划成立大学生校园旅行社，旅行社由一群热爱旅行的大学生组成，目的是为大学生提供价格优惠、个性化、便捷的旅游服务。其中包括班级游、个性游、高校游、扶贫公益游四种；\n①班级游，策划组织班级出游活动，定制适合集体娱乐互动的旅游产品\n②个性游，针对有个性、爱自由不喜欢跟团的同学提供旅行路线定制服务。\n③高校游，高校旅游资源开发，组织高校游。\n④扶贫公益游，响应国家号召，开展扶贫旅游和公益旅游\n生态游，拥抱大自然，探索原始风光。',0),(230,1,49,NULL,297,'新型幼儿园及其周边公共设施改造设计',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-31 08:26:18','   随着时代的发展 ，国家对于幼儿的教育力度逐渐增大，不论是幼儿的教育体制还是教师待遇都有做出改变。据前瞻产业研究院发布的《中国学前教育行业市场前瞻与投资战略规划分析报告》统计数据显示，截止至全国共有幼儿园25.50万所，比上年增加1.51万所，增长6.31%。学前教育入园儿童1937.95万人，比上年增加15.87万人，增长0.83%；在园儿童4600.14万人，比上年增加186.28万人，整个幼儿园行业的市场成长空间巨大。\n  根据梧州市人们政府门户网站显示截至2018年末，梧州市户籍人口数347.5万人，比2017年末增加3.6万人，人口增长率高。而我国正处于计划生育新政策阶段开放二胎政策，根据最新一次人口普查的结果，中国生育率已经降到了1.18的低水平，远远低于欧美发达国家和东亚邻国。',0),(231,7,21,NULL,779,'微云农场',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 09:44:14','一个现代农业互联网+经营系统， 系统包括田间喷淋控制、远程视频监控、客户远程操作、公司经营管理等模块。拟实现功能如下：客户可在远端操控其承租的土地的喷淋和视频监控，可将个人意愿向公司传达；公司负责田间人工操作和其他商业服务，并提供科学种植的常识给客户。\n项目包括软件系统、硬件系统和商业运作三大部分组成，分两期完成。第一期完成软件系统和硬件系统；第二期开始与农村经营主体合作，开始对外经营业务。\n',0),(232,6,53,NULL,800,'新时代大学生党员教育管理的探索——以梧州学院为例',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 08:35:35','    2019年3月29日，中共中央政治局会议指出，加强党员教育管理是党的建设的基础性、根本性、经常性任务。作为我校学生党建中心负责人，我深知：我校一些学生支部在发展学生党员过程中存在对党务知识了解不足等问题；在党员后续教育以及党的组织生活开展等方面存在理论学习缺失、职责间歇性缺位、活动形式单一、创新性不足等问题。鉴于加强党员教育管理如此之重要，我们决定以中央文件为指导，以我校学生党建中心为依托，以学生党员的教育管理为抓手，以梧州学院学生党建为研究对象，以其他高校先进经验为基础，通过此项研究力争形成一套从新生党的启蒙教育、党员“1+1”全程跟踪到对入党积极分子、发展对象、预备党员、党员进行后续教育管理、重视对流动党员教育管理这样一个切实做到实处、学生党员乐于接受、防止形式化的党员教育管理系统对策。',0),(233,2,48,NULL,578,'创意趣英语启蒙',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 08:55:43','一般来说，少儿时期的孩子对生动有趣、能引起他们情绪反应的事物感兴趣，并很快能记住它们，但往往无法持久。著名语言学家Steven Pinker曾在著作《语言本能》中主张人类的语言并不是文化的产物,而是一种本能,就好像蜘蛛知道如何结网一样。这说明人生来具有语言习得的机制，少儿是能够在这时期发展二语习得的；此外，加拿大认知心理学家图尔文将长时记忆分为两类：1.情景记忆，是指人们根据时空关系对某个事件的记忆，这种记忆与个人的亲身经历分不开2.语义记忆，指人们对一般知识和规律的记忆，说明在提高少儿记忆力方面需创新地设计结合情景和语义的教学方式；另外，NLP发现人类和外界联系有三种基本方法（即人类的沟通模式）：visual视觉型、auditory听觉型、kinesthetic触觉型。所以本团队创办了少儿英语启蒙趣味教育方式项目致力于创新记忆方式，旨在加深孩子的记忆与理解和巩固知识，学以致用。',0),(234,3,43,NULL,563,'青峰行校园旅行社',3,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 08:57:12','随着社会经济的发展，大学生的消费能力也有了提高，消费结构发生变化，越来越多的大学生会选择假期出游，但目前市场上缺乏专门针对大学生的旅游产品。为适应这一需求，计划成立大学生校园旅行社，旅行社由一群热爱旅行的大学生组成，目的是为大学生提供价格优惠、个性化、便捷的旅游服务。其中包括班级游、个性游、高校游、扶贫公益游四种；\n①班级游，策划组织班级出游活动，定制适合集体娱乐互动的旅游产品\n②个性游，针对有个性、爱自由不喜欢跟团的同学提供旅行路线定制服务。\n③高校游，高校旅游资源开发，组织高校游。\n④扶贫公益游，响应国家号召，开展扶贫旅游和公益旅游\n生态游，拥抱大自然，探索原始风光。',0),(235,6,32,NULL,793,'大数据技术应用考研数据分析研究',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-31 09:34:45',' 本项目是以计算机专业学生为研究对象，利用大数据分析技术通过收集学生备考阶段相关数据，对收集的数据进行预处理，预处理过程包含数据清洗、数据规整化处理等，预处理后针对学生的备考数据构建相应的数据分析模型，分析高校学生备考、择校等的一些情况，找出当前存在的学生考研问题及可改善的地方,并提出有针对性的恰当可行的对策,为鼓励本科生考研、促进素质教育及高级人才的培养提供一定的参考依据。 ',0),(236,8,48,NULL,682,'新媒体背景下藤县舞狮文化的营销模式创新',3,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 09:30:47','藤县舞狮是梧州市的传统民俗文化活动，属于广东佛山流派的狮形和七星点。藤县有滕南龙、滕北狮之说。\n本项目主要研究藤县舞狮文化在新媒体平台上的传播模式及其经济效益。我们采用定性和定量的研究方法获得一手资料，了解其发展情况。通过短视频传播、社交媒体传播等方式让更多的人了解藤县舞狮，并通过互联网思维聚集用户，以短视频等形式开创藤县舞狮的新媒体营销渠道，在传播舞狮文化的同时赢得经济效益。',0),(237,3,49,NULL,804,'型影文化工作室',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 09:58:43','型影文化工作室是一家由大学生自主创办的主营文化宣传的工作室，立足于创新创业，以传播地区历史、地区文化、校园文化为主打方向，以拍摄写真集、毕业照、创作青年学生喜爱的、贴近青年生活的正能量短视频为主要业务和工作方向，同时推出各类广告创意和服务，承接常规广告产品等的制作，通过售卖摄影产品、广告产品和提供服务赚取收入。同时为大学生提供在校摄影实践和学习广告知识技术的平台。',0),(238,8,48,NULL,811,'广西三江侗族大歌传承的研究策略',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 10:19:19','随着人类现代化进程的逐步加快，三江侗族大歌正面临着前所未有的现代文化、外来文化和市场经济的全面冲击。现在更多的年轻人对流行音乐感兴趣，，侗族大歌正面临着后继无人、濒临失传的尴尬境地。保护和传承侗族大歌能对侗族地区的文化建设和构建和谐社会产生重要的推动作用。让三江侗族大歌的传承方式与文化旅游资源相结合，提高三江县侗族大歌知名度。',0),(239,6,32,NULL,793,'大数据技术应用考研数据分析研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 10:23:39','本项目是以计算机专业学生为研究对象，利用大数据分析技术通过收集学生备考阶段相关数据，对收集的数据进行预处理，预处理过程包含数据清洗、数据规整化处理等，预处理后针对学生的备考数据构建相应的数据分析模型，分析高校学生备考、择校等的一些情况，找出当前存在的学生考研问题及可改善的地方,并提出有针对性的恰当可行的对策,为鼓励本科生考研、促进素质教育及高级人才的培养提供一定的参考依据。 ',0),(240,1,49,NULL,810,'梧州社区养老空间现状调研及改造设计对策',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 10:34:29','目前，中国已经成为世界上老年人口最多的国家，据国家统计局最新数据，60周岁及以上人口24090万人，占总人口的17.3%，其中65周岁及以上人口15831万人，占总人口的11.4%。当一个国家或地区60岁以上老年人口占人口总数的10%，或65岁以上老年人口占人口总数的7%，即意味着这个国家或地区的人口处于老龄化社会。中国老年人口比例严重超标。根据梧州官方数据得知，到2015年为止梧州市的老年人口已经超过45万，而仅万秀区的老年人口就超过8万人，属于重度老龄化社会。而我市养老正处于发展阶段，室内尺寸设计不规范，专业、负责的老年护工和管理人才短缺，养老设施建设滞后等问题。因此本课题以梧州市社区养老为研究对象，通过对入住老年人进行现场访谈以及对社区养老的空间设计、色彩设计、家具设计、装饰材料、照明设计、人员配置、设施服务等进行现场观察，进而提出社区养老空间改造设计的对策，为社区养老空间提供参考。',0),(241,3,52,NULL,812,'校园二手交易直卖场所--以梧州学院为例',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 10:36:26','一、项目简介（200字左右）\n中国电动两轮车在2015年零售销量达到3398万辆，增速2.8%。并在未来5年以复合增长率5.3%的平稳增长。由此可见，人们对电动车的需求非常旺盛。\n各大高校的学生有80%是外省的，而他们为了在当地出行更加方便，大多选择进行购买电动两轮车出行。但是由于他们仅使用电动车3~4年就毕业，同时电动两轮车的使用寿命在6-8年。这就意味着许多学生需要转让他们的电动两轮车进行二手交易。\n因此我们决定以梧州学院为试点，组织一场以二手电动车为主，其他闲置物品为辅的二手交易场所。\n作为学习国际经济与贸易专业的在校学生，我们将做到学以致用，在创业中将理论运用到实践，在实践中不断提升。\n',0),(242,3,8,NULL,759,'梧州学院广西竹鼠研究所创办方案',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 10:42:38','目前中国人民食品安全问题比较严峻：国产肉食质量欠佳，仍需大量依赖进口；自2018年8月3日“非洲猪瘟”在我国首次确证，到现在还未能全面清瘟，难以短时期内消解；中小学生营养不良，身体抵抗力弱，一旦缺少肉食，易造成饮食不均衡，营养不良，导致身体抵抗力下降等问题。经过调查，竹鼠可以作为一种新的肉食替代来源破解上述难题。梧州学院竹鼠研究所的创办方案，拟采用非营利混合性事业机构的运营模式，以竹鼠的科学育种研究、商品产业链培育、政策咨询和科研项目申报为主业，依托梧州学院和梧州高新技术产业开发区及其企业，以实现我国竹鼠商品市场的平价销售。',0),(243,8,48,NULL,486,'罗定岑溪存世碑铭文献搜集与整理',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-31 10:46:03','广东罗定与广西岑溪位于两广交界处，两地存世相当数量的碑刻，在西江流域纸质文献相对匮乏的情况下，碑刻是研究地域社会及民俗源头的重要材料,因此碑刻一直以来受到了广大学者们的关注，而散落在罗岑两地的碑刻鲜有人收集整理。所以本项目针对两地碑刻存世的状况开展田野调查，并用传统技法将碑铭制成拓片。此次田野调查范围遍布罗岑地区道观、寺庙、宗祠等二十余处古迹，基于调查结果，对当地碑刻保存及文献整理情况做出报告。',0),(244,8,56,NULL,817,'新时代大学生党员党性锤炼机制探索--以梧州学院为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 10:57:13','        党员党性问题事关党组织的兴衰，党员党性锤炼是党的建设的重要部分，是思想建党的重要工作。大学生党员是大学生群体的先进分子，承担着民族复兴担任，是中国特色社会主义的建设者和接班人。重视大学生党员的党性修养培育，探索新时代大学生党性锤炼的长效机制，是提升新时代大学生党建工作的重要努力方向。\n本项目就是聚焦新时代大学生党员党性锤炼存在的突出问题，根据党中央有关党的建设有关部署，以习近平新时代中国特色社会主义思想为指导，结合实地调研分析，提出有关新时代大学生党员党性锤炼机制建立建议，为区内外大学生党员党性锤炼提供相关理论参考。\n',0),(245,3,43,NULL,813,'乐途——老乡一路同行',3,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 10:59:15','乐途——老乡车计划是立足于梧州学院，面向大学生服务的一个项目。项目主要内容就是通过我们已经有的桂林老乡群（线上线下），已经建立的特定人脉关系，根据节假旅游市场需求，定期与不定期展开的老乡同车共乘计划。项目的主要任务是服务于梧州学院的同学往返学校与桂林之间，节假日大家不用去抢火车票，通过我们团队联络与寻找有安全保障的大型长途客运公司，预订大巴、预定座位。项目实施过程中由我们团队与客运公司商议具体车辆、时间、上下车地点。此外，还为去桂林旅游的其他同学提供乘车服务，同时可为他们代购景点优惠门票及接送、食宿等服务。\n',0),(246,7,31,NULL,808,'_基于视频的车流量统计',1,0,NULL,0,0,0,NULL,NULL,NULL,NULL,NULL,'随着信息时代数字时代的到来已经社会的快速发展，道路交通拥堵已经成为不可忽视的问题，而根据交通监控统计出当前时间的车流量和车辆情况来实现交通调控，以此环节交通拥堵和减少交通概率的发生的智能系统也迫在眉睫。本项目根依次从（1）根据视频的目标提方法；（2）背景建模；（3）图像处理；（4）车流量算法（5）算法实现和总结。这五个步骤，在Vc6及MATLAB等软件的基础上进行实现和完成。',0),(247,6,32,NULL,816,'基于云计算和大数据的编程语言热度研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 04:32:00','基于云计算和大数据的编程语言热度研究，是以云计算和大数据技术为根基，分析当今世界上流行的编程语言，提供关于编程语言的丰富的可视化数据。数据可为编程语言热度的趋势提供可靠依据和发展预见，也使所得结果更加科学和有说服力。学一门流行的编程语言对于相关专业的大学生来说是极为重要的，根据大数据所得到的数据，我们可以准确的预见编程语言热度的发展趋势，为大学生程序员今后发展的道路作出正确的调整。还可以利用大数据对编程语言的热点技术进行分析，得出对于该门编程语言应用较多的技术，并由此搜索与该技术相关的练习。通过练习该相关技术，使大学生程序员的专业基础扎实，提高大学生程序员的就业率。',0),(248,8,48,NULL,486,'罗定岑溪存世碑铭文献搜集与整理',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 11:26:00','广东罗定与广西岑溪位于两广交界处，两地存世相当数量的碑刻，在西江流域纸质文献相对匮乏的情况下，碑刻是研究地域社会及民俗源头的重要材料,因此碑刻一直以来受到了广大学者们的关注，而散落在罗岑两地的碑刻鲜有人收集整理。所以本项目针对两地碑刻存世的状况开展田野调查，并用传统技法将碑铭制成拓片。此次田野调查范围遍布罗岑地区道观、寺庙、宗祠等二十余处古迹，基于调查结果，对当地碑刻保存及文献整理情况做出报告。\n',0),(249,3,52,NULL,770,'打印机项目',3,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 11:37:32','就我们观察，目前学校打印店价格高，而且拥挤，打印店数量有限，同学们对打印需求很大，为了减少学生在打印方面的经济负担，我们计划进行打印机创业项目，主要为在校大学生提供一个优惠的打印价格和便捷的服务，致力创造于一个更加高效的打印流程，在提高速度的同时降低价格，并且增加我们的实践能力，丰富我们的人生阅历。该项目的主打是便捷、优质、价低、诚信。',0),(250,3,43,NULL,677,'说茶道艺',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 11:58:07','茶在我们生活里如影随形，但是作为六堡茶爱好者的大学生，却不一定能有专门的空间能够说茶道艺，本项目以“E茶空间”为创业工作平台，通过和梧州市的六堡茶企业合作，与六堡茶学会合作定期举办品茶活动和六堡茶文化讲座，为六堡茶爱好者提供一个可学茶品茶的空间，帮助学生了解六堡茶和掌握茶道，起到传播茶文化，宣传六堡茶的作用。',0),(251,3,60,NULL,833,'校影校园短视频',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 12:12:35','自媒体经济快速发展，视频在传递信息方面比图文更具有吸引力。根据当前大学生需要，成立并运营校园短视频自媒体，为校园大学生及周边商铺提供以下服务：\n1．建立微信校园公用号，接受校园优秀作品投稿，分享校友动态，征集volg ，给同学一个平分享自己的生活，扩大交友圈。\n2．校园资讯推送，以短视频的形式，讲述校园故事，宣传校园文化。\n3.投放周边商铺广告与商家合作，也让在校同学以短视频的形式了解到学校周边商铺的服务。\n4.推送对学生学习有关的短视频，对学生喜欢的短视频类型进行挑选甄别',0),(252,3,60,NULL,799,'“互联网”下大学生思想政治教育实施途径',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 12:22:11','现大学生思想政治教育正面临严峻的挑战，也经历着由信息技术带来的各种手段转型，随之出现的就是指导理念不断拓展。本文在阐述大学生思想政治教育现状基础上，深入分析了“互联网+”下开展大学生思想政治教育正面临的挑战与机遇，并给出充分运用“互联网+”技术下开展大学生思想政治教育的路径，并提出具体关注点，以达到优化高校思想政治课程教育工作。',0),(253,2,60,NULL,683,'“3+1”创新教学模式在小学生全科课外辅导培训班中的应用',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 12:28:36','此项目将开设小学生全科课外辅导培训班，所定对象为6-12学龄儿童，运用 “3+1”（语数英+艺术学科）创新型模式的教学方法，利用实物、图片、绘画、多媒体动画、舞蹈动作以及声乐帮助学生直观地理解和掌握知识，使娱乐与学习一体化，从而使学生在学习我们的课程中得到“德智美”综合发展。并专为英语零基础或刚接触英语初期的小学二、三年级学生设立英语学习专项班，此阶段学生的英语学习以兴趣培养为主，为其提供有趣的英语学习环境，使他们建立初步的学习英语的自信心，形成初步的英语语感，打好语音语调基础，为今后的英语学习打下基础。我们还将制作独特的学习代码和儿童记忆训练方法运用到教学中提高学生的记忆力与学习效率，并根据不同阶段的学生采取因材施教的方法，提供针对性的教学，发挥学生的长处，弥补学生的不足，教学过程采用“教”与“玩”的方式相结合，让学生在多种活动中体验学习的乐趣，以创新的教学模式突破传统的教学模式',0),(254,8,57,NULL,712,'凌云县庆丰节民俗活动研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 12:39:52','本项目基于凌云县庆丰节，以“浑水摸鱼”、“水上抢头鸭”、“打啵啰”等民俗活动为研究对象，旨在理清凌云县庆丰节民俗活动的历史来源、活动过程、活动方式及其蕴含的人情世故及宗教信仰等，深入挖掘其所蕴含的地方文化特色与其所蕴含的文化精神和现实意义，并为之撰写论文，为继承与保护凌云县庆丰节民俗活动尽绵薄之力。此外，本项目还将在凌云县庆丰节民俗活动原有特色基础上，融入当地更多的特色内涵，从而赋予当地庆丰节民俗活动新的生命力。',0),(255,1,49,NULL,835,'梧州地区传统民居建筑研究与数字化表现',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 12:49:05','随着城镇化的发展和人民生活水平的提高，传统民居建筑已经无法适应与满足人们对空间品质的需求，而更新式的修绪对于传统民居建筑本来的面貌带来了破坏。城市化以及新农村建设与发展无可避免地对传统民居建筑造成巨大的影响，如果对传统民居建筑不加保护和研究，就会加速传统民居建筑的消亡。\n本课题以梧州地区传统民居建筑为研究对象，通过对梧州地区传统民居建筑文化背景、地域文化特征以及传统民居建筑的发展历史等进行研究，挖掘传统民居建筑的意义与价值，同时探索传统民居建筑在现代设计语境中的传承与发展途径，为梧州地区传统民居建筑的保护与更新设计提供设计参考。\n',0),(256,7,4,NULL,720,'室内湿度自动监控调节系统',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 12:49:29','我国南方大多地区气候潮湿多雨，俗称“回南天”，室内潮湿，墙面渗水，室内湿气太重,导致室内的家具物品类有发霉现象，人们生活在潮湿环境下，更容易引发风湿、关节炎及湿疹等皮肤病。因此本项目为了解决此问题，设计一款能解决潮湿室内的自动监控湿度调节系统装置。本装置设有监控湿度、加热、抽湿等装置。当在潮湿多雨天气，，该装置能起到快速调节室内湿度的作用，能室内保持干燥整洁清爽，以防潮湿使人滑到、室内物品发霉变味、防止患有皮肤病等效果。故该装置可解决南方人在潮湿多雨的天气时调节室内湿度。',0),(257,1,49,NULL,840,'乡村旅游背景下泗州村公共设施改造设计',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 12:53:02','随着乡村旅游的发展，乡村形象建设越来越受到人们的重视，其中公共设施是乡村建设中重要的显性部分。本课题以梧州泗洲岛公共设施为研究对象，通过对泗洲岛文化背景、地域文化特征以及泗洲岛建筑的发展历史等进行研究，提取典型文化元素作为泗洲岛公共设施设计的统一视觉形象语言，由此形成泗洲岛公共设施的系统设计，为梧州泗洲岛公共设施的改造与更新设计提供设计参考。',0),(258,13,56,NULL,830,'对如何提升老年人幸福感的多样化研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 12:54:49','幸福感是一种心理体验，它既是对生活的客观条件和所处状态的一种事实判断，又是对于生活的主观意义和满足程度的一种价值判断。它表现为在生活满意度基础上产生的一种积极心理体验。而幸福感指数，就是衡量这种感受具体程度的主观指标数值。本项目根据现阶段我国人口老龄化不断提升的前提条件，做出对如何提升现段老人幸福感多样化的研究。随着生活水平的不断提升，人们对生活幸福指数也在不断提高，尤其是老人对于幸福指数也是不断有所提升，在老龄化不断提升的现在，越来越多老龄人口面临如何养老如何让自己不孤单不寂寞，不担心家庭等现实性问题而忧虑，这些现实性问题让得老人的幸福感降低。尤其是在农村地区的空巢老人、独生子女家庭的老人和经济不发达地区的老人，相对于基本幸福指数有所不同，所以如何提升老人幸福感的多样化研究是本项目的核心关键问题。\n\n',0),(259,5,60,NULL,478,'蓝天儿童书画培训机构',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:14:38','蓝天儿童书画培训机构以“兴趣第一,快乐为本”的教学理念,将采用实地直营，网络营销，线下纸媒，派单推广等营销模式，提高培训机构知名度，更好的服务儿童。主要面向3-12岁的儿童，其中课程开设有中国画、水彩画、水粉画、素描画、简笔画、蜡笔画、毛笔字、钢笔字课程。特色课程有“野外写生”，“书法兴趣小组”。授课方式采用“集体教学，一对一指导”。通过不同层次的美术、书法学习,培养孩子的艺术素养。在实际教学中,尊重每个孩子自身的发展特点,充分挖掘孩子各方面的潜力,努力帮助每个孩子建立自己独特的闪光点,增强自信心，促进儿童的身心和谐健康发展。',0),(260,6,32,NULL,672,'基于云计算架构的网络教学平台的设计与实现',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 12:57:54','基于云计算的网络教学平台是充分利用现有的高校所建立的开放课程平台，并在此基础上，创造一个以学习者为中心的实时互动网络教学平台，利用现有的云计算技术实现在任何时候通过任何途径与任何地点的任何人的实现互动学习社区。该平台的目标是为高校进行学分课程教学、公共必修课教学、毕业后教学、职业技能培训等类型的教学，提供一个开放互动，资源云服务的平台，供注册学习者从校内校外进行云服务方式的互动教学，其容量目标是可以供一个综合性大学的注册学习者和教师使用。可以容纳20000个注册用户浏览，1000人同时在线。',0),(261,1,49,NULL,647,'文化传播视阈下梧州六堡茶户外广告设计研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 13:15:26','户外广告是人们最直观接触的广告媒体形态，对当代中国城市形象产生了空前而广泛的影响。这种宣传方式不仅能增加品牌记忆度，还有利于产品的经济发展和文化发展。用户外广告来推广具有千年历史的六堡茶文化，其产生的文化效应值得人们去深思推广。\n     六堡茶通过户外广告的形式综合岭南文化的梧州骑楼、粤曲、青花民窑、西关风情、茶楼文化、广府文化等元素,发掘出独具特色六堡茶艺程式,提升到六堡茶道的高度，让更多的人们能感受到六堡茶文化的魅力。',0),(262,3,52,NULL,506,'名牌化妆品新零售模式运营店',3,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 13:20:05','随着人们生活水平的不断提高，人们对于自身的投资也尤为重视。众所周知，爱美之心，人皆有之。所以，人们对于化妆品、护肤品、彩妆的需求市场非常庞大。为了利用这个庞大的市场需求，我们团队主要经营化妆品、护肤品、彩妆、洗护用品。我们团队经营的最大优势就是我们有能力与这些公司直接对接，我们在为消费者服务时，我们能够保证产品正品质量而且价格低于专柜价。而且随着互联网的普及、物流体系的完善，网络购物相较于其他购物模式而言优点突出，日益成为一种非常重要的购物方式。然而在巨大的网络交易额之下，产品的质量问题成了网络购物中不容忽视的问题，买家的消费权益得不到保障。为了解决这一问题我们将采取线上线下的经营模式来为消费者服务。我们采取新零售运营模式这样我们可以充分利用资源、节约成本，最大优惠的为消费者带来福利。',0),(263,10,57,NULL,845,'文化强国战略下广西巴马传统庙会研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 13:20:26','本项目通过对巴马特色传统庙会的研究，通过实地走访，查阅文献等方式，发掘弘扬民族文化，振兴庙会文化，使非物质遗产文化焕发新的青春和生命力，将传统文化融入到现代文明中，让更多的人了解传统庙会文化，吸引大量民众参与文化传承，感受传统庙会的魅力，让传统庙会文化得以更好传承，使更多的新一代年轻人接触传统庙会，为传统庙会的传承注入新鲜血液。同时结合巴马当地的特色，将庙会活动与其他传统文化相融合，创新其活动形式，扩大其活动空间，在发展中继承，在继承中发展。',0),(264,4,62,NULL,469,'广西竹鼠市场化开拓方案',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 13:20:20','竹鼠的市场前景十分广阔，具有丰富的营养价值、经济价值和药用价值。竹鼠还能带动深加工产业，衍生出一系列加工产品，可以推动我国第三产业的发展。但是目前我国竹鼠的生产量远远不能满足市场急剧增长的需要；竹鼠肉食商品价格较高，广西的地缘资源优势、养殖优势无法得到发挥。我们准备探索广西竹鼠市场化开拓路径：从竹鼠养殖场、竹鼠冷链运输、竹鼠餐厅经营三大块内容入手，研究产业链开拓方案；争取实现竹鼠商品的科学化、合作化、政策化、市场化目标；缓解我国人民食品安全面临的严峻形势。',0),(265,1,49,NULL,844,'猫·斋创意生活馆方案设计',1,0,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 13:21:59','近年来，随着物质生活水平的逐步提高，精神生活也越来越受到人们的重视。人们希望在物质条件充盈的同时，心理得到更多的爱与关怀；而饲养猫咪则是时下许多人让心理得到满足的一种选择，越来越多的人将猫作为家庭中的重要一员对待。因此也催生出社会上的各种猫咖，让人们体验与猫相处的感觉的商铺。大多数的猫咖普遍以休闲娱乐为主，猫只是充当商铺组成的一小部分；而以猫为核心主题的店铺则比较少，且在店铺功能组成上并不全面。为了提升猫和人的互动关系，普及科学养猫的相关知识，我们计划在梧州市设计一个以猫为主题的创意生活馆，旨在创造一个具有特色的生态空间，使猫与人，人与人，人与环境三重关系得到进一步的改善与提升。\n\n',1),(266,8,57,NULL,847,'广西宾阳炮龙节——非物质文化遗产的传承与保护',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 13:31:56','传统节日及民俗节庆文化是一项重大的民族文化遗产，它承载着丰厚的历史文化内涵。而如今随着全球化进程的加快，中国社会正面临着从传统农业社会向现代工业社会的转型，作为民族文化重要载体的传统节日，它的未来发展命运越来越受到人们的关注，如何传承与保护我国传统节日及民俗文化，是社会许多研究学者一直不断探索研究的课题.\n',0),(267,1,37,NULL,638,'乡土民宿改造设计策略研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 13:33:09','乡土民宿设计同质化严重，地域特色缺失，制约了民宿的良性发展。本项目通过实地调研，文献查考等方法，针对目前民宿发展现状及存在的问题，提出乡土民宿设计遵循地域文化特色的原则，用现代的设计理念和手法重新解读和再现传统空间，给游客带来历史传统体验和新的感受。其意义不仅在于给游客提供一个体验乡土人情和传统文化的场所，更在于它给传统聚落和民居提供了一种长足有效的可持续发展模式。民宿空间更新策略，即为生活而设计，为文化而设计，为人性化而设计，目的在于为乡土民宿室内设计提供设计方向。',0),(268,8,48,NULL,796,'广西地方戏剧调查研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 13:40:59','国务院办公厅印发有关加强戏曲保护与传承政策，实施地方戏曲振兴工程，并将此纳入十三五规划中。广西是少数民族聚居地区，地方戏作为特定地域历史形成的文化意向，具有重要的历史文化价值和当代社会价值。广西有数量大、种类繁多的具有少数民族特色的地方戏剧。本项目将以广西壮族自治区为例，以广西地方戏剧作为研究对象，深入研究和探索广西地区所有的地方戏剧的起源、特色以及传承、价值等，并进行汇集整合出相应的理论成果，为保护、传承和繁荣广西地区民族戏剧文化作出贡献。',0),(269,7,31,NULL,802,'智能酒驾安防系统的设计研发',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 13:41:52','针对目前酒后驾车危害性日趋严重，而交警手持式呼气检测设备又不能方便、全面的检测预防酒驾，设计了一款基于单片机和手机的智能车载防酒驾系统。该系统采用单片机开发连接酒精传感器、语音报警器、汽车制动系统、语音传输等硬件设备，酒精传感器检测车内空气酒精浓度超标后，系统发出声光报警器并禁止汽车发动，同时通过GPS模块进行车辆定位，并配备有救援服务系统及汽车防撞系统，使酒驾信息得到及时传播及处理，该系统具有简单、灵敏、安全等特点，可以有效监测酒后驾车行为，保护行车安全。',0),(270,7,28,NULL,838,'双滚筒气力循环式多功能花生脱壳机设计研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:03:13','随着种植业的不断发展，手工脱壳已无法满足高效生产的要求，为满足高效生产的要求，本项目旨在设计一款双滚筒气力循环刮板式多功能花生脱壳机，主要由电动机、喂料斗、一次脱壳装置、振动筛、风机、二次脱壳装置等组成。花生自入料斗进入脱壳室，受到一次脱壳滚筒刮板的打击、摩擦与揉搓，花生壳与花生仁分离，通过凹板筛，到达振动筛，并且在风力的作用下花生壳被吹出机器外，在振动筛与风机气流共同作用下，花生仁被输送到集仁口内，未脱壳的花生则经过未脱花生回收斗进入气力输送风筒，在送料风机气流的作用下被输送到二次脱壳滚筒内再次脱壳，重复一次脱壳过程，从而提高了花生脱净率与脱壳效率，降低花生仁破碎率和损失率。同时该脱壳机还可通过更换主要部件实现对其他带壳物料的脱壳加工，使脱壳机更具通用性 。',0),(271,7,31,NULL,58,'智能家居机器人',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 13:48:58','随着生活水平的提高，宠物、室内盆栽植物市场发展迅猛，但是后期的护理却十分繁琐。本项目是以STM32单片机为核心的家居辅助机器人。本设备可以通过智能分析后为宠物投食以及清扫宠物粪便；也可以为室内盆栽或者室外的各类植物进行浇水以及施肥；当室内存在火灾可能时，它将警报信息发送至手机端，可以预防火灾等灾害的发生，且具备自动无线充电功能，是一款全自动多功能辅助机器人，可以实现长期无人化自动管理。',0),(272,3,52,NULL,656,'旧“拾光”——旧书回收共享',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 13:46:51','旧‘拾’光--旧书回收共享”校园创业项目主要围绕目前大学生以高价购买教辅资料、教科书，经过使用之后当废品低价变卖这一普遍现象为核心，提出“节约环保、变废为宝”的理念，以2-4折的低价收购这些用后闲置的一次性教科书和教辅资料，以及一些流行消费读物，将闲置废旧书籍“变活”，循环再用，既避免学习资源浪费，也节约后期学者的学习成本支出。本项目以校园为市场，通过社交软件如“微信公众号”建立小程序或者网页进行旧书租赁、出售、共享等服务，同时鼓励DIY手工制作，将废旧书籍变废为宝。此外，不定期开展一些阅读、分享活动，提供以质优价廉的公益服务，以此带动“热爱阅读、自觉学习”潮流，让书香文化得以广为传承。\n',0),(273,8,58,NULL,641,'新时代梧州下俚歌的传承和创新',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:01:01','在珠江流域西江水系干流的浔江河段，有一个世外桃源般的小岛——泗化洲，当地人称泗州岛。岛上居民世代流传一种用本土语言演唱的山歌，因为每句唱词以“俚”或“下俚”拟声词结束而得名“下俚歌”。随着时代变迁，下俚歌濒临失传。    \n本项目旨在对梧州民间歌谣——下俚歌进行深入的田野调查和史料研究，整理出下俚歌宝贵的文化遗产和传承情况，梳理出下俚歌文化的独特基因，并依据此对下俚歌的发展和传承提出相应的实施措施和建议，同时也为当地政府保护和发展下俚歌文化、支持泗化洲发展提供可操作性的建议。\n',0),(274,3,52,NULL,643,'克莉萨私房披萨',3,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:00:47','本项目是基于食品服务行业的一个小型创业项目，以口味和品牌特色服务来迎合年轻人的兴趣趋势，并加以附加产品的带入，基于对梧州市人口比例及相关行业竞争对手的观察和研究，我认为该项目可塑性很强。私房披萨主要是以外卖的形式对本店披萨进行售卖，纯手工制作，售卖对象多以年轻人，宝妈，情侣为主。',0),(275,6,2,NULL,852,'梧州学院毕业生就业地区数据分析可视化',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:04:06','本项目主要使用Tableau数据可视化工具，通过地图上标注的就业地区名称，显示我校近五年的毕业生就业地区分布情况，帮助上级领导分析毕业生去向；通过按专业统计近5年的就业率，了解我校毕业生就业情况，以及通过专业对口就业率统计，快速直观看到毕业生就业方向是否与本专业对口，对专业统计近5年的本地就业率，了解毕业生在选择就业地区上有多少留在了本地。\n本项目通过移动互联网和数据可视化技术，使上层领导更直观、快速了解毕业生就业地区情况，节约人力对就业地区进行分析，体现了“大数据”的强大作用。',0),(276,6,32,NULL,262,'全景相机vr仿真教学软件',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:09:36','由于普通学校教学资源匮乏，摄影设备不足，教师的现场示范无法满足众多学生同时观察的需求。因此，教学效果一般。如何让学生快速了解全景相机的构造，理解全景摄影技术中的难点，从而提升教学质量，是目前亟需解决的问题。\n全景相机vr仿真教学软件通过交互式、沉浸式的教学形式应用到高校教学过程中，学生可以使用该系统反复练习，教学效率更好，同时避免了摄影过程中的安全隐患，提升了教学质量。',0),(277,6,32,NULL,87,'虚拟现实宣传动画制作与推广',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-31 14:16:24','如今虚拟现实技术越来越成熟，在军事、航空、教育、娱乐、工业设计、医学等方面也是较为广泛的应用到，VR技术就是其中技术之一。该项目通过以二维动画的形式为大家呈现VR技术，该项目是以爱丽丝梦游仙境的故事中获得的灵感，虚拟与现实之间的相互转换，这与VR技术相似。该以动画的方式向大家呈现VR技术，让更多的人了解VR技术，现如今的社会发展VR技术运用越来越广泛，也越来越常见，可以说是一种发展趋势，我们的项目就是面对大众，以动画的形式去展现VR技术，使人们通俗的了解VR技术，以及VR技术能给我们呈现的世界。',0),(278,8,58,NULL,641,'新媒体时代梧州下俚歌的传承和创新',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:21:07','在珠江流域西江水系干流的浔江河段，有一个世外桃源般的小岛——泗化洲，当地人称泗州岛。岛上居民世代流传一种用本土语言演唱的山歌，因为每句唱词以“俚”或“下俚”拟声词结束而得名“下俚歌”。随着时代变迁，下俚歌濒临失传。    \n本项目旨在对梧州民间歌谣——下俚歌进行深入的田野调查和史料研究，整理出下俚歌宝贵的文化遗产和传承情况，梳理出下俚歌文化的独特基因，并依据此对下俚歌的发展和传承提出相应的实施措施和建议，同时也为当地政府保护和发展下俚歌文化、支持泗化洲发展提供可操作性的建议。\n',0),(279,6,32,NULL,174,'晨希计划教育',3,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:26:46','随着国家政策的发展，2020年我国将实现全面脱贫。与未脱贫前相比，脱贫后我们可以享有更多的资源，例如:互联网的普及，多媒体设备进入校园等等。\n微课可以给刚脱贫的地区带来更好的教育，不仅仅是对学生，对老师也是一样的，我们可以对乡村教师培训、互联网式的教学交流。通过微课，我们可以让老师得到最新的教育信息，让学生得到多元化，高质量的教育。所以面对这种现状，我们团队致力于开发一款基于“互联网+微课”的模式去做此项计划，重点解决刚脱贫地区的教育问题。\n',0),(280,2,57,NULL,849,'边疆地区少数民族文化调查研究——以壮族“那文化”为例',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:28:42','民族文化是维系民族生存和发展的精神纽带。壮族是中国少数民族中占比例最多的一个民族。壮族有历史悠久、丰富的本民族文化，其中的“那文化”是壮族文化中的一个典型代表。“那文化”是一种以农耕文明为主要内容的少数民族文化。深入研究壮族的“那文化”，有助于增进人们对于边疆少数民族文化的理解，有助于对边疆少数民族文化的保护，有助于促进少数民族的文化发展和繁荣。本项目将以广西的壮族“那文化”为例，以“那文化”的起源、发展和传承作为研究对象，深入的研究和探索“那文化”的内容、形式和特点，以及其对壮族和壮族人民的重要作用与影响。',0),(281,9,9,NULL,829,'大学生对心理咨询的态度及其心理求助行为调查研究——以广西部分高校为例',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:32:19','习近平总书记在2016年全国卫生与健康大会上提出，要做好心理健康知识和心理疾病科普工作，规范发展心理治疗、心理咨询等心理健康服务。心理咨询是大学生心理健康教育的重要途径。大学生对心理咨询的认识态度，是心理咨询研究的重要内容之一，只有充分地认识和把握心理咨询对象 的心理行为特点，尤其是对心理咨询的态度和行为趋向，才能提高心理咨询的针对性和有效性。目前，部分大学生对自身心理健康状况的主观感受是认为自己的心理不够健康，他们需要调整与改善。大多数大学生虽然对心理咨询持有积极肯定的态度与认识，但在寻求心理咨询的行为上却是消极的、回避的，“知”与“行”相互矛盾；对大学生进行普及性的心理健康教育是必要的。本研究旨在通过问卷调查和个案访谈等途径了解当代大学生对心理咨询的态度及其心理求助行为状况，为今后高校心理健康教育特别是心理咨询工作提供一些参考依据。\n',0),(282,6,49,NULL,858,'中国岭南文化研究工作室',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:36:14','近年来，文化艺术产业在我国得到重视并有很大的发展空间，我们工作室以推崇对岭南文化为目的，对岭南地区文化进行挖掘与研究，传承岭南文化的精髓，创新式的以微电影等形式进行传播。让人民群众感受和体验到岭南文化的独特之处，并对岭南文化产生一种全新的认知。本项目主要在平面设计，短视频两个主要方面发展。平面设计是基础业务，主要承接校园内各社团和校外一些广告宣传单的设计。',0),(283,1,49,NULL,481,'包装设计视觉艺术中的“无即是有”——以 梧州六堡茶包装设计为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:37:56','包装设计是一门综合运用自然科学和美学知识，为更好的保护商品，并促进商品的销售而开设的专业学科。“无即是有”，表达了对待生活的态度，是一种具有精微细致又博大从容文化气象的造物观念。通过视觉要素的提炼，将整洁的包装呈现在消费者面前，在极简中呈现自然。\n通过调研、资料搜集、设计与分析等全面分析研究，结合包装设计的相关知识和梧州历史文化，为其后的发展奠定坚实的基础，创造出具有梧州文化特色的包装设计。',0),(284,8,48,NULL,751,'梧州地区民间信仰的变迁与现状调研',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:41:34','本项目的研究选址为具有“百年商埠”之称的广西梧州，以本地区的民间信仰文化、演变过程和现状为研究对象，以时间轴为线索，对每个阶段的宗教与民间信仰的思想、派别、团体、活动及影响等进行全面的系统的阐述，吸取并采纳前人研究成果中的精髓之处。在此基础上我们将更深入的调查梧州地区民间信仰对人民生活的影响，更新现有的信息资料。能更好地了解梧州地区的风俗民情、开创梧州特色文化品牌，促进梧州文化事业的发展。同时，为编撰梧州地方志提供更丰富的材料和最新数据。',0),(285,2,53,NULL,855,'双语毛概的形式与影响',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:47:05','目前，《毛泽东思想和中国特色社会主义理论体系概论》（以下简称毛概）作为各大高校的公共必修课，且学分高达6.0，历来以传统教学模式的讲授，使学生的积极性并不高，强行灌输的方式并没有使学生深入了解这方面知识。就这一状况，马克思学院吴昊副教授提出“毛概双语教学模式”且与团队付出大量心血，在我校外国语学院等具有一定英语基础的学生开展此课程作为实验班，并亲自编写了以“英文为主，中文为辅”的双语毛概教材，进而深入探索该课程对老师、学生、学校的影响。\n',0),(286,6,32,NULL,859,'VR农业教学辅助系统',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:48:50','本项目响应国家教育部政策--“到2022年，打造2万门金课”，主要针对农业教学存在的教学质量问题，，创立一个VR农业教学辅助系统，利用虚拟仿真技术还原实验场景，模拟仿真的操作，例如种植中的挖土、播种、浇水，枝剪等操作，让用户通过佩戴vr设备就可进入仿真的实验场地，如茶园、菜地等，进行实践与学习，激发学生的学习兴趣和积极性，提升教学质量，同时也解决传统农业教学中受时令限制、农产品生长状况限制和实践管理难度高导致的消耗时间长、教学质量不佳、练习损耗高的问题。',0),(287,6,32,NULL,216,'旅迹工作室',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:50:33','旅迹工作室为满足用户在古建筑旅游方面的需要，可以制定旅游攻略，普及有关古建筑的知识和注意事项，对很多珍贵的已经不能够参观或拍照的古建筑，制作出虚拟复原的古建筑；对于一些年久失修和其他一些规模小或未开发旅游的古迹，创造出VR体验和景观漫游动画，实现其旅游价值；同时也会推出一些文创产品，对古建筑进行宣传；旅迹工作室收集的古建筑信息也可以为古建筑的研究提供参考，进而更好地推动对古建筑的宣传、保护和传承。',0),(288,8,58,NULL,860,'梧州学院博物馆的宣传与推介',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:53:25','广西梧州学院博物馆“宝石文化博物馆”和“西江商贸文化博物馆”正在马不停蹄地建设中，开馆时间将近，博物馆的宣传与推介成为了梧州学院官方眼前较为紧迫的任务。为了更好地发挥梧州学院博物馆的学习教育以及文化传播等作用，我们将通过对地方博物馆及其他高校博物馆宣传与推介的成功案例的分析，来思考广西梧州学院博物馆的宣传与推介；通过对传统的宣传方式以及网络新媒体的新型宣传方式进行对比分析，以此为根据来为梧州学院博物馆的宣传与推介制定方案。',0),(289,8,57,NULL,796,'广西地方戏剧调查研究',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:55:21','国务院办公厅印发有关加强戏曲保护与传承政策，实施地方戏曲振兴工程，并将此纳入十三五规划中。广西是少数民族聚居地区，地方戏作为特定地域历史形成的文化意向，具有重要的历史文化价值和当代社会价值。广西有数量大、种类繁多的具有少数民族特色的地方戏剧。本项目将以广西壮族自治区为例，以广西地方戏剧作为研究对象，深入研究和探索广西地区所有的地方戏剧的起源、特色以及传承、价值等，并进行汇集整合出相应的理论成果，为保护、传承和繁荣广西地区民族戏剧文化作出贡献。',0),(290,1,49,NULL,864,'主题空间创意设计',1,2,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-31 14:58:16','随着社会的发展，人们对商业的要求层次也越来越高，主题空间设计是吸引消费者的一种重要营销手段。目前我国正处于改革开放后商业发展的第三次高峰，商业面临着千载难逢的发展机遇。本项目将从我国主题餐饮行业的现状进行分析，分析其中存在的一些问题，从客观角度探讨主题餐饮空间设计的理念和原则，从多个角度对主题餐饮空间室内的研究。设计出一个运用各地域饮食文化到主题空间的具体方案。',0),(291,5,60,NULL,444,'围也纳',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 14:59:42','我们都知道，一个国家的环境是很重要的，现在人们的生活水平逐渐走向高层次发展。却忽略了基本的环保意识，但是作为中国人应继承我们的传统美德。\n经过我对市场上的调查发现，大多数的年轻人购物都是喜欢使用一次性的购物袋，这不仅会影响到我们的身体健康，还会对环境造成严重的污染。虽然市场上也有一些环保购物袋，但是没有一物多用，也没有将环保袋美化。因为现在的广大消费者都是喜欢独特新颖，手工环保袋，比机器制作而言更加精致审材料，所以我们的项目主要是通过传统的手工刺绣——＂围也纳＂（围裙与环保袋相结合）。我们在围裙的平面，通过手工刺绣添加一些中国民族的特色元素使围裙更加美观，在围裙的两边加上拉链，然后在拉链的各一端有一半笑脸，如果去购物时，把拉链拉上，两边的笑脸就就合成了一个笑脸，这就意味着你的环保意识在逐步增强。而美丽的民族图案则出现在环保袋的表面，这就是\"围也纳\"环保袋。',0),(292,8,48,NULL,639,'返屋企文化传播工作室',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:00:24','基于当今我国民俗文化和优秀传统文化的传播和发展不太乐观，希望以自身之力推动传统文化的传扬，由此成立返屋企文化传播工作室。工作室将通过开创公众号、拍摄微视频、微电影的线上渠道进行宣传，自办或承办政府、企业等相关文化活动，包装设计文化产品通过线下零售以及线上周边淘宝店进行售卖，实现盈利的同时，扩大对梧州当地文化和优秀传统文化的推广和创新，以喜闻乐见的方式，让民俗文化和优秀传统文化与当代新思维、新元素相结合，焕发出新的活力，让更多人熟知我们的优秀传统文化，增加其自身的民族归属感，提高民族文化自信心。',0),(293,3,57,NULL,809,'“互联网+”背景下少数民族文化传播新模式探究——以梧州学院为例',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:02:27','民族文化是中华民族的瑰宝之一，在我国艺术文化乃至世界艺术殿堂中占据重要的地位，在这个快节奏的社会中，互联网的快速发展极大地改变了生产、生活和思维认知模式，也给民族文化宣传工作带来了新机遇，创新民族文化宣传工作模式。当代大学生很难有机会去了解优秀文化，我们通过一系列创新性的“互联网+”产品让民族文化打破地域的限制，以“互联网+”思维模式来推动民族宣传工作，让深厚的历史不再沉睡于博物馆的橱窗中',0),(294,1,49,NULL,733,'金属编织在首饰中的运用',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:03:04','\n编织是人类最古老的手工艺之一，在人类的文化史上没有一种文化样式像编织艺术这样源远流长。它的历史甚超过了绘画和文字。金属编织首饰形式多样包括项链、项圈、手镯、戒指、耳环、鼻环、头饰等等。编织也因为与其他金工技术不同的独特表现方式而被艺术家所青睐。\n',0),(295,6,32,NULL,820,'基于单片机智能花盆',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:03:52','\n      目前，物联网智能家居的发展，生活日益智能化，市面上缺缺少一款智能化的花盆。在花盆中安装传感器，以此来获取花盆中的湿度、酸碱度、光线强度等信息，并将获取到的数据传输到计算机中进行相应分析和处理，根据处理结果来决定是否智能浇水，遮光等处理。当客户出差或忘记家中植物时，智能花盆可以自行解决刮风、日晒、缺水等一系列问题。从而达到解放客户双手，为客户服务的目的。',0),(296,6,32,NULL,87,'虚拟现实技术推广平台',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:11:54','如今虚拟现实技术越来越成熟，在军事、航空、教育、娱乐、工业设计、医学等方面也是较为广泛的应用到，VR技术就是其中技术之一。该项目通过以二维动画的形式为大家呈现VR技术，从爱丽丝梦游仙境的故事的中获得的灵感，虚拟与现实之间的相互转换。以动画的方式向大家呈现VR技术，让更多的人了解VR技术，现如今的社会发展VR技术运用越来越广泛，也越来越常见，可以说是一种发展趋势，我们的项目就是面对大众，以动画的形式去展现VR技术，使人们通俗的了解VR技术，感受VR技术带来的世界。',0),(297,3,43,NULL,510,'速跑联盟',3,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:14:04','在互联网+高度发展的高校，生活中方方面面的事情可以通过互联网的优化，来提高学习生活效率。这也是大学里外卖等懒人经济发展不错的原因。但是，W校在办理相关手续等工作，却是十分低效。因此，创建一个校园便利服务公司，提高高校师生生活工作效率是非常有必要的。',0),(298,9,43,NULL,625,'吾梦文化工作室',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-31 15:18:24','本项目立足自身专业，通过开办半公益性质企业“吾梦文化工作室”与筹建专业社团“公共管理学会”相结合，通过以社团培养优秀企业人才，以企业促进社团发展的模式开展社团活动与企业经营。社团主要活动为小组社会调研、公共管理案例大赛等，鼓励专业学生撰写调研报告并撰写相关论文，工作室主要经营范围为梧州乃至广西的社会科学类学术研究提供相关文献资料、数据的收集、获取与整理，期刊发表等服务和社会科学类专业学生的考研究生、公务员方面的培训辅导服务。\n',0),(299,3,52,NULL,831,'高校连锁美妆店',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:20:52','以全区（全国）高校为主，在高校内或附近开设以女生为主要消费者的美妆店。美妆店主要以美甲、美瞳、修眉为主，同时也销售面膜、洗面奶、以及一些精美的小饰品等。同时在网上开设预约到店和送货上门的服务，这样就可以避免消费者到店排队而浪费没有必要的时间。',0),(300,8,57,NULL,865,'梧州六堡茶文化发展历程的调查研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:25:02','        清同治十三年版《苍梧县志》载：“茶产多贤乡六堡，味醇隔宿而不变，茶色香味俱佳。”通过“茶船古道”，梧州六堡茶每年大量出口东南亚和港澳台地区，成为海上丝绸之路的重要商品之一。\n       从古代多贤乡六堡茶到流传至今的“茶船古道”，梧州的茶文化历史究竟经历了怎样的发展？本调项目将围绕此问题，结合国家深化“一带一路”倡议，以六堡茶文化历史进程为切入点，进行系统详细的调查研究，达到推广和科普的作用。',0),(301,8,58,NULL,631,'梧州符号微影像志',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:27:48','梧州符号微影像志是通过对梧州本地的文化、饮食、社会人文等特有的符号进行查阅、采集、整合分类、拍摄及后期加工，形成一系列关于梧州符号的微视频。将收集到的梧州符号资料整理成一本《梧州符号》的书籍，并将制作好的每一个微视频二维码放入书中，使读者在阅读梧州符号文章的同时，能够看到相关的微视频。梧州符号的收集整理出书在当今还每曾有人实施，倘若最终的成果《梧州符号》一书能够完成，将对梧州当地特色符号传播、文化传播等有着重要的意义，对记录梧州的发展变迁有着深远的价值。',0),(302,7,60,NULL,867,'智伴科技（梧州市智伴体验中心）',3,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 09:54:13','梧州市智伴体验中心成立于2018年11月，是唯一一家集体验、销售、售后于一体的智能机器人体验中心。智伴体验中心依托成熟的广州智伴人工智能科技有限公司、梧州市理想科技有限公司的支持下，致力于发展为儿童成长机器人行业的领导者。通过大学生具有的教育理念与AIED相结合，以城市化转移到农村，采用地毯式轰炸的全方位销售手段，以新社交电商模式为基石线上线下相结合，借助人工智能机器人促进自适应学习环境的发展。',0),(303,8,58,NULL,875,'广西梧州长坪瑶寨文化体验AR/VR馆创业计划书',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:34:11','蒙山县长坪瑶族乡六坪村地处山地，至今仍保留了原汁原味的瑶族特色，且是梧州第一个入选中国传统村落的村寨。通过实地拍摄记录村里独具地域特色的“坡屋顶、黄墙、木窗棂”瑶族风貌和传统文化上保留的瑶族婚嫁习俗、瑶话山歌、瑶医草药、盘王舞等多项省级非物质文化遗产，体验馆结合新媒体技术AR/VR展示保存和传播梧州的优秀传统文化。更便捷促进深厚的民族文化底蕴在民众们之间传播，促进梧州当地的旅游业发展，民族文化融合发展。',0),(304,4,41,NULL,724,'大学生废弃物再造计划',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:32:41','随着生产生活的进步和发展，大学生可利用的生活物品逐渐增多。当这些物品因为某些因素被淘汰时就会转变为废弃物。如破旧的衣物、用坏的热水壶、废弃的快递包装等，学生往往会选择直接丢弃。因此，“大学生废弃物再造计划”应运而生。\n为此“大学生废弃物再造计划”的目的就是通过这一平台，以“收——改——宣”的模式来体现这个项目对生产生活的实际意义，同时达到宣传环保意识和增强大学生废弃物利用以及环保的意识的目的。并且项目的过程可以增强大学生的创新能力和实际操作能力。\n该项目对未来的可持续发展的实施与完善具有重大的意义。\n',0),(305,6,32,NULL,853,'海洋资源信息可视化短片的制作',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:33:10','目前，海洋对我国政治、经济、安全等方面具有重大的意义。但是，大多数人还缺乏比较强烈的海洋意识和活跃的海洋进取精神，我们的项目就是做一个以信息可视化形式呈现出来的海洋资源。我们把海洋资源的信息做成短视频动画展现出来，联系我们的生活，展示海洋在我国的重要地位，通过短视频动画的形式展示给大家，让大家更了解海洋对我们的重要性，响应习近平总书记海洋强国的政策。',0),(306,1,49,NULL,870,'3D打印在首饰中的运用',1,2,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-31 15:35:05','此项目主要是利用珠宝3D打印和现代时尚潮流设计，在设计的过程中我们采用了电脑软件辅助绘图，JEWEL-CAD.Rhino等等，为了配合数字化生产，在工艺上我们也采用了3D打印服务是对电脑辅助设计向下一步的延续。现如今3D打印能在不同行业中表现出无限潜力，因此很多发达国家早已将目光投向3D打印技术。3D打印在珠宝首饰设计邻域的研究在全世界范围内同样属于初级阶段。在初级应用阶段我们已经发现了3D打印在生产订制产品过程中的优势。随着这项技术的逐步成熟更多的优势会显现出来。把本专业的精英人才带动起来，并通过不断的实践达成良好的协作能力，提高学生与社会人士的沟通能力，提前为毕业创业的学生打下牢固的基础。',0),(307,8,56,NULL,869,'非省会地方高校图书馆资源建设现状调查——以广西壮族自治区为例',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-31 15:37:15','当前，我国正大力推广提升青年学子自身文化底蕴，建设文化强国。针对我校图书馆借阅量较少的情况，特意将本校图书馆资源开发与广西区内其他二本院校资源开发经验相结合借鉴，例如硬件软件资源方面，为我校图书馆建设提供具有当下实际意义、可操作的建议。\n从当前资源利用和资源开发为主方向，结合现场采访、个别交谈、亲临实践、图片、照片、书报刊物、统计报表、文件、问卷等多个信息收集渠道，深入调研图书馆与我校师生的关联，发掘最可行方案，进一步开拓我校青年学子的知识面和文学视野，让图书馆走进校园生活，从而构建书香梧院，在提升我校文化软实力的同时，也将成为我校建设为“梧州大学”的奠基之一。',0),(308,3,52,NULL,837,'梧州市大学生“双创”活动困境与对策',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:40:26','随着国家创新驱动战略的实施，我国经济发展已经进入新常态，机遇与挑战并存，社会的发展对创新型人才的需求与日俱增。作为祖国未来建设的主力军，大学生的创新能力与国家的政治，经济，文化，社会等息息相关。在大众创业，万众创新的国家战略背景下，高校大学生掀起了自主创业浪潮，在校大学生积极创业，不仅能够解决自身的就业问题，还能够提供更多的就业岗位，解决更多大学生的就业问题。本项目的目的在于为梧州大学生在创业中存在的问题提供解决的途径。\n',0),(309,1,49,NULL,733,'金属编织在首饰制作中的应用与实践',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:41:50','编织是人类最古老的手工艺之一，在人类的文化史上没有一种文化样式像编织艺术这样源远流长，它的历史甚至超过了绘画和文字。金属编织首饰形式多样包括项链、项圈、手镯、戒指、耳环、鼻环、头饰等等，编织也因为与其他金工技术不同的独特表现方式而被艺术家所青睐。',0),(310,8,48,NULL,874,'自媒体时代下梧州古建筑微信公众号运营研究',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:42:56','  梧州古建筑是一个时代的政治、经济、文化和建筑产业发展状况的缩影。梧州古建筑作为我国目前特有的历史文化遗产，研究梧州古建筑不仅能作为日后的重要历史记载，而且梧州古建筑本身蕴含的文化价值能够促进梧州的地方文化发展。\n    现如今我们已进入自媒体时代，应利用自媒体形式来传播梧州古建筑文化，本项目采取互联网与自媒体相结合的方式，创立梧州古建筑微信公众号，通过在网上查阅书籍文献了解梧州古建筑的历史文化，采访权威人士和当地居民作为素材拍摄宣传短片，进行实地取景拍摄图片、纪录片，撰写推文的方式；通过政府与个人相结合的方式，互联网+自媒体的形式，将梧州古建筑文化鲜明地呈现眼前，创立网络形象塑造的微信公众号，增强国人文化自信，宣传推广梧州古建筑文化。',0),(311,6,32,NULL,138,'宣传地方特色传统节日的动画短片制作',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:54:25','传统节日的形成，是一个民族或国家的历史文化长期积淀凝聚的过程。传统节日已是人尽皆知，但是地方特色传统文化却没有得到很好地推广，那些艳丽的服饰、柔美的舞姿、新奇的节日活动鲜为人知。本项目主要是将地方特色传统节日的特色制作成动画短片，为其搭建一个舞台展示地方特色传统节日本身的魅力，让人们看到各个地方的特色传统节日的风俗，感受充满中华文化的节日乐趣，弘扬中华民族的优秀传统文化。',0),(312,6,32,NULL,161,'海趣科普动画',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:47:57','党的十八大提出建设海洋强国的战略目标，党的十九大报告进一步提出“坚持陆海统筹，加快建设海洋强国”的战略部署。为了响应党的号召，作为新一代社会主义接班人，我们也尽自己的一份微薄之力让更多的人来增强海洋意识。我们将出一系列关于海洋知识类的科普动画，该项目是利用风格简约活泼有趣的二维图形MG动画的形式。围绕“海洋给我们带来了什么”这一主题进行制作。在“海趣”项目中，我们会将海洋知识与我国海洋发展结合，更观着更深层次的了解我我国海洋的发展，让观者对美丽海洋、洁净沙滩、蓝色海岸不一样的认识，同时唤起观者对海洋知识的探索。',0),(313,8,57,NULL,876,'西江流域民族融合历程调查研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:49:47','本课题通过相关资料与信息对西江流域民族融合的历史进程进行研究，侧重于之前较少人研究的领域深入调查，补上关于西江流域民族融合的短板。\n本课题主要内容为探寻西江流域内壮、汉、苗、瑶、侗等多个民族由分散到聚集、由少到多、由地方到中心，在这个过程中这些民族的语言、习俗在日常沟通中相互影响、逐渐融合。论文通过举例少数民族经济、政治、文化习俗的变化来说明民族融合的重要性和必然性，同时也侧重于文化习俗方面的研究，去探寻民族融合对文化的重大影响作用。\n',0),(314,1,34,NULL,880,'侗族民俗旅游产品项目',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:50:12','侗族的银饰饱含着众多的侗族元素，并逐步形成了侗族文化的一个重要组成部分。银，与侗族生活息息相关，不仅仅作为单纯的首饰佩戴，同时也是试毒、杀菌功效最好的金属。如今，传统文化越来越深入人心，少数民族的文化及其工艺品更是受到人们的青睐。结合我省侗族银文化，传承至今仍选择传统的手工打造工艺，其打造的侗族银饰品实用，独具侗族元素，具有广大的消费市场。本项目将沿用传统侗族的文化精粹与现代审美相结合，致力于打造出平价、实用、独具文化寓意的银饰及其衍生产品。同时我校具有成熟的珠宝首饰技术与宝石资源，在利用自身专业知识进行产品的设计研发及特色的工艺加工的同时，结合线上线下的策划营销进行产品的推广，做到民族工艺传承与时代审美融合。',0),(315,6,60,NULL,775,'-媒体融合视角下易班平台育人功能发掘研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:53:31','易班是我国高校大学生教育教学、生活服务、文化娱乐的综合性互动社区，也是新时代我国网络思想政治工作的重要平台和阵地，是构建“十大育人体系”的“网络育人”的重要抓手。\n本项目积极贯彻全国思想政治工作精神、全国教育大会精神、全国宣传思想工作会议讲话，把易班的育人工作置于在媒体融合的视角下开展研究，贯彻“因事而化因时而进因实而新”理念，聚焦当前易班网络思想政治工作的困境，提出化解当前易班在大学生思想政治教育困境的对策，提升易班网络育人实效，提升我区网络思想政治教育的质量。',0),(316,6,32,NULL,754,'基于PX4多轴飞行器返航系统的设计',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:54:08','多轴飞行器又称多旋翼飞行器，小型的多轴飞行器可以自由地实现悬停和空间中的自由移动，具有很大的灵活性。此外，因为它结构简单，机械稳定性好，所以成本低廉、性价比很高。主要的应用是航模、航空监测以及航拍，新的应用也在不断的拓展之中。就目前而言，自动控制技术的发展对于多轴飞行器的普及有着至关重要的作用。\n本项目主要研究多轴飞行器的自动返航技术、自主规避技术以及环境监测技术，并结合团队自身实际，深入研究多轴飞行器安全性与稳定性问题以减少安全事件发生率。\n',0),(317,8,58,NULL,627,'六堡茶文化推广工作室',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 15:59:23','    关于成立六堡茶文化推广工作室：我们团队为响应学院鼓励大学生创新创业，充分发挥自身专业特色优势，营造浓厚的六堡茶文化氛围，搭建艺术平台为学院师生以及梧州市民提供充分的、系统的作品交流与展示，探索通过影集作品的商业运作模式，打造线上线下绿色推广通道，使六堡茶文化不仅具有历史传承价值而且富有生动的艺术性，讲究文化韵味和视觉美化的特殊艺术类型并且具有一定的市场价值的民俗文化类产品。\n    目前，团队已经拥有比较稳定的师资和运作人员，团队将致力于参考历史文献、市场调查以及了解相关运营策略，借助影集作品推动六堡茶以及茶文化发展，使之成为通往现代更高生活品质的桥梁。',0),(318,3,29,NULL,710,'梧州学院电动车校园闪充服务',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 16:01:34','我校在校大学生大多数都拥有电动车，且使用次数频繁，但学校只有少量充电桩，充电桩充电速度慢，充电十分困难。为此我们针对这个问题,将与云易充、学校合作，利用云易充平台的技术，学校的场地和支持，在学校推广一批快速充电桩，建设快速充电站，解决电动车没电时的困扰，解决学生私拉电线，不规范充电带来的隐患，为梧院师生提供最方便、快捷的电动车快充服务',0),(319,1,49,NULL,878,'地域文化在室内设计中的运用',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 16:02:24','每个地区和民族都有自己特定的传统地域文化，这一地域文化是在特定的自然环境和人文环境中相互包容、相互借鉴并且经过长期积累才最终形成，有着极强的生命力和传承性，在现代室内设计中要对传统和现代兼容并蓄。地域文化在室内设计个性化方面起着重要作用，本项目将把地域文化的魅力在室内设计作品中大量融入传统的、有地方特色的和民族特色的设计元素，创造大量出色的的空间。对室内外环境的相互融合，对室内环境的适应性改造。',0),(320,8,58,NULL,632,'西江民间故事搜集与传播',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 16:09:10','民间故事是一个地区文化和历史的集中体现，就其蕴含的这一地区的风俗、及历史和对旅游文化产业的开发而言，搜集、传播民间故事是有文化保护意义的，同时也能扩大地区影响力，提高知名度。西江是珠江的主干道，自古就有“黄金水道”之称。对西江流域民间故事进行搜集和整理，不仅能抢救民间口头文化遗产、传承文化基因，故事本身的艺术价值和教育价值还能为当今社会的精神文明建设服务。\n本项目在搜集、整理西江流域民间故事的基础上，还将借助新媒体开展传统民间故事的传播实践；运用数字技术、网络技术推广西江文化，为记住乡愁、讲好中国故事增添助力。\n',0),(321,3,43,NULL,548,'踏两广山水，扬岭南文化',3,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 16:17:55','\n这是一个利用网络直播平台宣传独特岭南文化的项目。包括梧州本地白话、广西壮话、客家话等精品课程，又有壮乡三月三等对山歌、享山水的特色课程。此外，我们还会定期定点的街拍，给大家带来精彩的文化故事。我们的课程有专业的教授指导，开设问答区解决同学们的疑惑。我们怀着赤诚之心欢迎大家加入，同时希望大家学有所成，促进自身不断成长。\n',0),(322,8,58,NULL,642,'西江民俗文化坊',2,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-03-31 16:23:39','在这个项目中，我们将把西江深厚的历史底蕴与文化积淀融入我们未来的产品设计之中，通过线下展览活动、线上淘宝微淘微信等平台展示与出售文创产品等形式为观众架起一座沟通文化的桥梁、奉上一场文化盛宴。我们的产品面向梧州市甚至全国范围内的人民，让人们通过展览体验活动与购买我们的文创产品直接触摸到西江文化，亲身感受到西江文化的魅力。我们希望大众能够通过我们的产品学习西江文化、通过文化引发思考、通过思考获取精神升华，同时提升西江文化的知名度，并且推动西江地区旅游产业发展。',0),(323,8,58,NULL,881,'梧州视觉文化工作室',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 16:26:56','梧州视觉文化工作室是面向广大青年人的一个视觉研究平台，基于图片和视频、文字处理，将梧州多元素文化（如老城魅力、民俗文化、校园文化等等）整理编辑后传播。通过微信公众号、微博、抖音等平台发布，力求寻找一个让年轻人更容易接受优秀文化的传播方式来多途径传播文化。同时还可以兼拍大学生写真、毕业照、工作照等，打造传播文化、追求时尚、热爱创意、热爱生活的服务理念和态度。',0),(324,3,48,NULL,806,'校园趣味之—非物质文化遗产快板传书创新创业研究项目',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 16:30:14','此项目积极响应国家主席习近平所倡导的弘扬中国文化与非物质遗产传承的策略，秉承“保护、传承、创新”的理念。以国家非物质文化遗产—天津快板为依托，将传统教育与快板曲艺结合，形成新颖的教育手段。创新教育模式，并通过部分收费服务，达到一定的盈利目标。运用快板传诵书本知识，以其娱乐性，幽默性等特点，提高学生娱乐性与好奇心，使在校大学生能潜移默化地学习知识和传承快板文化。并且将快板传输与互联网＋、自媒体结合。快板文化扎根校园，进而推广到社会，最终打造一条弘扬快板文化的有效途径。',0),(325,6,32,NULL,687,'蔚澜——科教海洋游戏的研究与开发',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 16:36:10','在国家推进“海洋强国”建设目标的背景下，我们团队着手研发基于虚幻4引擎的科教海洋游戏的研究与开发，基于游戏中模拟现实能力这一点，玩家通过玩我们团队研发的游戏，能在游戏任务中收获有关海洋的一定知识，寓教于乐，呼吁大家保护海洋生物，提高海洋资源开发能力，发展海洋经济，保护海洋生态环境。',0),(326,3,43,NULL,705,'梧州学院校园共享便利店',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 16:36:09','随着共享经济的发展，共享的观念也越来越深入人心，而共享便利店就是采用这种理念来改善大学生的校园生活\n大学生受生活费限制，购买能力较差，而且在校时间较短，不值得花费大量的金钱改善生活条件，而共享便利店就是针对这一现状，向大学生提供电动车、小家电、雨伞、洗衣机、图书、辅导资料等共享租赁服务，从而使得大学生以较低的购买能力获得高水平、高质量的校园生活条件',0),(327,8,58,NULL,881,'梧州视觉文化工作室',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 16:46:16','梧州视觉文化工作室是面向广大青年人的一个视觉研究平台，基于图片和视频、文字处理，将梧州多元素文化（如老城魅力、民俗文化、校园文化等等）整理编辑后传播。通过微信公众号、微博、抖音等平台发布，力求寻找一个让年轻人更容易接受优秀文化的传播方式来多途径传播文化。同时还可以兼拍大学生写真、毕业照、工作照等，打造传播文化、追求时尚、热爱创意、热爱生活的服务理念和态度。',0),(328,8,57,NULL,559,'非省会地级市旅游景区的现状与发展研究-以梧州市为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 16:51:58','梧州市是一座历史悠久的城市，其历史文化底蕴深，本项目主要是对梧州市旅游景区的现状与发展进行研究，我们在研究过程在发现旅游景区还存在一些问题并根据这些问题提出了解决措施，希望通过本项目能得到相关部门的重视，更好地开发这些旅游景区的非文化遗产。深挖其历史内涵，有利于中华历史文化的继承和发展，提高知名度，让更多人知道梧州这座城市，然后吸引更多人来旅游也可以更好发展旅游业，旅游业也可以带动相关产业的发展，这样有利于促进本市经济的发展，所以我们认为对梧州市旅游景区的开发与发展的研究很有价值。',0),(329,8,58,NULL,892,'民俗景观VI设计探索与实践',3,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 18:30:45','优秀民俗文化一直是中华民族的瑰宝，也是城乡建设、经济生产的一类重要文化资本。随着我国文旅产业的不断发展，近年来涌现了一大批民俗特色小镇、古村落、民俗风情园、民俗节庆等等以民俗文化展示和体验为主要功能的民俗景观。如何打造民俗景观并开展有效宣传，实现文化价值和商业价值的双赢，也就成了一个需要解决的问题。\n本项目将对国内一些知名的民俗景观进行实地探索与调研，了解其宣传推广过程中的成功经验与不足之处，特别是在视觉传达方面的效果，在此基础上总结和探索民俗景观VI（Visual Identity, 视觉识别系统）设计的理论、方法与技巧，并且进一步结合地方文化保护与旅游产业的需要开展设计实践，为当地的民俗景观设计出独属于他们的品牌形象和纪念产品等，本项目也是以此获得盈利。',0),(330,6,32,NULL,725,'东融背景下梧州市软件业发展状况与对策',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 19:17:17','梧州的软件企业多是自发行为，规模小、散、乱，这是制约梧州软件业规模化发展的重要瓶颈。本项目主要从市场准入壁垒、关键技术壁垒、科学项目管理壁垒、人才队伍壁垒、品牌壁垒等角度出发，展开调研，分析其上游关系与下游关系、有利因素和不利因素，从而寻找东融背景下梧州软件业发展的有效路径，为梧州软件产业进一步发展、为软件产业在东融战略中更好地发挥作用提供相关对策。',0),(331,7,31,NULL,883,'基于图像技术的硬币金额统计算法',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-03-31 23:33:11','硬币在生活中无处不在，比如公交公司、银行在日常运营中经常要面临硬币金额的统计，传统的统计方法存在效率低，结果不精确等问题，本项目则通过可实现智能统计硬币金额，减少人力资源，提高工作效率和计算的精确度。\n本系统主要基于数字图像技术，利用霍夫曼变换方法，识别平铺在某个限定区域内硬币（面值为1角、5角以及1元）个数与总额。系统主要使用vc++与opencv库、由usb摄像头完成图像采集。随后，根据不同面值硬币半径、颜色不同这一显著特征，计算所采集图像中的硬币数量，并区分出硬币的面值大小，最后统计总额。\n',0),(332,3,39,NULL,497,'校园便捷，净化项目',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 00:42:26','经过我们的初步的观察当代大学生一般在校学习年长为四年，在校期间，需要购置大量的日常生活用品。但是在四年之后，大量的物品带走的代价甚至大过于物品本身的价值，而且会有极大的可能会被闲置，那些物品还有大量的会被丢弃，造成大量的浪费。再有就是高校内还有是需要一部分的二手物品，比如，床上书桌，只用四年的电车，甚至是一些学习笔记。或者，一部分的学生有着临时需要一些物品的需求，都是在校内有市场需求的。我们团队的致力于满足校内的学生的此类需求，通过收售二手物品，或者出租一些日常的物品。以此来便捷校内学子的生活。另外，大量的废弃物品，特别是废弃的电车，对整个的校园环境有着的巨大的影响。所以我们团队致力于净化校园环境，给高校学子给予方便为我们本次项目的目的。\n',0),(333,3,43,NULL,735,'艺术生作品交易平台计划',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 00:28:56','由于近几年社会环境影响，有部分艺术生难以找到对口专业。且由于地域差距，导致偏远地区的艺术生有好的作品，却缺少平台或者相关机构对其进行宣传。\n而本计划是使艺术生的优秀作品可以得到一个合理且公平的平台出售。通过网店形式，使每个艺术生都具有展示自己作品的机会，提高艺术生的创作积极性。同时激励艺术生不断提高自身专业水平。与此同时，让社会大众对于艺术生的作品拥有更多了解，增强社会的艺术欣赏氛围，让艺术走进社会大众的生活。',0),(334,8,56,NULL,869,'非省会地方高校图书馆资源建设现状调查——以广西壮族自治区为例',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-04-01 00:33:34','当前，我国正大力推广提升青年学子自身文化底蕴，建设文化强国。针对我校图书馆借阅量较少的情况，特意将本校图书馆资源开发与广西区内其他二本院校资源开发经验相结合借鉴，例如硬件软件资源方面，为我校图书馆建设提供具有当下实际意义、可操作的建议。\n从当前资源利用和资源开发为主方向，结合现场采访、个别交谈、亲临实践、图片、照片、书报刊物、统计报表、文件、问卷等多个信息收集渠道，深入调研图书馆与我校师生的关联，发掘最可行方案，进一步开拓我校青年学子的知识面和文学视野，让图书馆走进校园生活，从而构建书香梧院，在提升我校文化软实力的同时，也将成为我校建设为“梧州大学”的奠基之一。',0),(335,3,43,NULL,307,'E茶空间---大学生创业之家',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 00:37:22','“E茶空间---大学生创业之家”是商学院创新创业教育中心下设的一个大学生创业训练平台。团队通过在E茶空间的自主经营管理活动，以此来提高大学生的社会实践能力，同时旨在树立大学生创业意识和团结协作观念，来达到锻炼自身和提前感受创业的目的和效果。通过号召各班级或各团队的同学参与的形式开展自我动手、产品宣传、活动营销、店内管理、店员分工合作、产品的采购以及成本定价等一系列活动，提高在校大学生的自主经营管理意识，进而汇聚精英人才，共同为梧院师生提供服务。通过组织开展各类创业实践活动，来达到提供创业服务的效果。同时“E茶空间”是一种自负盈亏模式的创业训练，我们通过经营E茶空间为学生团队提供创业训练的平台和相关保障条件，提高大家的自主创业能力，丰富大学生活。',0),(336,3,41,NULL,783,'“互联网+”环协废弃物分类回收',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 01:34:32','“互联网+”环协废弃物分类回收项目——依托现有协会，运用最热模式，开展新型项目。“依托现有协会”是指以环境与保护协会作为依托，开展废弃物分类回收项目。“运用最热模式”是指利用“互联网+”模式，采取线上与线下相结合，线上发布废弃物回收信息，线下提供上门服务对废弃物进行回收处理。“新型项目”是指通过回收废品赚钱积分，积攒一定的积分以兑换小礼品。\n',0),(337,6,32,NULL,848,'高考志愿录取分配系统',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 01:35:33','本项目从梧州学院实际需求出发，运用MVC框架技术，设计并实现一个基于Java平台的高考录取志愿自动分配系统。系统具有按照学校招生章程所规定的录取原则自动录取考生到相关专业、高考志愿录取手动调整、查询、统计汇总、招生质量报告等相关功能。本系统通过从广西录取大平台导出预录取到我校的考生填报志愿相关数据，并对数据进行整理，重新导入到本系统，并根据考生分数及志愿自动分配专业或调剂专业，提高学校高考录取的工作效率。',0),(338,3,52,NULL,884,'手工酸奶连锁店公司的创业实践与发展',3,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 01:41:01','酸奶是以牛奶为原料，经过巴氏杀菌后再向牛奶中添加有益菌（发酵剂），经发酵后，再冷却灌装的一种牛奶制品。酸奶作为老少皆宜的乳制品，以其丰富的营养价值，市场上多受青年消费者群体青睐，成为了生活中不可少的休闲食品。本项目在已有母店成熟经营的基础上，以纯手工打造、坚持0添加剂、鲜活制售开创手工酸奶的鲜作时代。将传统酸奶制法与现代商业模式融合，创造出全新的现做现卖、线上线下的连锁售卖模式。在“透明化制作、健康化食品”的前提下，产品的研发上不拘一格，准备创造性开发以手工酸奶为主题的饮品、甜品以及酸奶衍生品等系列经典创意品牌。',0),(339,6,32,NULL,155,'传承之路——新时代民族文化传承服务平台',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 01:42:53','新时代民族文化传承服务平台是一个线上与线下实体相结合的文化传播传承服务平台。我国是一个多民族团结的国家。积极响应习近平十九大精神，在传承中华优秀传统文化的同时，结合新时代发展趋势，以全新的面貌、通俗化的形式将优秀的中华传统文化展现给国人。并且通过大数据计算和数字化技术来实现数据可视化，运用多媒体技术来对民族文化品牌进行塑造创新，打造出一个新时代民族文化品牌。在民族文化得以传承同时，也促成民族文化品牌的营销，更好地实现文化强国这一新时代社会主义主题。',0),(340,10,45,NULL,896,'西部少数民族革命老区乡村振兴调查报告--以梧州夏郢镇为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 01:45:14','习近平总书记在党的十九大提出乡村振兴战略，2018年2月4日，公布了2018年中央一号文件，即《中共中央国务院关于实施乡村振兴战略的意见》。 2018年3月5日，国务院总理李克强在作政府工作报告时说，大力实施乡村振兴战略。\n本项目在乡村振兴战略实施的大背景下，以广西第一个由中国共产党领导的农民协会和广西第一个中共农村支部诞生地——夏郢镇为着手点。通过深入实地调研，发现和总结夏郢镇实现乡村振兴面临的困难和问题，并运用马克思哲学的观点看问题，因地制宜的提出解决的建议和实现乡村振兴的可行性方案，助力西部红色革命老区实现乡村振兴。并总结出可复制性的经验，推广到其他地区实现乡村振兴。\n',0),(341,6,32,NULL,134,'Unity环境下三维数据可视化编辑器的设计与实现  ',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 06:25:22',' 数据可视化是信息技术热门领域，三维可视化是重要发展方向。Unity与虚幻4是目前三维应用主流开发工具，均缺乏简易可用的数据可视化插件。Unity引擎凭借着低门槛易上手的优势赢得广大用户喜爱。本项目选择Unity引擎作为研究对象，研发一套数据可视化编辑器，使用户无需编程即可实现Unity项目的二、三维图表（柱状图、走势图、热度图、数据仪表盘等）。',0),(342,9,47,NULL,555,'方言传承计划--粤语文化新媒体工作室',2,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 01:55:15','“方言传承计划--粤语文化新媒体工作室”，通过新媒体媒介开展粤语文化学习和传播行动。工作室秉承习总书记的“文化自信”的理念方针，以弘扬优秀方言文化为宗旨，通过短视频与公众号等新媒体平台对方言文化进行传播与学习。现在本团队将从粤语入手，感受粤语文化，探索粤语文化的复兴与学习之路。',0),(343,4,36,NULL,900,'六堡茶风味雪花酥的研制与工艺优化 ',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 01:58:04','雪花酥做法：先将黄油融化，倒入棉花糖，搅拌融化，倒入奶粉，倒入坚果和果干，快速混匀；倒入烤盘，加入饼干，整形，撒上奶粉，放凉后用刀切块。本项目的创新点在于利用超微技术，将六堡茶打成超微粉末，取代平常做法中加入的奶粉进行雪花酥的制作。六堡茶本就具有一定的消暑除湿，降压除腻，促消化，美容等保健功效，与甜品结合起来刚好可以降解部分因食用过多雪花酥而造成上火增脂现象。同时六堡茶副食品食品甚少，研发六堡茶雪花酥可增加六堡茶副食品，改善六堡茶单一销路。',0),(344,6,32,NULL,112,'不惧——“八桂反恐”多元化宣传战略',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 02:12:28','我们团队通过对我国反恐工作进行学习与研究，结合八桂地区特殊的地理位置，并以《中华人民共和国反恐怖主义法》为依据，旨在将“八桂反恐”通过多元化形式进行宣传与推广，弥补八桂地区反恐宣传方式的缺陷与不足。\n我们运用Photoshop、Adobe Illustrator、HTML5进行场景设计以及角色的设定。以CINEMA 4D、After Effect、3Ds Max为主要建模工具，进行摄像机动画制作、骨骼绑定，制作出一套共14个表情包、反恐MG动画。同时通过H5网络平台将前两个风格基础上设计一款答题小游戏微信答题程序，将反恐教育宣传面灵活化。\n我们立志通过新媒体平台多元化传播宣传，对国家安全起积极作用，维护人民安全，提高人民反恐意识。\n',0),(345,3,52,NULL,728,'英语教育资源整合微传播',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 02:15:54','本项目计划使用人数居多的微信端平台建立公众号，并搭配大家喜爱且便捷的微信小程序来作为我们的服务平台进行英语资源微传播。以在校大学生和老师为主要服务对象，针对校内英语教学培训项目缺乏的情况，对校内教育资源进行整合利用，给英语成绩优秀的学生和有意向教导学生的老师提供就业机会，为考生开设丰富的英语项目培训班，助力学生提升英语水平，是项目的主要目标。此平台还将向用户提供免费的信息推送，如最新的考试资讯、英语知识点和各类英语证书的考试帮助信息等，扩大学生的英语知识获取来源，有助于提升英语素质。\n 项目的顺利运营将会给掌握英语的人才提供更多的就业岗位，有效解决校内英语教育项目的稀缺性问题，有效地帮助学生提高英语知识素质，提高报考各类英语证书的通过率。',0),(346,3,52,NULL,884,'手工酸奶连锁店公司的创业实践与发展',3,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-04-01 02:17:45','酸奶是以牛奶为原料，经过巴氏杀菌后再向牛奶中添加有益菌（发酵剂），经发酵后，再冷却灌装的一种牛奶制品。酸奶作为老少皆宜的乳制品，以其丰富的营养价值，市场上多受青年消费者群体青睐，成为了生活中不可少的休闲食品。本项目在已有母店成熟经营的基础上，以纯手工打造、坚持0添加剂、鲜活制售开创手工酸奶的鲜作时代。将传统酸奶制法与现代商业模式融合，创造出全新的现做现卖、线上线下的连锁售卖模式。在“透明化制作、健康化食品”的前提下，产品的研发上不拘一格，准备创造性开发以手工酸奶为主题的饮品、甜品以及酸奶衍生品等系列经典创意品牌。',0),(347,1,49,NULL,864,'主题空间创意设计',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 02:48:16','随着社会的发展，人们对商业的要求层次也越来越高，主题空间设计是吸引消费者的一种重要营销手段。目前我国正处于改革开放后商业发展的第三次高峰，商业面临着千载难逢的发展机遇。本项目将从我国主题餐饮行业的现状进行分析，分析其中存在的一些问题，从客观角度探讨主题餐饮空间设计的理念和原则，从多个角度对主题餐饮空间室内的研究。设计出一个运用各地域饮食文化到主题空间的具体方案。',0),(348,7,60,NULL,904,'梧州学院英语四级考试障碍突破',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 02:51:47','英语四级考试障碍突破是让同学们的词汇量，口语以及写作能力得到提升，来对四级的考试更有把握。团队中的人大部分都是电子与信息工程学院的，大家谈论的最多的就是四级考试很难通过，一个班差不多也只有五六位同学能通过四级。很多的学长学姐都因为四级无法通过而被延迟毕业，可见对于我们这些理工专业的同学来说，英语是多么难学。很多报考四级的同学对通过四级所需要的口语，听力，写作以及阅读能力都有待提高，甚至有一部分人连四级考试的题型都不清楚，所以英语四级考试障碍突破是很有必要开展的。',0),(349,6,32,NULL,111,'广西至诚科技有限公司',3,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 03:12:06','  本项目主要是一家集IT综合性人才培训，少儿机器人编程培训、少儿课外多向发展培新、计算机软硬件技术开发、新媒体推广、广告设计、摄影摄像培训服务与一体的综合性教育培训机构，项目处于发展初级阶段，致力于做针对性的科技人才培训，搭建校企合作平台，带动大学生供勤工俭学，培养多向发展的技术人才。目前已经与部分职业高校达成合作协议，并开展了试点培训，得到了相关单位领导的高度重视，以及相关培训人员的极度认可。',0),(350,1,49,NULL,297,'新型幼儿园及其周边公共设施改造设计',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 03:24:09','随着时代的发展 ，国家对于幼儿的教育力度逐渐增大，根据梧州市人们政府门户网站显示截至2018年末，梧州市户籍人口数347.5万人，比2017年末增加3.6万人，人口增长率高。而我国正处于计划生育新政策阶段开放二胎政策。\n　　从“单独二孩”政策实行一年多的实际效果来看，每年受惠于新政而增加了几十万新生儿。再加上本次进一步放宽限制的“全面二孩”，根据估算，未来每年平均新增的小孩规模预计将在250万左右。针对家长接送幼儿上下放学安全、路边停车设施、室内设计规范、幼儿园附近红绿灯以及斑马线设计等问题来设计出本课题。以梧州市幼儿园为研究对象，通过对幼儿园进行访谈体验观察对空间设计、色彩设计、装置设计、周边环境设计、设施服务等提出幼儿园一系列改造设计方案。',0),(351,3,52,NULL,906,'互联网+B2C模式下的社交电商平台 ',3,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 03:24:24','本项目旨在通过利用社交电商平台运作商品贸易业务，成立商品贸易工作室开展创业，实现盈利效益且可以为社会提供就业岗位。本项目是以分享经济为模式开展的线上商品贸易工作室，本项目所选用的平台是创立于2017年8月的社交电商平台—贝店。贝店采用自营+品牌直供的模式，与源头品牌直接合作。而作为店主的我们，无需囤货、发货，由贝店统一采购、统一发货、统一服务。\n店主只需要通过QQ、微信、微博等渠道把贝店里的商品链接分享出去，只要有客户在你分享出去的链接中下单，店主就可以得到一定的收益。平台最大的创意点就是作为店主，店主无需囤货、发货，由贝店统一采购、统一发货、统一服务，所以店主运营店铺非常简单，操作店铺也非常简单，只需要通过人与人之间的分享与传播，实现消费者、店主以及供应链的三方连接，将精选的商品送到消费者的手中。\n电商社交化成趋势，用户与供应链创新将打破传统电商格局，在新格局中，贝店是非常适合现代大学生',0),(352,7,28,NULL,838,'双滚筒气力循环式多功能花生脱壳机设计研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 03:30:02','为满足高效生产的要求，本项目旨在设计一款双滚筒气力循环刮板式多功能花生脱壳机，主要由电动机、喂料斗、一次脱壳装置、振动筛、风机、二次脱壳装置等组成。花生自入料斗进入脱壳室，受到一次脱壳滚筒刮板的打击、摩擦与揉搓，花生壳与花生仁分离，通过凹板筛，到达振动筛，并且在风力的作用下花生壳被吹出机器外，在振动筛与风机气流共同作用下，花生仁被输送到集仁口内，未脱壳的花生则经过未脱花生回收斗进入气力输送风筒，在送料风机气流的作用下被输送到二次脱壳滚筒内再次脱壳，重复一次脱壳过程，从而提高了花生脱净率与脱壳效率，降低花生仁破碎率和损失率。同时该脱壳机还可通过更换主要部件实现对其他带壳物料的脱壳加工，使脱壳机更具通用性\n',0),(353,13,27,NULL,226,'苹果辅助采摘的设计与实现',1,0,NULL,0,0,0,NULL,NULL,NULL,NULL,NULL,'本项目的设计主要应用于采摘高空处人手够不到的苹果，这样就不需要人爬上树，或用传统麻烦的杆来摘了，减少了人对果树的伤害有利于其生长又降低了劳动的强度，节约了劳动时间的同时又加快采摘的速度，该设备结构简单便于制作，轻巧方便于携带，制作成本也不高，还有自动装箱的功能，装满一箱后重新放个箱子就可以继续采摘了，非常方便、简单。相较于人工采摘有很大的市场前景，有很大的推广应用价值，可以有效的推动苹果产业更好更快的发展。',0),(354,3,2,NULL,885,'便易宝',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 03:40:34','近年来，生活水平的提高，大学生堆积闲置的物品越来越多，他们迫切希望能够把自己的闲置的物品转售出去，但是目前在学校没有一个专门转售的二手物品的平台。 为此我们开展了关于在校大学生便易宝平台的探索与研究，目的是建立一个在校大学生便捷物品交易的平台，以服务在校大学生，满足他们的闲置物品交易需求。这个平名分为三个区域,一个是二手交易区，一个是以物换物区，最后一个是信息分享区。希望能通过这个平台能满足在校广大大学生物品交易的需求,另一方面也能促进校园文化建设，加强同学之间的沟通与交流。',0),(355,7,31,NULL,737,'Given植保无人机',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 04:09:57','我国目前使用的植保方法以人工手动施药为主，但其对施药者而言劳动强度大、易中毒。且作业成本高，资源有效利用率低下。同时带来严重的水土污染、农产品品质下降等问题，无法适应现代农业发展的要求。\n本项目设计一款以STM32单片机作为飞控核心，搭载10KG药箱、4个电动离心喷头、GPS模块、摄像头的植保无人机。可自动定点定高喷射，实现无人操控，以代替传统的施农药法，解决农药对施药者有害、施料过多和不均引起的环境污染问题。\n',0),(356,5,57,NULL,795,'有关东盟服饰妆容文化的研究',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-04-01 04:13:05','东盟服饰妆容文化结合了国际化的理念，一直以来，东盟与中国有着友好往来的传统。东南亚国家联盟（简称东盟（ASEAN），成员国有马来西亚、印度尼西亚、泰国、菲律宾、新加坡、文莱、越南、老挝、缅甸和柬埔寨。东盟的时尚产品汇聚不同文化元素，潮流特点在于不同的对立风格互相交融，例如传统与现代服饰、便服与高级衣着、动感与时尚设计等。\n服饰妆容搭配是一种形象创造活动，通过塑造视觉效果，追求人与服饰结合的和谐统一，体现灵感、质感、美感，给人带来美的享受，能让东盟国家的人们来到中国有一种归属感，也能让国土人民，不出国就能体验东盟国家的服饰妆容文化的特色，感受异域风情。\n',0),(357,1,49,NULL,780,'梧州市户外广告市场前景调研 ',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 04:25:26','        户外广告是在建筑物外表或街道、广场等室外公共场所设立的霓虹灯、广告牌、海报等，对提升企业品牌知名度有着重要意义。目前梧州地区户外广告市场缺乏统一布局，乱象丛生。\n        项目拟对梧州市户外广告市场现状进行调研，利用前期积累的资源，通过问卷调查、访谈、实地考察、实验等研究方法对不同区域、不同群体进行实际调研。并对获得资料进行科学的整理、归纳。为梧州地区户外广告的市场前景准确把脉，为团队和业内人士提供参考。',0),(358,5,60,NULL,905,'玉林水果酸料',3,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-04-01 05:06:54','目前，生活水平上升，年轻一代对于吃是很有讲究，一样水果往往有很多种吃法，最近新奇出现水果捞等制作方法，备受人们喜欢。在玉林也有一种水果的不同吃法，那就是玉林水果酸料。玉林水果酸料是一种用水果切开后用熬制的黄糖浆搅拌并加入香菜等配料制作而成的水果酸酸料。有苹果、芒果、菠萝、圣女果、番石榴、酸野菜、酸萝卜、木瓜等季节性水果或蔬菜。酸酸甜甜吃了能解油腻。在玉林受到很多年轻人的喜好，每年春节成了酸料的热卖期，男女老少都会拥挤在酸料店里吃酸聊天，在梧州我们发现常见的酸口感不佳，常常是腌制好大半个月才卖，而玉林水果酸是现切现做现卖，健康卫生。在生活水平上升的今天，不仅要做人们喜欢吃的水果酸料，还要做健康安全的水果酸料',0),(359,1,49,NULL,870,'3D打印在首饰中的应用',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 05:05:49','此项目主要是利用珠宝3D打印和现代时尚潮流设计，在设计的过程中我们采用了电脑软件辅助绘图，JEWEL-CAD.Rhino等等，为了配合数字化生产，在工艺上我们也采用了3D打印服务是对电脑辅助设计向下一步的延续。现如今3D打印能在不同行业中表现出无限潜力，因此很多发达国家早已将目光投向3D打印技术。3D打印在珠宝首饰设计邻域的研究在全世界范围内同样属于初级阶段。在初级应用阶段我们已经发现了3D打印在生产订制产品过程中的优势。随着这项技术的逐步成熟更多的优势会显现出来。把本专业的精英人才带动起来，并通过不断的实践达成良好的协作能力，提高学生与社会人士的沟通能力，提前为毕业创业的学生打下牢固的基础。',0),(360,8,56,NULL,869,'非省会地方高校图书馆资源建设现状调查——以广西壮族自治区为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 05:13:26','当前，我国正大力推广提升青年学子自身文化底蕴，建设文化强国。针对我校图书馆借阅量较少的情况，特意将本校图书馆资源开发与广西区内其他二本院校资源开发经验相结合借鉴，例如硬件软件资源方面，为我校图书馆建设提供具有当下实际意义、可操作的建议。\n从当前资源利用和资源开发为主方向，结合现场采访、个别交谈、亲临实践、图片、照片、书报刊物、统计报表、文件、问卷等多个信息收集渠道，深入调研图书馆与我校师生的关联，发掘最可行方案，进一步开拓我校青年学子的知识面和文学视野，让图书馆走进校园生活，从而构建书香梧院，在提升我校文化软实力的同时，也将成为我校建设为“梧州大学”的奠基之一。',0),(361,1,49,NULL,844,'猫·斋创意生活馆方案设计  ',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 05:25:17','近年来，随着物质生活水平的逐步提高，精神生活也越来越受到人们的重视。人们希望在物质条件充盈的同时，心理得到更多的爱与关怀。而饲养猫咪则是时下许多人让心理得到满足的一种选择，越来越多的人将猫作为家庭中的重要一员对待。为了提升猫和人的互动关系，普及科学养猫的相关知识，我们计划在梧州市设计一个以猫为主题的创意生活馆，旨在创造一个具有特色的生态空间，使猫与人，人与人，人与环境三重关系得到进一步的改善与提升。',0),(362,6,32,NULL,158,'巍微课堂工作室',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 05:25:51','目前，我国的课程资源要求越来越多元化，有趣的课程对于学生吸收知识有很好的帮助，特别是对于中小学生，他们对于知识的吸收需要通过一些有趣的载体才能更好地帮助他们学习。基于现在的情况，我们现在推出一款微课资源，现阶段主要是关于汉字文化的微课课程，针对课堂教学中的某个知识点来给学生进行趣味教学。我们的课程是通过情景故事层层递进，中间还使用到了VR技术与学生互动教学的形式，让上课更有趣，让学生更易于吸收知识。',0),(363,6,32,NULL,257,'32號映像工作室',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 05:33:51','通过摄影提供一个平台，为广大摄影需求者在日常拍摄，个人写真，影视策划，婚礼拍摄，广告设计，商业推广宣传等方面提供多方位多渠道的服务。旨在推动传统媒体和新兴媒体融合发展，要遵循新闻传播规律，强化互联网思维，促进传统媒体和新兴媒体优势互补，坚持先进技术为支撑、内容建设为根本，着力打造形态多样、手段先进、具有竞争力的新型主流媒体。顺应新旧媒体发展改革的主流，我们成立了32號映像工作室。',0),(364,9,9,NULL,829,'大学生对心理咨询的态度及其心理求助行为调查研究——以广西部分高校为例',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 05:36:19','习近平总书记在2016年全国卫生与健康大会上提出，要做好心理健康知识和心理疾病科普工作，规范发展心理治疗、心理咨询等心理健康服务。心理咨询是大学生心理健康教育的重要途径。大学生对心理咨询的认识态度，是心理咨询研究的重要内容之一，只有充分地认识和把握心理咨询对象 的心理行为特点，尤其是对心理咨询的态度和行为趋向，才能提高心理咨询的针对性和有效性。目前，部分大学生对自身心理健康状况的主观感受是认为自己的心理不够健康，他们需要调整与改善。大多数大学生虽然对心理咨询持有积极肯定的态度与认识，但在寻求心理咨询的行为上却是消极的、回避的，“知”与“行”相互矛盾；对大学生进行普及性的心理健康教育是必要的。本研究旨在通过问卷调查和个案访谈等途径了解当代大学生对心理咨询的态度及其心理求助行为状况，为今后高校心理健康教育特别是心理咨询工作提供一些参考依据。',0),(365,3,52,NULL,671,'振兴乡村恭城特色产品柿子创新销售的探索与实践',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 05:50:18','在全面建成小康社会背景下，十九大报告提出实施乡村振兴战略。本项目与振兴乡村战略息息相关，主要是打破由中间商到农户家里低价购买产品再高价卖出单一传统的营销模式，这样的销售模式经常会造成产品滞销，降低果农生产积极性与经济收益以及街道拥堵等一系列问题。本团队就根据现在电子商务发展良好的大环境下创新恭城柿子的销售模式，利用电子商务平台与农村淘宝合作，实现网上与线下门店共同运营的新销售模式。\n\n',0),(366,3,31,NULL,917,'光明工厂-LED节能灯',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 05:58:11','在当今随着我国互联网的高速发展以及“一带一路”战略的提出，国际贸易获得飞速发展，与此同时，也推动了跨境电商迅速发展的热潮，它的发展逐渐成为了人们关注的焦点，而敦煌网作为跨境电商平台其中之一，于2004年创立，是领先的B2B且亚洲第一个拥有全球“身份证”GS1的跨境电商交易平台，针对欧美等英语系及东南亚国家，帮助中小企业实现“买全球，卖全球”，实现传统贸易线上化，便利化。\n光明工厂—LED节能灯项目着力于针对现在的青少年群体，也可OEM弯臂折叠LED节能灯针对办公室上班族人群或其他类型OEM台灯需求客户，灯具类产品对于欧美国家来说进口需求程度大于国内生产，且在我国出口灯具类产品有相应的出口退税补贴政策。现有同沃尔玛项下合作的山姆会员店的中山华派照明公司助力作为供应商代表为我们供应环保锂电池装置LED节能护眼台灯产品，项目实施的前期我们会开设敦煌账户并上传对应主打款和利润款产品；装饰店铺；再通',0),(367,6,2,NULL,814,'招生信息分析系统',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 06:08:27','大数据时代已经到来，传统阅读浏览数据的模式已经跟不上时代的步伐，数据可视化必将成为未来信息化办公的主流方式。本项目以信息可视化研究为主，数据处理分析为辅，多点并进处理各大高校庞大的招生信息，实现高效办公。使用者通过导入Excel表格，系统分析处理，提取有用信息，进行大数据处理，生成可视化图表以及各专业各地下一年录取计划名额，并对该算法进行可行性分析。本系统以操作简单、图表清晰、统计准确、分析合理、处理快速为基准，实现对高校招生信息的快速可视化。\n',0),(368,3,52,NULL,731,'大手牵小手',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 06:11:28','“大手牵小手”是一个由“大”学生自主创办的“小”学生晚托中心，立足于创新创业，与校外机构合作，以教书育人，传播中华传统美德为导向。集合经营团队，以我们机构文化为导向，采用“托管+”的形式，以小学生文化教育等为主要业务，推出各类教育方式和服务，通过团队成员的劳动和服务赚取收入，同时为大学生提供在校实践和操作的平台。',0),(369,6,32,NULL,162,'基于Unity引擎的GIS地图插件的设计与实现',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 06:23:12','目前，电子地图的应用与开发技术已经相当成熟，并且都配备了开放的多平台SDK工具供开发者定制开发自己的应用；Unity引擎近年来已成为三维可视化应用开发的重要工具，特别是应用于数字交互沙盘或监控系统等方面，但目前谷歌、百度、高德等地图厂商均没有针对Unity平台的第三方SDK开发包。因此，本项目拟研发GIS地图插件，以使开发者能在Unity引擎中使直接引入百度等厂商的GIS地图，并能与其中三维模型柔性融合，由此扩展更多的Unity技术应用领域（例如智慧城市、消防指挥控制等），并一定程度填补Unity引擎在GIS地图应用拓展开发上的技术空白。',0),(370,1,49,NULL,646,'品牌战略影响下的梧州“双钱”龟苓膏品牌形象设计',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 06:34:25','品牌形象设计分为三个方面，分为BI、MI、VI，三方面为行为识别，理念识别和视觉识别。VI视觉设计，（通译为视觉识别系统）通过VI设计有控制的将信息传达给受众，使受众群体一目了然，简洁迅速的了解、明白企业要传达的信息，通过视觉符码，不断的强化受众的意识，从而获得认同。\n    通过调研、资料搜集、设计与分析等研究方法对国内外的著名企业的VI进行全面分析研究，结合视觉形象识别系统建设的相关理论知识，充分分析研究“双钱”历史文化；创办宗旨和生产理念的关系提高品牌影响力，为其后的发展奠定坚实的基础，从而树立“双钱”的品牌形象。',0),(371,6,32,NULL,484,'梧州学院计算机科学类专业第二课堂实践训练项目研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 06:42:07','针对我校师生计算机等电子设备维护人手不足，维护信息发布渠道单一，以及面向社会进行信息技术科普力量薄弱等问题，以大数据与软件工程学院计算机科学与技术专业为主学生拟组建一支兼具设备维护、技术科普的队伍，通过申请微信公众号或小程序等主流的信息发布渠道，解决我校师生设备维护困难的最后关键环节，同时积极组织大数据学生参与“党员进社区”等社会公益类活动，通过自身的专业知识进行信息技术科普来回馈社会。',0),(372,5,49,NULL,794,'青春纪念馆',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 06:53:34','青春纪念馆以“青春，校园”为摄影题材，不仅能为广大的在校学生及已毕业的校友和对大学校园向往的人群留下青春的纪念册，也能通过拍摄校园写真宣传校园美。\n青春纪念馆可以定期寄存照片，即给未来的一封信，最后以邮件方式寄到客户手里。通过新颖的方式让当代青年人体验书信年代。\n',0),(373,6,32,NULL,749,'“画凌烟”中国武将系列新媒体动画制作',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 06:58:18','随着新媒体宣传平台的兴起，以及新时代大环境下国家对传统文化元素传播的重视，本项目以多名中国武将的生平描述为整体创作思路，民俗“门神武将”和“壁画武将”等形象为发散风格，创作系列动画，展现古代武将们英勇无畏、保家卫国、视死如归的爱国之情；另一方面，通过抖音、哔哩哔哩、腾讯微视等主流新媒体平台进行发布与传播，彰显中华民族的软实力、加强当代国人的凝聚力，并实现文创增值。',0),(374,3,43,NULL,573,'基于“互联网+特色农产品”销售模式 创新探究——以梧州蒙山基蜂蜜为例 ',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 07:13:55','随着电子商务在国内的迅猛发展，实体营销向线上销售成为新时代最受欢迎的一种营销模式,本研究基于农村网络营销的视角，以梧州市蒙山蜂蜜为研究对象，整合农村互联网基础设施、互联网电商、互联网金融等“互联网+”特色农产品，构建贫困地区网络模式体系，进一步将信息流、产品流、资金流有机组合，使得贫困地区的比较劣势向比较优势过渡，从而解决农产品滞销困境，为农村经济的发展提供新动能。本项目研究结合农户合作，共同探究“互联网+”的农产品营销新思路新模式；将以\"助农-创业相结合\" 以增加销售绩效为目标。',0),(375,8,58,NULL,892,'民俗景观VI设计探索与实践',3,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 07:48:52','优秀民俗文化一直是中华民族的瑰宝，也是城乡建设、经济生产的一类重要文化资本。随着我国文旅产业的不断发展，近年来涌现了一大批民俗特色小镇、古村落、民俗风情园、民俗节庆等等以民俗文化展示和体验为主要功能的民俗景观。如何打造民俗景观并开展有效宣传，实现文化价值和商业价值的双赢，也就成了一个需要解决的问题。\n本项目将对国内一些知名的民俗景观进行实地探索与调研，了解其宣传推广过程中的成功经验与不足之处，特别是在视觉传达方面的效果，在此基础上总结和探索民俗景观VI（Visual Identity, 视觉识别系统）设计的理论、方法与技巧，并且进一步结合地方文化保护与旅游产业的需要开展设计实践，为当地的民俗景观设计出独属于他们的品牌形象和纪念产品等，本项目也是以此获得盈利。',0),(376,3,36,NULL,891,'促进大学生健康生活以及产品销售（以梧州学院“健康屋”为例）',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 07:57:39','“健康屋”项目是一家拟在广西梧州学院内建立的一家“健康”，“便捷”，“亲民”以售卖“健康包”为主要业务，针对性较强的小型休闲吧。“健康屋”的消费对象主要是面向大学生，以健康饮食，健康运动，健康生活作为项目的发展目标，是一个为消费者提供“健康”，“便捷”，“亲民”业务的一个场所。所谓“健康”是指将健康作为项目最中心的思想，所有的一切营业活动都以健康为主题开展，是项目的核心部分；“便捷”是指我们秉承着便捷为目标，为消费者提供最为便捷的服务，希望消费者不管从购买还是使用都能在没有任何顾忌下进行；“亲民”是我们的一个经营策略和目的，以价格亲民，服务亲民，销售方式亲民，产品亲民，希望不会给消费者带来任何方面的负担，尤其是产品质量和产品价格两个方面，希望消费者能在“健康屋”收获一份简单的健康和快乐。',0),(377,7,31,NULL,916,'图像模糊检测与模糊区域分割 ',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 08:09:31','在现实生活中，运动模糊图像广泛存在，图像会因为摄像者与对象之间的角度和者物体与相机之间的相对运动等因素产生运动模糊，通常模糊被作为有害现象，众多专家学者的研究方向为如何去除模糊，复原图像。然后本项目研究运动模糊的成像机理和退化模型，利用运动模糊现象，寻找在找到无参考背景下，在同一幅图像中能有效地表征图像不同区域模糊度或清晰度的图像特征或特征组合，从而实现对模糊区域的智能识别和检测，为运动目标检测，提供新的思路。',0),(378,3,49,NULL,857,'木偶戏文化推广研究工作室',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 08:24:49','现代互联网科技的发展，国家积极推动改革开放，大力推进文化创新。随着“互联网+”体系逐渐成熟，萌生现代科技与传统文化相结合的文化传播想法。我们秉承“保护、传承、开发、创新、传播”的理念，借助互联网传播中华优秀传统木偶戏文化，在此过程中开发创造文化创意产品，借助地方木偶文化深厚根源，大力探索木偶文化在校园的传播路径研究，为木偶文化传承开辟新道路。\n主要利用木偶戏悠久历史文化的优势与现代互联网传播渠道相结合（1.网站宣传；2.社交软件，如抖音表演；3.表演与虚拟现实技术结合），广为宣传，促进人们对藤县木偶戏文化的了解。\n',0),(379,8,58,NULL,920,'自媒体“小树汉语”在泰国对外汉语教学中的创新实践与应用',3,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 08:39:26','“小树汉语”是用于进行对外汉语教学的自媒体账户主体，包括微信公众号“小树汉语”和Facebook“小树汉语”中文学习兴趣小组以及“小树汉语”YouTube账户三个平台注册账户构成，“小树汉语”的教学内容在微信、Facebook和YouTube这三个自媒体平台发布且定向向所授课的学生进行推送；“小树汉语”地意义在于积极有效地探索了对外汉语教学和中华文化传播更加高效的方法和实现路径；其创新处在于利用驻外汉语教师的实地教学展开在线汉语教育的试点式教学，通过线上线下的结合式教学探索更适用于汉语传播的在线教学模式；该实践项目通过文晓调研和实战教学以及经验总结相结合的方法开展创新实践活动，将所学的对外汉语理论应用于实践，最终形成“小树汉语”汉语在线教学平台，并运用于实际教学。',0),(380,8,57,NULL,926,'在跨文化交际下梧州饮食文化对留学生的影响',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 08:40:37','\n\n跨文化交际指本族语者与非本族语者之间的交际，随着全球一体化的发展，大批留学生来华学习，而中国“民以食为天”的饮食文化观也成为了跨文化交流的热议话题。本项目侧重于研究梧州地方饮食文化对东南亚留学生的影响。',0),(381,1,49,NULL,925,'基于广西金秀瑶族服饰文化的服饰品创新设计研究',1,3,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 09:00:38','瑶族是一个有着深厚文化底蕴的民族，其民族传统服饰总是充满动人的韵味，在金秀瑶族自治县居住的瑶族支系多达五种，服饰风格各具特色，服饰文化异彩纷呈，使得金秀瑶族服饰具有极大的研究价值，但是现在对金秀瑶族服饰品的创新研究较少。本项目拟对金秀瑶族服饰风格进行收集整理归纳，并将其与现代时尚元素结合进行创新，丰富服饰的使用价值和审美价值，通过创新来传承和发展瑶族服饰文化，促进瑶族服饰品文化的继承、传播和发展。',0),(382,1,49,NULL,753,'梧州地区传统村落文化保护研究——以料神、培中二村为例',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 08:49:16','本项目以梧州地区列入广西首批传统村落名录的2个村落为研究对象，为调研选点和现场素材采集等方面提供指引。拟通过查阅资料、田野调查等研究方法，较为系统地分析和揭示此地区传统村落文化演变的动因、影响因素和个性特色，并结合当地实际情况，尝试探寻如何保护该地区传统村落文化的途径。在一定程度上弥补对该地区传统村落文化研究不足的现状。为传统村落的相关研究提供些许借鉴；同时也为对该地区传统村落科学利用的后续研究做好铺垫。',0),(383,1,49,NULL,753,'梧州地区传统村落文化保护研究——以料神、培中二村为例',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 09:05:14','本项目以梧州地区列入广西首批传统村落名录的2个村落为研究对象，为调研选点和现场素材采集等方面提供指引。拟通过查阅资料、田野调查等研究方法，较为系统地分析和揭示此地区传统村落文化演变的动因、影响因素和个性特色，并结合当地实际情况，尝试探寻如何保护该地区传统村落文化的途径。在一定程度上弥补对该地区传统村落文化研究不足的现状。为传统村落的相关研究提供些许借鉴；同时也为对该地区传统村落科学利用的后续研究做好铺垫。',0),(384,2,9,NULL,929,'在校大学生社交软件使用情况及其未来的发展情况',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 09:12:43','随着互联网的发展，越来越多的社交软件进入现代生活，并受到广泛使用。相对于面对面交流，网上虚拟社交软件具有对时间自由、空间要求小的优势，它还可以根据个人性格交友筛选。我们主要研究在校大学生对于社交交友的需求，并在此基础上提出社交软件的发展情况。',0),(385,3,43,NULL,605,'“梧州领航教育”——O2O模式下的大学生家教平台',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 09:31:24','随着电子信息技术的发展和互联网的普及，传统线下服务愈来愈多地与网络结合起来。梧州学院是梧州家教市场的重要服务提供者，很多大学生选择兼职家教来锻炼自己，而很多家长也乐意雇佣高品质的大学生来帮助自己的孩子提高学习成绩。本项目以梧州学院大学生家教部为基础，探索出一个融合线下教学与网络授课的O2O大学生家教平台，通过家教平台为大学生提供锻炼自己的机会，同时也为梧州家长提供更多的便利。',0),(386,3,52,NULL,931,'“私人定制”—基于互联网的梧州个性化礼品及服务初策',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 09:40:03','私人定制是近几年来新的营销模式，而互联网是为其重要的载体，主要表现在线上网店和线下实体相结合的表现形式。本项目研究的对象主要是梧州学院的全体师生提供针对消费需求的个性化和服务，根据顾客需求定制个性化的礼品，提供量身定制的个性化产品服务。研究目的在于为同行企业提供互联网+私人订制营销模式的借鉴依据。',0),(387,1,49,NULL,918,'乐器系列首饰开发及市场推广',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 09:52:48','项目是研究乐器设计元素与珠宝首饰相结合的首饰新品种，设计、制作和推广符合消费者需求的首饰产品。经过市场调研，目前珠宝市场还没有系统研究乐器元素应用在首饰设计上，乐器元素在首饰设计上的产品只有简单的几款，远远不能满足市场的需求。国家大力发展文化软实力的今天，团队成员运用所学珠宝知识，一些团队成员在校管乐队有学习经历，对一些乐器有所了解，团队成员就读学校有成熟的加工技术和导师的指导，有能力设计乐器元素与珠宝相结合的产品，研发出具有其独创性优的产品，满足消费者精神文化需求的首饰。',0),(388,3,52,NULL,871,'校园二手交易平台工作室',2,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 10:00:08','在低价的前提下，提供优质的产品与服务，是二手服务的核心理念。随着经济的迅速发展与科技日新月异的进步，产品更新换代越来越快，人们购买新商品后越来越多旧的商品积压需要处理，加之生活压力越来越大，物价越来越高，人们逐渐倾向于购买便宜而又实惠的二手商品。尤其在大学校园里，目前二手商品交易成为大学生课余生活的一大热门，许多学校经常举办跳蚤市场，受到学生们的热烈欢迎，但大多是闲置不用的书籍或生活用品，规模小，品类少，广大学生,的需求得不到充分的满足，尤其对电子数码，手机，电脑等大学生最感兴趣的高科技产品却很少被提供，所以市场发展潜力极大。',0),(389,1,49,NULL,297,'新型幼儿园及其周边公共设施方案设计',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 10:29:56','随着时代的发展 ，国家对于幼儿的教育力度逐渐增大，根据梧州市人们政府门户网站显示截至2018年末，梧州市户籍人口数347.5万人，比2017年末增加3.6万人，人口增长率高。而我国正处于计划生育新政策阶段开放二胎政策。\n　　从“单独二孩”政策实行一年多的实际效果来看，每年受惠于新政而增加了几十万新生儿。再加上本次进一步放宽限制的“全面二孩”，根据估算，未来每年平均新增的小孩规模预计将在250万左右。针对家长接送幼儿上下放学安全、路边停车设施、室内设计规范、幼儿园附近红绿灯以及斑马线设计等问题来设计出本课题。以梧州市幼儿园为研究对象，通过对幼儿园进行访谈体验观察对空间设计、色彩设计、装置设计、周边环境设计、设施服务等提出幼儿园一系列改造设计方案。',0),(390,8,58,NULL,935,'文化认同视角下广西节日文化传播研究——以壮族“三月三”与京族“哈节”为例',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 10:34:19','民族文化是各民族在其历史发展过程中创造和发展起来的具有本民族特点的文化。“三月三”歌节是广西壮族重要节日之一，是传统骆越文化的主要表现，统称为\"三月三\"歌圩。“三月三”已有上千年历史，是承载和展示壮族传统文化的重要载体和平台，传承保护“三月三”是传承保护壮族文化的有效途径，它将有力地促进广西民族团结局面的巩固和发展。京族是中国唯一海洋民族，主要分布在广西壮族自治区东兴市江平镇山心、巫头、万尾、潭吉四个村落。被列入首批国家非物质文化遗产名录的京族哈节是京族独有的传统节日。“三月三”歌节与哈节都以祭祀神灵、团聚乡民、交际娱乐为主要内容，是一种文化观念和精神维系的“再生产”,传承保护它们能让民众增强民族文化自觉。\n本项目探究广西如何通过节日文化的传播来增强本地区人民文化认同感，本项目采用多种研究方法来进行研究：通过对壮族“三月三”歌节和京族“哈节”相关的地区进行实地考察，收集有关两个民族节日活动',0),(391,5,49,NULL,934,'美雅化妆工作室',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 10:43:27','随着美容产业的逐渐兴起，美容市场的竞争也日益激烈起来，要想在如此环境中脱颖而出，必须拥有足够的实力，和一定的创新能力。在梧州学院的一些校园活动中，为了更好的舞台效果，有大量的学生需要化妆。但是，如今的大学生普遍缺乏舞台妆的化妆技术，因此美雅化妆工作室主要为这样的人群所服务，为不同的场合制定不同的妆容。\n',0),(392,3,50,NULL,553,'明清时期广西移民与经济社会变迁研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 10:53:20','有史以来，广西就一直被人称为蛮夷之地，边疆地区。自秦汉以来，广西就陆续有移民迁入，随着中央政权统治的深入，内迁人口源源不断，特别是在明清两代，内迁人口达到一个高峰，且遍布广西各地，使广西地区民族杂居的局面不断扩大。且移民多来自发达地区，给广西带来了一定的发展机会，促进了当时的社会经济、文化等方面的发展，本项目主要研究明清时期，广西地区的外来移民给广西的经济社会变迁带来了哪些影响。通过研究，可以为广西地区现阶段经济社会的发展提供参考依据。 ',0),(393,6,21,NULL,744,'高校周边资源整合管理应用系统',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 10:55:42','在高校校园里，缺少一个可以让在校大学生交流探讨问题和校园周边信息实时分享的平台为了方便学生们的学习和生活，本项目计划推出一款针对学生生活的应用，项目首先在学校周边收集商家信息，包括学校周边的商店，市场，美食的信息，同时收集本市内和校园内每天发生的新闻热点，供学生浏览评论，允许在校大学生自己发布动态。本项目旨在为在校内大学生提供更方便，更细致的服务。由于加入了学生交流系统，该应用可以实时动态更新校园内发生的新闻热点，学生可以在这里讨论校园点也可以就校园周边商品价格和品质进行讨论，对劣质产品进行曝光。同时，商家也可以在平台实时更新物价。项目还会更新高校所在市的景点信息。',0),(394,8,48,NULL,721,'对外汉语教学中生肖文化在“一带一路”沿线国家的传播策略研究 ',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 10:56:48','中国传统文化博大精深，其中十二生肖文化占据着重要的地位，其文化内涵正是中国传统文化的集中体现，它们代表着中华民族的美好品质。此外，“一带一路”沿线国家也有着自己独特的生肖文化，基于此情况，如何以中国的生肖文化作为切入点在“一带一路”背景下进行中国传统文化传播，这是一个值得我们深入探讨研究的问题。\n本团队成员结合自身专业，在与“一带一路”沿线国家留学生的接触中，了解到在目前对外汉语教学中十二生肖文化运用的范围较窄，因此，本项目的研究是非常有必要的，其研究成果将贴切“一带一路”沿线国家的实际传播情况，也能在中国生肖文化传播中作为理论参考长期运用于对外汉语教学中。\n本团队成员将参与“一带一路”沿线国家的交换生计划，故此我们将会采用问卷调查法、访谈法、文献研究法等方法对项目进行多方面的研究，最终，我们的项目成果可以实际运用于对外汉语教学当中，从而传播优秀的中国传统文化，提高中国的国际影响力。',0),(395,1,49,NULL,468,' 国家级非遗——藤县狮舞系列招贴设计  ',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 11:13:56','文化遗产是千百年来祖先留给我们的宝贵财富，是民族精神和气质代代相传的纽带，保护和传承极具地方特色的非遗项目具有积极的意义。\n本项目主要是通过国家级非遗——藤县狮舞系列平面设计（海报/招贴）的形式，将梧州非遗以（海报/招贴）的表现手法展示出来，进行传承与保护，推广至广大青少年及广大市民，从而提升梧州市经济文化水平。\n本项目在项目实施过程中，可以对大学生资源和社会资源进行合理有效的配置与整合，把已有的专业知识运用到实践训练中，提高其的社会实践能力，提升综合能力，从而增强社会竞争力。',0),(396,7,31,NULL,938,'应变式称重传感器自动修复装置的研制',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 11:14:23','针对过载造成的部分损坏—机械弹性部分过载但电气部分仍可以工作的情况的传感器，研发一套应变式称重传感器自动修复装置。对损坏传感器进行自动调整修复其弹性形变。通过该装置的使用，可以减少称重设备应用企业的设备维护支出，还可以促成资源再利用，减少传感器报废对环境的破坏和污染。 ',0),(397,4,44,NULL,939,'边疆少数民族地区基层党组织现状调查研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 11:17:29','党的十九大提出了新时代党的建设总要求和八个方面重点任务，丰富和发展了马克思主义党建学说，为全面从严治党向纵深发展提供了科学指南。各级党组织特别是基层党组织，必须突出党建引领与保障这个关键作用，努力在引领新时代、增强组织力上下功夫，切实提高党的建设质量。本项目将以广西壮族自治区为例，以边疆少数民族地区基层党组织这一特殊区域作为研究对象，深入调查、研究和探索边疆少数民族地区基层党组织的现状及问题，以及解决路径。为边疆少数民族地区基层党组织发展提供理论参考',0),(398,3,60,NULL,799,'“互联网+”下大学生思想政治教育实施路径',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 11:18:26','如今大学生思想政治教育正面临严峻的挑战，传统的大学生思想政治教育渐显脱离时代的轨道的迹象，“互联网+”的兴起为教育行业带来了变革的机会，基于这样的机会，本文在调研大学生思想政治教育现状基础上，将深入分析了“互联网+”下大学生思想政治教育正面临的挑战与机遇，并发表充分运用“互联网+”技术下开展大学生思想政治教育的路径的观点，以期为思想政治教育途径提供意见。',0),(399,7,31,NULL,930,'承“包”你的温度',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 11:29:21','此产品为多功能光伏旅行背包，分为四个功能:(1)温度检测功能。通过温度传感器感应外界温度，方便使用者随时了解外界温度变化。(2)制冷和制热功能，利用半导体材料的帕尔帖效应，可以实现制冷或者制热的目的。(3)手机充电功能。太阳能电池板通过储蓄电量能实现手机充电功能，实现在户外便捷充电。(4)制水功能。通过制冷效应，将空气温度降低到露点温度以下，使得空气中的水蒸气凝结为小水滴，以达到制水的效果。',0),(400,1,49,NULL,332,'校园快递网点运行模式与空间设计的应用——以梧州学院“近领宝”改造设计为例 ',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 11:31:54','在互联网和电子商务日益发展的背景下,在校的大学生带动了高校快递包裹量的增长,使高校成为快递包装集中消费的重要场所之一。由于快递包装总量虽大但来源分散、回收过程中转环节多,使回收成本过高而尚未形成完善的回收利用体系。废旧快递包装资源容易在高校内形成空间聚集、高校快递包装消费存在季节性、周期性峰值、种类集中且数量较大等结论,说明高校快递包装回收的可行性和必要性。本团队通过对网点布局优化原则的探讨,分析了网点布局影响因素,并以梧州学院近邻宝快递网点布局存在的问题为例,提出服务网点布局优化模式,使快递的寄发更加方便快捷。',0),(401,2,48,NULL,719,'大学新生入学前后的心理变化及其影响（以梧州学院为例）',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 11:38:49','  从经历高考的洪流到踏入大学成为一名大学新生，一切都是新的开始；无论是生活还是学习，都面临着重大转折。大学生活和学习与中学有很大差异，高中有老师、学校的监督，封闭式教学，过多束缚，而大学则不然，大学趋于自由，没有太多束缚，思维和视野也会随之扩大，很多在中学里边很优秀的学生会有失宠感，得不到重视；无法适应大学生活，理想的大学与现实所上的大学差距产生的心理变化等等，所以，大学新生入学前后的心理会有很多变化，他们所扮演的社会角色、所处的生活环境及其学习特点、需要去处理的各种人际关系、大学管理模式、教学模式都发生了很大变化，以及这些前后的变化对于大学新生而言有什么影响，是否会对他们的人生轨迹产生驱动作用，等等。而我们本次项目，就是探究大学新生入学前后的心理变化及其影响，探究采用资料查阅法、实际调查法、问卷调查法等等，以使得本项目既具有科学理论支撑又有实际实践保障，确保本项目顺利完成。\n\n',0),(402,7,31,NULL,67,'基于STM32的牧羊无人机',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 11:38:49','本项目的目的在于研发一种用于牧羊的无人机。牧羊人只需要简单操控无人就可以实时观测和驱逐羊群。无人机带载北斗和气压计，通过差分定点和估算三阶互补定高 ，可以实现精准定点，定高，返航功能。装载有摄像头和喇叭，可以实现实时监控羊群情况。采用PID控制器与ADRC控制器相互嵌套的新型联合控制器，解决传统PID控制器抗干扰软弱问题，改善飞行姿态的控制，使其具有强自抗干扰能力。加大地面人员的生命财产安全。实现无人机稳定精准的观测到羊群的功能。',0),(403,3,52,NULL,890,'有可能时光工作室',3,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 11:40:38','互联网流行的时代，大学生沉迷于虚拟世界，经常宅在寝室。或者因学生个人原因性格内向，交际圈狭窄。没有处理好如何交际，使校园生活单一。如何让大学生放下手机，走出寝室，面对面克服交流困难，是我们当下需要解决的问题。本团队致力于提供平台，通过策划组织活动，提供课程培训，让大学生更好的培养与人沟通能力，认识新朋友，扩展交际圈。因为在当代社会，提高大学生交际能力是非常有必要。',0),(404,6,32,NULL,944,'网上商城买卖购物系统',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 12:17:32','近几年来，人们的生活质量不断提高，为了让人们的生活更智能，更智慧，必须借助线上的方式来实现用户既可以购物，又可以卖闲置的便捷网上售卖系统，该系统旨在提高人们生活水平，努力实现让人们足不出户，即享优质生活。',0),(405,3,41,NULL,783,'“互联网+”环协废弃物分类回收',1,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-04-01 12:07:31','“互联网+”与环协废弃物分类回收项目——依托现有协会，运用最热模式，开展新型项目。“依托现有协会”是指以Fresh环境保护协会作为依托，开展废弃物分类回收项目。“运用最热模式”是指利用“互联网+”模式，采取线上与线下相结合，线上发布废弃物回收信息，线下提供上门服务对废弃物进行回收处理。“新型项目”是指通过回收废品赚钱积分，积攒一定的积分以兑换小礼品。',0),(406,6,32,NULL,167,'大数据与软件工程学院VI系统的设计与推广',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 12:12:58','目前，梧州学院大数据与软件工程学院的形象体系尚未建立，识别度不高、各种活动标识未能统一、存在较多的规范问题，因此为了提高大数据与软件工程学院的形象标识，我们需要这样的一套VI系统。\n该项目将严格规定图形标识、中英文字体行形、标准色彩、象征性图案及其组合形式，可以很好的将学院标识系统作为视觉符号融入其中，并制定推广措施使之真正的被使用。良好的外在形象不仅对学院的宣传起到重要作用，而且更容易获得生源和就业方面的优势。这对梧州学院大数据与软件工程学院文化软实力的提升提供了有益的帮助，由此调动学院每个学生的积极性和归属感.',0),(407,1,49,NULL,753,'梧州地区传统村落文化保护研究——以料神、培中二村为例',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 12:22:05','一、项目简介（200字左右）\n本项目以梧州地区列入广西首批传统村落名录的2个村落为研究对象，为调研选点和现场素材采集等方面提供指引。拟通过查阅资料、田野调查等研究方法，较为系统地分析和揭示此地区传统村落文化演变的动因、影响因素和个性特色，并结合当地实际情况，尝试探寻如何保护该地区传统村落文化的途径。在一定程度上弥补对该地区传统村落文化研究不足的现状。为传统村落的相关研究提供些许借鉴；同时也为对该地区传统村落科学利用的后续研究做好铺垫。',0),(408,6,34,NULL,768,'基于低成本单镜头无人机倾斜摄影数据采集方法研究',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 12:33:01','       目前航空倾斜摄影经济成本和技术门槛高，不利于行业推广和应用。针对这个问题，本项目提出一种采用低成本单镜头无人机进行航空倾斜摄影数据采集与建模的技术方案，并通过对多个真实场景的实验，形成一套具体的通用实施方法、飞控软件及视频教程，申报专利等知识产权。',0),(409,3,52,NULL,919,'洗鞋吧',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 12:34:14','现在洗衣机以经走进千家万户，洗衣服的烦恼得到解决，但是洗鞋机的成本太高还未走进家庭，所以人们洗鞋子还是用老办法，这一直是人类的烦恼。开一家洗鞋店本不高，但利润高、资金回流快。根据一些调查报告显示有一大部分的人愿意花钱洗鞋，可见洗鞋市场潜力巨大，前景广阔。梧州学院甚至梧州市还没有一家专业的洗鞋店，因此，开一家鞋店前景是非常好的。在W校扔有许多宿舍未普及洗衣机，可见W校的洗衣市场是非常有前景的。\n',0),(410,2,43,NULL,945,'探究服装销售在020平台的盈利—以梧州学院为例',2,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 13:00:03','目前，服装行业市场多样化，女大学生们在有一定经济基础上，会注重自身形象。现今，梧州学院女生所占比例多，本团队以此借助网络（QQ群聊） 把进货的服装，通过成员试穿，拍照上传等让消费群体挑选的方式来发展女装服装行业。现网购已经成了每个人的购买习惯，但会遇到各种涉及到退换货物的情况，且网购运输时间长；而团队拥有货源，顾客可试穿衣服，直接看到上身效果，了解质量材质，颜色以及款式等，可直接购买衣服，省去退换货物的麻烦。',0),(411,7,31,NULL,67,'空中牧羊人',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 12:53:24','本项目的目的在于研发一种用于牧羊的无人机。牧羊人只需要简单操控无人就可以实时观测和驱逐羊群。无人机带载北斗和气压计，通过差分定点和估算三阶互补定高 ，可以实现精准定点，定高，返航功能。装载有摄像头和喇叭，可以实现实时监控羊群情况。采用PID控制器与ADRC控制器相互嵌套的新型联合控制器，解决传统PID控制器抗干扰软弱问题，改善飞行姿态的控制，使其具有强自抗干扰能力。加大地面人员的生命财产安全。实现无人机稳定精准的观测到羊群的功能。',0),(412,7,31,NULL,802,'智能酒驾安防系统的设计研发',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 12:58:09','针对目前酒后驾车危害性日趋严重，而交警手持式呼气检测设备又不能方便、全面的检测预防酒驾，设计了一款基于单片机和手机的智能车载防酒驾系统。该系统采用单片机开发连接酒精传感器、语音报警器、汽车制动系统、语音传输等硬件设备，酒精传感器检测车内空气酒精浓度超标后，系统发出声光报警器并禁止汽车发动，同时通过GPS模块进行车辆定位，并配备有救援服务系统及汽车防撞系统，使酒驾信息得到及时传播及处理，该系统具有简单、灵敏、安全等特点，可以有效监测酒后驾车行为，保护行车安全。',0),(413,6,32,NULL,338,'校园策划服务平台“策划者”',1,2,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 13:22:17','随着网络的迅速发展，当代大学生普遍生活在一个追求潮流，创新的社会环境里，一份可执行、创意突出并对接大学生需求的活动策划案，可有效的提升校园活动的目标性及可执行性。\n根据学生群体的需求，我们成立了“策划者”这个校园策划服务平台，结合校园文化，社团活动特色，提供更优质便捷的活动策划方案。',0),(414,5,36,NULL,942,'刘三姐特产网络营销',3,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 13:22:16','微商是一项跟得上时代潮流的项目，因为微营销的发展迅速而稳定，主要是通过网络营销和市场线下发展去销售，以营销战略的转型和灵活运用为基础，在网络上开业，却也更注重方法和各种策划，是一个更高于淘宝机械般的模式，是一个传统营销和网络营销的结合体，是一种现代思维创新的新突破，微营销可信度更高，知名度更广，更能容易让人接受，而且容易操作理解，可轻易实现人人可卖，人人可买的销售理念，而现在随着经济的发展，人们生活水平的提高，人们更加注重饮食，而刘三姐特产不仅能满足人们味觉的体验，更多的是对家乡的怀念，以及能推动当地的经济发展和文化交流。',0),(415,7,31,NULL,946,'基于STM32的无线智能家居控制系统',1,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 13:29:02','本项目是基于STM32的无线智能家居控制系统。该系统通过SIM900A模块的GPRS与ZigBee技术搭建一个无线传感网络系统，以此来实现单片机与手机之间的通信和实时监控。利用无线遥控对家用电器进行控制，实现没人在家也能智能控制电视，窗帘，灯光等。通过各个传感器对室内环境进行监控，一旦传感器检测到非正常情况，就会触发GSM模块短信报警，并且通过Zigbee无线通信模块将报警信息传送到手机，实现远程控制。本项目起到一定程度的节能、保护以及便利的作用，适合居家使用。',0),(416,8,57,NULL,949,'宾阳酸粉传承与发展现状研究',1,0,NULL,0,0,0,NULL,NULL,NULL,NULL,NULL,'本项目以宾阳酸粉为研究对象，旨在理清宾阳酸粉的历史来源、制作工艺、销售方式和现状及其蕴含的人情世故和地方文化等，深入挖掘其所蕴含的地方文化特色与其所蕴含的文化精神和现实意义，并为之撰写论文，补充学术界对宾阳酸粉相关研究的空白，并为宾阳酸粉的继承与保护以及传播和销售尽绵薄之力。此外，本项目还将在宾阳酸粉现有宣传和销售情况上，融入当地更多的特色内涵提出一些建议，从而赋予宾阳酸粉新的生命力。',0),(417,3,52,NULL,659,'美丽修型工作室',3,1,NULL,0,0,0,NULL,NULL,NULL,NULL,'2019-04-01 13:42:05','当前社会，国民经济处于上升阶段，企业、组织等团体越来越重视外貌形象；近年来新媒体视频播放量占比中时尚美妆方面也日益增长；化妆品市场前景广阔，而我国化妆品行业相对于国外市场还处于学习与上升阶段。\n此项目针对梧州学院大学生及周边人群，我们将开设一家妆发培训机构，以授课、营销、新媒体、电商平台等方式将妆发知识推广至此目标市场全面化，门店产品实现利益最大化。为目标对象填补妆发方面知识的同时也能实现工作室的发展和盈利。我们希望在不久的将来可以填补目标市场的空白，实现目标对象在步入社会前或进入社会后对自身形象的认识及改变。',0),(418,6,32,NULL,523,'‘易速之家’学生到站专线服务',2,1,NULL,0,0,1,NULL,NULL,NULL,NULL,'2019-04-01 13:39:34','    目前我国已经建立起了庞大的公路、铁路等交通网络，人们的出行越来越便利，但“最后一公里”问题始终是交通出行的一块心病。 每逢节假日，大学生从学校到车站是“最后一公里”问题中最大的问题，目前基本的解决方式是公共交通或网约车形式，若通过公共交通解决，会在短时间内造成交通压力过大，影响中途站点乘客上下车，若通过网约车解决则存在安全性和费用过高的问题。本项目拟通过与汽车运输公司合作，建立起学生交通需求和汽车运输公司空置资源的有效联系和沟通信息平台，利用移动互联技术和以及微信公众号、微信小程序或设计APP等形式解决节假日大学生出行的相关问题，在不造成公共交通压力的情况下以达到安全、高效、快捷、高性价比的目的。以“滴滴打车”、“12306”、 “拼多多”为模拟对象，充分与汽车运输公司合作，设计一套满足节假日大学生集体出行服务的软件，在梧州学院试点，在该模式成熟后推广至其他高校。',0),(419,1,49,NULL,951,'民族传统美食文化梧州“老味道”龟苓膏VI创新设计      ',1,0,NULL,0,0,0,NULL,NULL,NULL,NULL,NULL,'VI设计，以多样化的丰富的应用形式，给予人视觉上的享受，从而在最为广泛的层面上，最直接生动的将理念传播给大家。 \n  龟苓膏是梧州老牌的特色传统美食，在中国都有具有不俗的知名度和声誉，但时代的日异月新，正在渐渐不在被那么多年轻的消费者所青睐。\n  当用上新兴的VI设计碰上名族的老牌美食，创造出具有含有中国名族特色的美食文化的创意VI设计，让龟苓膏这样的具有名族文化的老牌美食重新带给大家不一样的认识，以全新的方式再次赢得大家喜爱。\n',0);
