运营尝试，可行性强。同意申报！','2019-04-01',0),(265,395,208,'同意通过','2019-04-01',0),(266,394,907,'从该项目申报表中反映的情况来看，该项目的研究基础较好，表现为：1.该项目成员的专业与所研究的方向相符，成员具有一定的专业理论知识。2.该团队能结合“一带一路”大背景下对现今的对外汉语文化传播进行创新研究，理论依据及项目流程逻辑清晰，且已具有前期的成果，若能很好的完成，其研究成果可实际应用于“一带一路”对外汉语文化教学中，成果会具有创新性与发展性。','2019-04-01',0),(267,153,71,'本研究针对路边农贸市场中乱摆摊的现象，从商家、流动商户、群众、监管者等角度调查问题的现状，分析问题产生的原因，并提出解决问题的途径。该选题具有一定的现实意义，能锻炼学生观察社会现实，思考和解决社会问题的能力。目前，学生正在修习《社会学》和《社会研究方法》课程，在解决这些调查问题方面有一定的理论指导，便于项目推进。建议立项。','2019-04-01',0),(268,301,640,'通过','2019-04-01',0),(269,396,211,'该课题具有具有一定的创新性，同意申报！','2019-04-01',0),(270,380,907,'本项目能够利用专业知识和地方文化结合起来进行研究具有一定的意义。特别是在跨文化交际下，以地方饮食文化与留学生两个因素结合起来，为该项目在创新点方面加分。','2019-04-01',0),(271,385,658,'传统服务网络化提供是“互联网+”应用的重要内容，本项目选题切合现实服务发展的需要，具有较强的实践意义。项目申请人和团队成员能专心学习和实践，基础较为扎实，成员间互补性强，具备完成项目的能力。\n同意申报。','2019-04-01',0),(272,401,217,'拟同意推荐','2019-04-01',0),(273,390,634,'该项目选题具有创新性，对于推动广西文化发展具有重要的意义，研究内容设计合理，技术路线可行。项目组成员具有扎实的专业知识，且来自广西少数民族地区，能运用实地调查方法获得直观丰富的研究资料，可望能顺利结题。同意申报。','2019-04-01',0),(274,408,106,'同意申报','2019-04-01',0),(275,407,380,'梧州地区传统村落蕴藏了丰富的文化积淀，受诸多因素的影响，村落的文化逐渐式微。项目拟以培中、料神二村为对象，通过其村落文化的发掘整理，提取出有价值的信息，并以环境设计专业的视角，对其文化进行保护性设计。对上述地区传统村落文化保护的多元化表达有着重要的借鉴意义。综上所述，同意本项目的申报！','2019-04-01',0),(276,305,115,'同意申请','2019-04-01',0),(277,397,843,'赵惠妍同学及其团队成员都是入党积极分子，对时政热点比较关注，对党的建设现状极为感兴趣，而且组员都来自边疆少数民族地区，对边疆少数民族地区基层党组织实际情况有很多了解。这次申报的《边疆少数民族地区基层党组织现状调查研究——以广西D县为例》大创项目，既符合当前形势的需要，也是实事求是的要求。该项目的研究有利于完善边疆地区少数民族基层党组织的对策，为广西地区其他少数民族基层党组织的党建提供理论参考，填补了该领域研究的空白。该团队完全胜任该项目的研究，可以按时结题。我很高兴担任他们的项目指导老师，特此推荐申报国家级项目。','2019-04-01',0),(278,392,843,'有史以来，广西就一直被人称为蛮夷之地，边疆地区。自秦汉以来，广西就陆续有移民迁入，随着中央政权统治的深入，内迁人口源源不断，特别是在明清两代，内迁人口达到一个高峰，且遍布广西各地，使广西地区民族杂居的局面不断扩大。且移民多来自发达地区，给广西带来了一定的发展机会，促进了当时的社会经济、文化等方面的发展。黄舒霞同学选择了《明清时期广西移民与经济社会变迁研究》作为大创项目，既具有历史意义，更具有现实意义。该研究通过对明清时期广西地区的外来移民给广西的经济社会变迁带来的诸多影响，可以为广西地区现阶段经济社会的发展提供参考依据。该团队的成员，其祖先都是明清时期移民到广西的，对本研究有莫大的帮助。该团队完全胜任该项目的研究，可以按时结题。我很高兴担任他们的项目指导老师，特此推荐申报国家级项目。','2019-04-01',0),(279,372,825,'本项目具有很好的可行性：第一，符合市场需求。在当前追求个性、追求生活美和注重塑造个人形象的时代下，本项目符合主要目标顾客：大学生对个人艺术相的需求。第二，具有良好的基础条件。对待工作认真负责，可以很好地完成本项目的各项工作。第三，具有良好的项目环境。本项目组成员都有班干、团干或学生会任职经历，熟悉学校情况，具有很好的人际交往能力。基于以上原因，同意推荐本项目立项。\n','2019-04-01',0),(280,413,72,'该课题具有一定的创新性和较好的市场应用前景，且项目组已开展了一些前期准备工作，同意申报。','2019-04-01',0),(281,384,924,'同意申报','2019-04-01',0),(282,316,450,'本课题研究主要研究并改进多轴飞行器的自动返航算法、自主规避算法、失联应急算法以及研究无人机的环境监测技术，使无人机在失去信号的状态下能够安全返航，改善多轴飞行器的安全性与稳定性，这对于改善无人机的安全性与促进无人机的广泛应用有十分重要的意义；课题的研究内容并非本科知识的简单延续和加深，而是要求学生在学习完程序设计，算法分析等课程后，并掌握一定硬件知识才可以完成，因此，本课题是学生综合利用程序设计、算法分析，硬件设计等知识解决专业实际问题的极好锻炼机会，课题研究是本科阶段专业知识的一次升华，对学生具有适度的挑战性。课题既紧扣无人机技术这一研究热点，具有实际意义，又可以锻炼和提升学生创新能力。\n    综上，同意推荐本课题作为大学生创新训练计划项目立项。 ','2019-04-01',0),(283,280,843,'民族文化是维系民族生存和发展的精神纽带。壮族是中国少数民族中占比例最多的一个民族。壮族有历史悠久、丰富的本民族文化，其中的“那文化”是壮族文化中的一个典型代表。石明萍同学选择了《边疆地区少数民族文化调查研究——以壮族“那文化”为例》作为大创项目，该项目将以广西的壮族“那文化”为例，以“那文化”的起源、发展和传承作为研究对象，深入的研究和探索“那文化”的内容、形式和特点，以及其对壮族和壮族人民的重要作用与影响。该研究有助于增进人们对于边疆少数民族文化的理解，有助于对边疆少数民族文化的保护，有助于促进少数民族的文化发展和繁荣。该研究意义重大。该团队的成员都是广西地区土生土长的壮族人，都会壮语略通壮文，从小就接触本民族的文化，受到本民族语言和文化的良好熏陶。他们对本民族文化的发展、传承和保护具有巨大的热情。该团队成员结构合理，有文有理，以文为主。该团队完全胜任该项目的研究，可以按时结题。我很高兴担任他们的项目指导老师，特此推荐申报国家级项目。','2019-04-01',0),(284,393,819,'该项目具有较强的可行性，符合高校学生生活实际需求，团队成员能够在技术方面实现项目的开展。','2019-04-01',0);
