INSERT INTO `innovate_match_review_point` VALUES (1,'指标1：创新性','突出原始创意的价值，不鼓励模仿。强调利用互联网技术、方法和思维在销售、研发、生产、物流、信息、人力、管理等方面寻求突破和创新。鼓励项目与高校科技成果转移转化相结合，有实物类成果可酌情加分。',40,1,0),(2,'指标2：团队情况','考察管理团队各成员的教育和工作背景、价值观念、擅长领域，成员的分工和业务互补情况；公司的组织构架、人员配置安排是否科学；创业顾问，主要投资人和持股情况；战略合作企业及其与本项目的关系，团队是否具有实现这种突破的具体方案和可能的资源基础。',30,1,0),(3,'指标3：商业性','在商业模式方面，强调设计的完整性与可行性，完整地描述商业模式，评测其盈利能力推导过程的合理性。在机会识别与利用、竞争与合作、技术基础、产品或服务设计、资金及人员需求、现行法律法规限制等方面具有可行性。在调查研究方面，考察行业调查研究程度，项目市场、技术等调查工作是否形成一手资料，不鼓励文献调查，强调田野调查和实际操作检验。',25,1,0),(4,'指标4：带动就业前景','综合考察项目发展战略和规模扩张策略的合理性和可行性，预判项目可能带动社会就业的能力。',5,1,0),(5,'指标1：创新性','突出原始创意的价值，不鼓励模仿。强调利用互联网技术、方法、思维在销售、研发、生产、物流、信息、人力、管理等方面寻求突破和创新。鼓励项目与高校科技成果转移转化相结合，有实物类成果可酌情加分。',20,2,0),(6,'指标2：团队情况','主要考察管理团队各成员有关的教育和工作背景、价值观念、擅长领域，成员的分工和业务互补情况；公司的组织构架、人员配置以及领导层成员；创业顾问，主要投资人和持股情况；战略合作企业及其与本项目的关系。',30,2,0),(7,'指标3：商业性','在经营绩效方面，重点考察项目存续时间、项目的营业收入、税收上缴、持续盈利能力、市场份额等情况；以及结合项目特点制定合适的市场营销策略，带来良性的业务利润、总资产收益、净资产收益、销售收入增长、投资与产出比等情况。在成长性方面，重点考察项目目标市场容量大小及可扩展性以及该项目是否有合适的计划和可能性（包括人力资源、资金、技术等方面）支持其未来5年的高速成长。在商业模式方面，强调项目设计的完整性与可行性，并给出完整的商业模式描述，以及在机会识别与利用、竞争与合作、技术基础、产品或服务设计、资金及人员需求、现行法律法规限制等方面需具有可行性。在融资方面，强调融资需求及资金使用规划。在经营绩效方面，重点考察项目存续时间、项目的营业收入、税收上缴、持续盈利能力、市场份额等情况；以及结合项目特点制定合适的市场营销策略，带来良性的业务利润、总资产收益、净资产收益、销售收入增长、投资与产出比等情况。在成长性方面，重点考察项目目标市场容量大小及可扩展性以及该项目是否有合适的计划和可能性（包括人力资源、资金、技术等方面）支持其未来5年的高速成长。在商业模式方面，强调项目设计的完整性与可行性，并给出完整的商业模式描述，以及在机会识别与利用、竞争与合作、技术基础、产品或服务设计、资金及人员需求、现行法律法规限制等方面需具有可行性。在融资方面，强调融资需求及资金使用规划。',40,2,0),(8,'指标4：带动就业前景','考察项目增加社会就业份额，发展战略和扩张的策略合理性，上下产业链的密切程度和带动效率、其他社会效益。',10,2,0),(9,'指标1：创新性','突出原始创意的价值，不鼓励模仿。强调利用互联网技术、方法、思维在销售、研发、生产、物流、信息、人力、管理等方面寻求突破和创新。鼓励项目与高校科技成果转移转化相结合，有实物类成果可酌情加分。',20,3,0),(10,'指标2：团队情况','主要考察管理团队各成员有关的教育和工作背景、价值观念、擅长领域，成员的分工和业务互补情况；公司的组织构架、人员配置以及领导层成员；创业顾问，主要投资人和持股情况；战略合作企业及其与本项目的关系。',30,3,0),(11,'指标3：商业性','在经营绩效方面，重点考察项目存续时间、项目的营业收入、税收上缴、持续盈利能力、市场份额等情况；以及结合项目特点制定合适的市场营销策略，带来良性的业务利润、总资产收益、净资产收益、销售收入增长、投资与产出比等情况。在成长性方面，重点考察项目目标市场容量大小及可扩展性以及该项目是否有合适的计划和可能性（包括人力资源、资金、技术等方面）支持其未来5年的高速成长。在商业模式方面，强调项目设计的完整性与可行性，并给出完整的商业模式描述，以及在机会识别与利用、竞争与合作、技术基础、产品或服务设计、资金及人员需求、现行法律法规限制等方面需具有可行性。在融资方面，强调融资需求及资金使用规划。',40,3,0),(12,'指标4：带动就业前景','考察项目增加社会就业份额，发展战略和扩张的策略合理性，上下产业链的密切程度和带动效率、其他社会效益。',10,3,0),(13,'指标1：创新性','【得分形式：单项得分（满足任一单项得满分）】岗位创新，技能创新，技术创新，技能创新，产业协同创新，模式创新',20,4,0),(14,'指标2：项目团队','【得分形式：加总得分】团队成员互补与协调性，组织结构设置合理性，股权结构设置合理性',20,4,0),(15,'指标3：商业性','【得分形式：加总得分】生存性和盈利能力，可行性和完整性，可复制性',20,4,0),(16,'指标4：带动就业','【得分形式：加总得分】与当地经济发展紧密结合，促进区域社会经济转型升级，带动就业人数',40,4,0),(17,'指标1：创新性','考察项目的技术创新程度和对创新技术的引入与应用（鼓励高校科研成果转化）；或者项目在生产、服务、营销等商业模式要素上的创新程度；或者项目组织与资源整合模式的创新程度。，有实物类成果可酌情加分。',20,5,0),(18,'指标2：项目团队','考察项目团队成员的基本素质和业务能力；奉献意愿和价值观；教育背景与相关工作活动经验；团队或公司组织架构与分工协作的合理性；团队权益结构或公司股权的合理性。',30,5,0),(19,'指标3：实效性','考察项目对精准扶贫脱贫和乡村振兴的贡献度。项目对农村组织和农民增收、地方产业结构优化的促进效果；或者对当地就业、教育、医疗、环境保护与生态建设等方面的促进效果。',30,5,0),(20,'指标4：可持续性','考察项目的持续生存能力和推广性。项目的存续时间、自造血能力、市场份额等，业务成长的计划和可能性（包括人力资源、资金、技术等方面支持其未来持续稳健增长）；或者在精准扶贫和乡村振兴方面形成的模式具有推广性。',20,5,0);
