--
-- Table structure for table `innovate_match_staff_info`
--

DROP TABLE IF EXISTS `innovate_match_staff_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `innovate_match_staff_info` (
  `staff_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `match_id` bigint(20) NOT NULL,
  `institute_id` bigint(20) DEFAULT NULL COMMENT '学院',
  `grade_id` bigint(20) DEFAULT NULL COMMENT '年级',
  `staff_name` varchar(50) DEFAULT NULL COMMENT '参与者姓名',
  `staff_sex` int(11) DEFAULT NULL COMMENT '参与者性别',
  `staff_stu_no` varchar(100) DEFAULT NULL COMMENT '参与者身份证号',
  `staff_class_no` varchar(50) DEFAULT NULL COMMENT '参与者所在班级',
  `staff_corm_no` varchar(50) DEFAULT NULL COMMENT '参与者所在宿舍',
  `staff_tel` varchar(50) DEFAULT NULL COMMENT '参与者联系电话',
  `staff_qq` varchar(50) DEFAULT NULL COMMENT '参与者qq',
  `staff_email` varchar(50) DEFAULT NULL COMMENT '参与者邮箱',
  `is_del` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除',
  PRIMARY KEY (`staff_id`),
  KEY `institute_id` (`institute_id`),
  KEY `grade_id` (`grade_id`),
  KEY `match_id` (`match_id`),
  CONSTRAINT `innovate_match_staff_info_ibfk_1` FOREIGN KEY (`institute_id`) REFERENCES `innovate_sys_institute` (`institute_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `innovate_match_staff_info_ibfk_2` FOREIGN KEY (`grade_id`) REFERENCES `innovate_sys_grade` (`grade_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `innovate_match_staff_info_ibfk_3` FOREIGN KEY (`match_id`) REFERENCES `innovate_match_info` (`match_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=746 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

