INSERT INTO `sys_role` VALUES (1,'超级管理员','唯一，能管理所有用户和数据，拥有所有管理权限',1,'2018-10-18 16:13:20'),(2,'项目负责人','由学生本人作为项目、参赛队伍的负责人在系统中注册账号，账号生成后，可拥有功能模块一、功能模块二、功能模块三的报名、个人信息填写、修改，并提交给指导老师账号的权限',1,'2018-11-06 21:46:21'),(3,'指导老师','账号由管理员提供，并赋予审核、修改学生账号的报名信息、将材料提交给上一级账号审核或否决学生材料的权限',1,'2018-11-06 21:46:53'),(4,'二级学院','账号由管理员提供，并赋予审核指导老师提交材料、向上一级账号提交材料或否决指导老师材料的权限',1,'2018-11-07 09:12:34'),(5,'管理员','由创新创业教育学院工作人员担任，拥有提供账号、赋予账号权限等级、材料的最终审核的权限',1,'2018-11-07 09:12:47'),(6,'评委','账号由管理员提供，并赋予给相关材料打分、审核的权限',1,'2018-11-07 09:13:14');
/*!40000 ALTER TABLE `sys_role` ENABLE KEYS */;
UNLOCK TABLES;

